EXTRACTED_DATA:
{
  "audio_duration": 3588.5193,
  "segments": [
    {
      "end": 1.663,
      "speaker_label": "SPEAKER_10",
      "start": 1.162,
      "text": "Hello, everyone."
    },
    {
      "end": 6.348,
      "speaker_label": "SPEAKER_10",
      "start": 2.724,
      "text": "Thank you for attending today's Q1 fiscal year 2025 Snowflake Earnings Call."
    },
    {
      "end": 9.15,
      "speaker_label": "SPEAKER_10",
      "start": 7.248,
      "text": "My name is Sierra, and I will be your moderator today."
    },
    {
      "end": 15.818,
      "speaker_label": "SPEAKER_10",
      "start": 10.772,
      "text": "All lines will be muted during the presentation portion of the call, with an opportunity for questions and answers at the end."
    },
    {
      "end": 21.043,
      "speaker_label": "SPEAKER_10",
      "start": 16.879,
      "text": "If you would like to ask a question, please press star, followed by one, on your telephone keypad."
    },
    {
      "end": 26.629,
      "speaker_label": "SPEAKER_10",
      "start": 22.304,
      "text": "I would now like to pass the conference over to our host, Jimmy Sexton, Head of Investor Relations."
    },
    {
      "end": 33.226,
      "speaker_label": "SPEAKER_12",
      "start": 28.921,
      "text": "Good afternoon, and thanks for joining us on Snowflake's Q1 fiscal 2025 earnings call."
    },
    {
      "end": 44.398,
      "speaker_label": "SPEAKER_12",
      "start": 33.847,
      "text": "Joining me on the call today is Sridhar Ramaswamy, our Chief Executive Officer, Mike Scarpelli, our Chief Financial Officer, and Christian Kleinemann, our Executive Vice President of Product, who will participate in the Q&A session."
    },
    {
      "end": 52.988,
      "speaker_label": "SPEAKER_12",
      "start": 45.239,
      "text": "During today's call, we will review our financial results for the first quarter fiscal 2025 and discuss our guidance for the second quarter and full year fiscal 2025."
    },
    {
      "end": 60.116,
      "speaker_label": "SPEAKER_12",
      "start": 53.947,
      "text": "During today's call, we will make forward-looking statements, including statements related to our business operations and financial performance."
    },
    {
      "end": 65.904,
      "speaker_label": "SPEAKER_12",
      "start": 60.136,
      "text": "These statements are subject to risks and uncertainties, which could cause them to differ mentally from actual results."
    },
    {
      "end": 74.015,
      "speaker_label": "SPEAKER_12",
      "start": 65.924,
      "text": "Information concerning these risks and uncertainties is available in the earnings press release, our most recent form, 10A and 10Q, and our other SEC reports."
    },
    {
      "end": 78.381,
      "speaker_label": "SPEAKER_12",
      "start": 74.996,
      "text": "All our statements are made as of today based on information currently available to us."
    },
    {
      "end": 82.587,
      "speaker_label": "SPEAKER_12",
      "start": 78.962,
      "text": "Except as defined by law, we assume no obligation to update any such statements."
    },
    {
      "end": 86.447,
      "speaker_label": "SPEAKER_12",
      "start": 83.242,
      "text": "During today's call, we will also discuss certain non-GAAP financial measures."
    },
    {
      "end": 90.714,
      "speaker_label": "SPEAKER_12",
      "start": 86.988,
      "text": "A reconciliation of GAAP to non-GAAP measures is included in today's earnings press release."
    },
    {
      "end": 98.207,
      "speaker_label": "SPEAKER_12",
      "start": 91.295,
      "text": "The earnings press release and an accompanying investor presentation are available on our website at investors.snowflake.com."
    },
    {
      "end": 100.951,
      "speaker_label": "SPEAKER_12",
      "start": 98.227,
      "text": "A replay of today's call will also be posted on the website."
    },
    {
      "end": 103.456,
      "speaker_label": "SPEAKER_12",
      "start": 101.292,
      "text": "With that, I would now like to turn the call over to Sridhar."
    },
    {
      "end": 107.342,
      "speaker_label": "SPEAKER_07",
      "start": 105.058,
      "text": "Thanks, Jimmy, and good afternoon, everyone."
    },
    {
      "end": 116.377,
      "speaker_label": "SPEAKER_07",
      "start": 108.689,
      "text": "Before we get into it, many of you have given me a warm welcome to my new role over the past few months, and I just wanted to say thank you."
    },
    {
      "end": 122.463,
      "speaker_label": "SPEAKER_07",
      "start": 118.279,
      "text": "I've been focused on three key priorities in my first quarter at CEO."
    },
    {
      "end": 134.676,
      "speaker_label": "SPEAKER_07",
      "start": 123.645,
      "text": "Listening to and learning from our customers, driving execution and alignment within our go-to-market teams, and fueling our innovation and product delivery."
    },
    {
      "end": 138.24,
      "speaker_label": "SPEAKER_07",
      "start": 135.817,
      "text": "I have been really impressed by how the team has responded"
    },
    {
      "end": 141.493,
      "speaker_label": "SPEAKER_07",
      "start": 138.49,
      "text": "and by our overall pace of play."
    },
    {
      "end": 146.818,
      "speaker_label": "SPEAKER_07",
      "start": 141.513,
      "text": "We have a lot of opportunity ahead of us, and there's a lot of excitement across our company to go and get it."
    },
    {
      "end": 162.755,
      "speaker_label": "SPEAKER_07",
      "start": 149.041,
      "text": "When I look at the Snowflake growth story, it was first driven by an amazing data product, and then by the layers of collaboration and applications that we added on top to make Snowflake a true data cloud."
    },
    {
      "end": 167.94,
      "speaker_label": "SPEAKER_07",
      "start": 164.096,
      "text": "What is exciting about AI is that it can turbocharge our capabilities"
    },
    {
      "end": 170.867,
      "speaker_label": "SPEAKER_07",
      "start": 168.123,
      "text": "and growth on all three layers."
    },
    {
      "end": 180.001,
      "speaker_label": "SPEAKER_07",
      "start": 172.129,
      "text": "It also helps democratize access to all the amazing enterprise data in Snowflake, massively increasing our reach."
    },
    {
      "end": 189.034,
      "speaker_label": "SPEAKER_07",
      "start": 181.363,
      "text": "The progress we have made in AI over the last year, culminating in the past quarter, is remarkable."
    },
    {
      "end": 197.286,
      "speaker_label": "SPEAKER_07",
      "start": 189.935,
      "text": "We believe AI is going to continue to fuel our platform, helping our customers perform and deliver customer experiences"
    },
    {
      "end": 198.411,
      "speaker_label": "SPEAKER_07",
      "start": 197.57,
      "text": "better than ever."
    },
    {
      "end": 204.496,
      "speaker_label": "SPEAKER_07",
      "start": 199.632,
      "text": "As evidence for our Q1 results, our core business is very strong."
    },
    {
      "end": 212.143,
      "speaker_label": "SPEAKER_07",
      "start": 205.217,
      "text": "We are still in the early innings of our plan to bring our world-class data platform to customers around the globe."
    },
    {
      "end": 220.31,
      "speaker_label": "SPEAKER_07",
      "start": 213.024,
      "text": "And in the first quarter alone, we saw some of our largest customers meaningfully increase their usage of our core offering."
    },
    {
      "end": 227.577,
      "speaker_label": "SPEAKER_07",
      "start": 221.752,
      "text": "The combination of our incredibly strong data cloud, now powerfully boosted by AI,"
    },
    {
      "end": 231.219,
      "speaker_label": "SPEAKER_07",
      "start": 227.995,
      "text": "is the strength and story of Snowflake."
    },
    {
      "end": 236.707,
      "speaker_label": "SPEAKER_07",
      "start": 232.601,
      "text": "I want to touch on our Q1 results, and Mike will get into the details with you."
    },
    {
      "end": 241.954,
      "speaker_label": "SPEAKER_07",
      "start": 238.61,
      "text": "I'm really proud that our team delivered a very strong Q1."
    },
    {
      "end": 250.246,
      "speaker_label": "SPEAKER_07",
      "start": 242.956,
      "text": "Product revenue for the quarter was $790 million, up 34% year-over-year."
    },
    {
      "end": 255.353,
      "speaker_label": "SPEAKER_07",
      "start": 250.266,
      "text": "Remaining performance obligations totaled $5 billion, year-over-growth"
    },
    {
      "end": 258.712,
      "speaker_label": "SPEAKER_07",
      "start": 255.788,
      "text": "Year-over-year growth accelerated to 46%."
    },
    {
      "end": 263.46,
      "speaker_label": "SPEAKER_07",
      "start": 260.014,
      "text": "A non-GAAP adjusted free cash flow margin was 44%."
    },
    {
      "end": 269.99,
      "speaker_label": "SPEAKER_07",
      "start": 265.663,
      "text": "Given the strong quarter, we are increasing our product revenue outlook for the year."
    },
    {
      "end": 276.159,
      "speaker_label": "SPEAKER_07",
      "start": 271.652,
      "text": "Working through the second quarter and beyond, our priorities remain the same."
    },
    {
      "end": 283.23,
      "speaker_label": "SPEAKER_07",
      "start": 277.702,
      "text": "I've had conversations with over 100 customers over the past several months, and I'm very optimistic."
    },
    {
      "end": 291.822,
      "speaker_label": "SPEAKER_07",
      "start": 284.071,
      "text": "Snowflake is a beloved platform and the value we bring comes through in every customer conversation I have."
    },
    {
      "end": 295.728,
      "speaker_label": "SPEAKER_07",
      "start": 293.184,
      "text": "We are critical in helping our customers run their businesses."
    },
    {
      "end": 299.113,
      "speaker_label": "SPEAKER_07",
      "start": 297.15,
      "text": "For example, one of the largest U.S."
    },
    {
      "end": 303.018,
      "speaker_label": "SPEAKER_07",
      "start": 299.153,
      "text": "telcos relies on us to help them close their books every month."
    },
    {
      "end": 308.806,
      "speaker_label": "SPEAKER_07",
      "start": 304.04,
      "text": "We also help a global financial service customer from their counterparty credit risk process."
    },
    {
      "end": 313.453,
      "speaker_label": "SPEAKER_07",
      "start": 309.748,
      "text": "The art of the possible on Snowflake is really incredible."
    },
    {
      "end": 319.156,
      "speaker_label": "SPEAKER_07",
      "start": 314.75,
      "text": "It's also probably no surprise that AI is top of mind for our customers as well."
    },
    {
      "end": 327.126,
      "speaker_label": "SPEAKER_07",
      "start": 320.557,
      "text": "They want to make all business data in Snowflake available to everyone, not just the business analyst."
    },
    {
      "end": 334.335,
      "speaker_label": "SPEAKER_07",
      "start": 328.047,
      "text": "They want us to help drive clarity, value creation, and reliability as they enter this new frontier."
    },
    {
      "end": 342.445,
      "speaker_label": "SPEAKER_07",
      "start": 335.777,
      "text": "Over the last quarter, my time spent with our go-to-market teams has been focused on driving execution and alignment."
    },
    {
      "end": 350.989,
      "speaker_label": "SPEAKER_07",
      "start": 343.538,
      "text": "Internally, we emphasize consumption and new customer acquisition, and we are developing an end-to-end cadence for both priorities."
    },
    {
      "end": 356.918,
      "speaker_label": "SPEAKER_07",
      "start": 352.011,
      "text": "This includes developing sales motions in specific workloads, such as AI and data engineering."
    },
    {
      "end": 363.227,
      "speaker_label": "SPEAKER_07",
      "start": 358.059,
      "text": "We have more to gain as we standardize our consumption mindset and effectively execute."
    },
    {
      "end": 368.635,
      "speaker_label": "SPEAKER_07",
      "start": 364.329,
      "text": "We expect that this efficiency will contribute to further revenue growth."
    },
    {
      "end": 376.566,
      "speaker_label": "SPEAKER_07",
      "start": 370.015,
      "text": "Those who know me know that I have a relentless focus on product innovation and delivery."
    },
    {
      "end": 380.092,
      "speaker_label": "SPEAKER_07",
      "start": 376.586,
      "text": "Teams across the company are building and delivering at an incredible pace."
    },
    {
      "end": 385.582,
      "speaker_label": "SPEAKER_07",
      "start": 381.194,
      "text": "Earlier this month, we announced that Cortex, our AI layer, is generally available."
    },
    {
      "end": 394.437,
      "speaker_label": "SPEAKER_07",
      "start": 387.665,
      "text": "Iceberg, Snowpark Container Services, and Hybrid Tables will all be generally available later this year."
    },
    {
      "end": 401.449,
      "speaker_label": "SPEAKER_07",
      "start": 395.682,
      "text": "We are investing in AI and machine learning, and our pace of progress in a short amount of time has been fantastic."
    },
    {
      "end": 407.416,
      "speaker_label": "SPEAKER_07",
      "start": 402.53,
      "text": "What is resonating most with our customers is that we are bringing differentiation to the market."
    },
    {
      "end": 413.203,
      "speaker_label": "SPEAKER_07",
      "start": 407.977,
      "text": "Snowflake delivers enterprise AI that is easy, efficient, and trusted."
    },
    {
      "end": 418.77,
      "speaker_label": "SPEAKER_07",
      "start": 414.385,
      "text": "You've seen an impressive ramp in Cortex AI customer adoption since going generally available."
    },
    {
      "end": 423.816,
      "speaker_label": "SPEAKER_07",
      "start": 419.551,
      "text": "As of last week, over 750 customers are using these capabilities."
    },
    {
      "end": 428.956,
      "speaker_label": "SPEAKER_07",
      "start": 425.112,
      "text": "Cortex can increase productivity by reducing time-consuming tasks."
    },
    {
      "end": 437.485,
      "speaker_label": "SPEAKER_07",
      "start": 429.637,
      "text": "For example, Sigma Computing uses Cortex language models to summarize and categorize customer communications from their CRM."
    },
    {
      "end": 443.672,
      "speaker_label": "SPEAKER_07",
      "start": 438.786,
      "text": "In the quarter, we also announced Arctic, our own language model."
    },
    {
      "end": 451.66,
      "speaker_label": "SPEAKER_07",
      "start": 443.692,
      "text": "Arctic outperforms leading open models such as LAMA 270B and Mixtrol 8x7B in various benchmarks."
    },
    {
      "end": 458.221,
      "speaker_label": "SPEAKER_07",
      "start": 452.534,
      "text": "We developed RTIC in less than three months at one-eighth the training cost of peer models."
    },
    {
      "end": 463.387,
      "speaker_label": "SPEAKER_07",
      "start": 460.984,
      "text": "AI is a bridge between structured and unstructured data."
    },
    {
      "end": 465.65,
      "speaker_label": "SPEAKER_07",
      "start": 463.948,
      "text": "We see this with Document AI."
    },
    {
      "end": 470.256,
      "speaker_label": "SPEAKER_07",
      "start": 465.67,
      "text": "Customers find value in extracting features on the fly from piles of documents."
    },
    {
      "end": 477.985,
      "speaker_label": "SPEAKER_07",
      "start": 471.898,
      "text": "We're making meaningful progress on snow park container services being generally available in the second half of the year."
    },
    {
      "end": 484.739,
      "speaker_label": "SPEAKER_07",
      "start": 478.37,
      "text": "And dozens of partners are already building solutions that will leverage container services to serve their end customers."
    },
    {
      "end": 490.607,
      "speaker_label": "SPEAKER_07",
      "start": 486.321,
      "text": "We view Snowpark and other new features as our emerging businesses."
    },
    {
      "end": 496.094,
      "speaker_label": "SPEAKER_07",
      "start": 491.628,
      "text": "These are in the early days of revenue contribution, but we're seeing very healthy demand."
    },
    {
      "end": 500.701,
      "speaker_label": "SPEAKER_07",
      "start": 497.456,
      "text": "More than 50% of customers are using Snowpark as of Q1."
    },
    {
      "end": 504.546,
      "speaker_label": "SPEAKER_07",
      "start": 501.682,
      "text": "Revenue from Snowpark is driven by Spark migrations."
    },
    {
      "end": 511.34,
      "speaker_label": "SPEAKER_07",
      "start": 505.133,
      "text": "In Q1, we began the process of migrating several large Global 2000 customers to Snowpark."
    },
    {
      "end": 518.047,
      "speaker_label": "SPEAKER_07",
      "start": 513.482,
      "text": "Our collaboration capability is also a key competitive advantage for us."
    },
    {
      "end": 526.917,
      "speaker_label": "SPEAKER_07",
      "start": 519.288,
      "text": "Nearly a third of our customers are sharing data products as of Q1 2025, up from 24% one year ago."
    },
    {
      "end": 532.643,
      "speaker_label": "SPEAKER_07",
      "start": 529.039,
      "text": "Collaboration already serves as a vehicle for new customer acquisition."
    },
    {
      "end": 546.097,
      "speaker_label": "SPEAKER_07",
      "start": 533.5,
      "text": "Through a strategic collaboration with Fiserv, Snowflake was chosen by more than 20 Fiserv financial institutions and merchant clients to enable secure, direct access to their financial data and insights."
    },
    {
      "end": 551.103,
      "speaker_label": "SPEAKER_07",
      "start": 548.36,
      "text": "We announced support for unstructured data over two years ago."
    },
    {
      "end": 557.391,
      "speaker_label": "SPEAKER_07",
      "start": 551.864,
      "text": "Now, about 40% of our customers are processing unstructured data on Snowflake."
    },
    {
      "end": 561.617,
      "speaker_label": "SPEAKER_07",
      "start": 557.411,
      "text": "And we've added more than 1,000 customers in this category over the last six months."
    },
    {
      "end": 567.987,
      "speaker_label": "SPEAKER_07",
      "start": 563.2,
      "text": "Iceberg is enabling us to play offense and address a larger data footprint."
    },
    {
      "end": 574.236,
      "speaker_label": "SPEAKER_07",
      "start": 568.007,
      "text": "Many of our largest customers have indicated that they will now leverage Snowflake for more workloads as a result of this functionality."
    },
    {
      "end": 579.124,
      "speaker_label": "SPEAKER_07",
      "start": 575.438,
      "text": "More than 300 customers are using Iceberg in public preview."
    },
    {
      "end": 584.171,
      "speaker_label": "SPEAKER_07",
      "start": 580.726,
      "text": "Snowflake has a powerful and unique partner ecosystem."
    },
    {
      "end": 589.579,
      "speaker_label": "SPEAKER_07",
      "start": 585.193,
      "text": "Part of our success is that we have many partners that amplify the power of our platform."
    },
    {
      "end": 596.095,
      "speaker_label": "SPEAKER_07",
      "start": 590.167,
      "text": "They range from big organizations like EY and Deloitte, but also firms like LTI Mindtree and Next Pathway."
    },
    {
      "end": 602.443,
      "speaker_label": "SPEAKER_07",
      "start": 597.136,
      "text": "SMP Global sees us as a strong collaborator in their cloud distribution model."
    },
    {
      "end": 612.836,
      "speaker_label": "SPEAKER_07",
      "start": 603.544,
      "text": "And companies like Observe, Blue Yonder, Relational AI, Fivetran, Hex, and Domo have built their software on top of Snowflake."
    },
    {
      "end": 618.503,
      "speaker_label": "SPEAKER_07",
      "start": 612.856,
      "text": "These partners bring on entirely new capabilities and unlock new use cases for us and our customers."
    },
    {
      "end": 631.545,
      "speaker_label": "SPEAKER_07",
      "start": 619.208,
      "text": "They also often bring new customers to us, and they really care about how easy it is to build on Snowflake, how reliable Snowflake is, and also about how we can go to customers jointly."
    },
    {
      "end": 634.528,
      "speaker_label": "SPEAKER_07",
      "start": 631.565,
      "text": "Partners bring enormous power to our data cloud vision."
    },
    {
      "end": 637.593,
      "speaker_label": "SPEAKER_07",
      "start": 634.549,
      "text": "Their success creates success for us and our customers."
    },
    {
      "end": 644.642,
      "speaker_label": "SPEAKER_07",
      "start": 640.116,
      "text": "To wrap it up, Snowflake is the world's best enterprise AI data platform."
    },
    {
      "end": 652.579,
      "speaker_label": "SPEAKER_07",
      "start": 645.55,
      "text": "Combined with our collaboration capability and thriving application platform, we are driving powerful network effects that will fuel our growth."
    },
    {
      "end": 657.665,
      "speaker_label": "SPEAKER_07",
      "start": 653.36,
      "text": "AI vastly amplifies this opportunity, both in the near and medium terms."
    },
    {
      "end": 662.792,
      "speaker_label": "SPEAKER_07",
      "start": 658.767,
      "text": "Our product philosophy is simple."
    },
    {
      "end": 665.175,
      "speaker_label": "SPEAKER_07",
      "start": 662.812,
      "text": "One platform with all features available."
    },
    {
      "end": 670.381,
      "speaker_label": "SPEAKER_07",
      "start": 666.477,
      "text": "We are turning every analyst and data engineer into a sophisticated AI analyst."
    },
    {
      "end": 674.747,
      "speaker_label": "SPEAKER_07",
      "start": 670.402,
      "text": "The magic of Snowflake is that we make difficult tasks easy."
    },
    {
      "end": 681.22,
      "speaker_label": "SPEAKER_07",
      "start": 675.875,
      "text": "Stay tuned for more to come at Snowflake Data Cloud Summit coming up in San Francisco, June 3rd through the 6th."
    },
    {
      "end": 683.342,
      "speaker_label": "SPEAKER_07",
      "start": 682.081,
      "text": "I look forward to seeing you all there."
    },
    {
      "end": 686.765,
      "speaker_label": "SPEAKER_07",
      "start": 684.022,
      "text": "Now, I'll turn it over to Mike."
    },
    {
      "end": 687.546,
      "speaker_label": "SPEAKER_00",
      "start": 686.785,
      "text": "Thank you, Sridhar."
    },
    {
      "end": 693.751,
      "speaker_label": "SPEAKER_00",
      "start": 688.507,
      "text": "Q1 product revenue grew 34% year-over-year to $790 million."
    },
    {
      "end": 703.08,
      "speaker_label": "SPEAKER_00",
      "start": 693.892,
      "text": "Our largest growth contributors included a media and entertainment global 2,000 and a large retail and consumer goods company."
    },
    {
      "end": 708.9,
      "speaker_label": "SPEAKER_00",
      "start": 703.634,
      "text": "Smaller accounts outside of the Global 2000 were an important source of outperformance."
    },
    {
      "end": 713.885,
      "speaker_label": "SPEAKER_00",
      "start": 709.74,
      "text": "Intra-quarter, we saw strong growth in February and March."
    },
    {
      "end": 715.326,
      "speaker_label": "SPEAKER_00",
      "start": 713.905,
      "text": "Growth moderated in April."
    },
    {
      "end": 719.931,
      "speaker_label": "SPEAKER_00",
      "start": 715.867,
      "text": "We view this variability as a normal component of the business."
    },
    {
      "end": 726.819,
      "speaker_label": "SPEAKER_00",
      "start": 720.992,
      "text": "Excluding the impact of leap year, product revenue grew approximately 32% year-over-year."
    },
    {
      "end": 732.004,
      "speaker_label": "SPEAKER_00",
      "start": 727.719,
      "text": "We continue to see signs of a stable optimization environment."
    },
    {
      "end": 735.415,
      "speaker_label": "SPEAKER_00",
      "start": 732.372,
      "text": "Seven of our top 10 customers grew quarter over quarter."
    },
    {
      "end": 741.801,
      "speaker_label": "SPEAKER_00",
      "start": 736.536,
      "text": "Q1 marked the first quarter under our FY25 sales compensation plan."
    },
    {
      "end": 745.625,
      "speaker_label": "SPEAKER_00",
      "start": 742.482,
      "text": "Our sales reps are executing well against their plan."
    },
    {
      "end": 751.19,
      "speaker_label": "SPEAKER_00",
      "start": 746.406,
      "text": "In Q1, we exceeded our new customer acquisition and consumption quotas."
    },
    {
      "end": 758.437,
      "speaker_label": "SPEAKER_00",
      "start": 752.331,
      "text": "Non-GAAP product gross margin of 76.9% was down slightly year over year."
    },
    {
      "end": 761.08,
      "speaker_label": "SPEAKER_00",
      "start": 759.238,
      "text": "As mentioned on our prior call,"
    },
    {
      "end": 767.284,
      "speaker_label": "SPEAKER_00",
      "start": 761.397,
      "text": "We have headwinds associated with GPU-related costs as we invest in new AI initiatives."
    },
    {
      "end": 773.652,
      "speaker_label": "SPEAKER_00",
      "start": 768.285,
      "text": "Our non-GAAP operating margin of 4% benefited from revenue of performance."
    },
    {
      "end": 778.077,
      "speaker_label": "SPEAKER_00",
      "start": 774.673,
      "text": "Our non-GAAP adjusted free cash flow margin was 44%."
    },
    {
      "end": 786.788,
      "speaker_label": "SPEAKER_00",
      "start": 778.257,
      "text": "As a reminder, Q1 and Q4 are our seasonally strong quarters for non-GAAP adjusted free cash flow."
    },
    {
      "end": 788.67,
      "speaker_label": "SPEAKER_00",
      "start": 787.709,
      "text": "We ended the quarter"
    },
    {
      "end": 795.379,
      "speaker_label": "SPEAKER_00",
      "start": 788.971,
      "text": "with $4.5 billion in cash, cash equivalents, short-term and long-term investments."
    },
    {
      "end": 805.651,
      "speaker_label": "SPEAKER_00",
      "start": 796.28,
      "text": "In Q1, we used $516 million to repurchase 3 million shares at an average price of $173.14."
    },
    {
      "end": 814.381,
      "speaker_label": "SPEAKER_00",
      "start": 808.133,
      "text": "We have $892 million remaining under our original $2 billion authorization."
    },
    {
      "end": 816.984,
      "speaker_label": "SPEAKER_00",
      "start": 815.222,
      "text": "Now, let's turn to our outlook."
    },
    {
      "end": 818.826,
      "speaker_label": "SPEAKER_00",
      "start": 817.985,
      "text": "As a reminder,"
    },
    {
      "end": 823.18,
      "speaker_label": "SPEAKER_00",
      "start": 819.076,
      "text": "We only forecast product revenue based on observed behavior."
    },
    {
      "end": 828.784,
      "speaker_label": "SPEAKER_00",
      "start": 823.8,
      "text": "This means our FY25 guidance includes contributions from snow park."
    },
    {
      "end": 836.972,
      "speaker_label": "SPEAKER_00",
      "start": 829.585,
      "text": "FY25 guidance does not include revenue from newer features such as Cortex until we see material consumption."
    },
    {
      "end": 840.555,
      "speaker_label": "SPEAKER_00",
      "start": 838.533,
      "text": "Iceberg will be GA later this year."
    },
    {
      "end": 846.42,
      "speaker_label": "SPEAKER_00",
      "start": 841.195,
      "text": "We have invested in Iceberg because we expect it to increase our future revenue opportunity."
    },
    {
      "end": 848.982,
      "speaker_label": "SPEAKER_00",
      "start": 847,
      "text": "However, for the purpose of guidance,"
    },
    {
      "end": 856.498,
      "speaker_label": "SPEAKER_00",
      "start": 849.248,
      "text": "We continue to model revenue headwinds associated with the movement of data out of Snowflake and into iceberg storage."
    },
    {
      "end": 860.243,
      "speaker_label": "SPEAKER_00",
      "start": 857.219,
      "text": "The negative impact is weighted to the back half of the year."
    },
    {
      "end": 867.913,
      "speaker_label": "SPEAKER_00",
      "start": 861.425,
      "text": "For Q2, we expect product revenue between $805 and $810 million."
    },
    {
      "end": 872.68,
      "speaker_label": "SPEAKER_00",
      "start": 868.594,
      "text": "We are increasing our FY25 product revenue guidance."
    },
    {
      "end": 878.648,
      "speaker_label": "SPEAKER_00",
      "start": 873.221,
      "text": "We now expect full-year product revenue of approximately $3.3 billion and"
    },
    {
      "end": 881.584,
      "speaker_label": "SPEAKER_00",
      "start": 878.881,
      "text": "representing 24% year-over-year growth."
    },
    {
      "end": 892.254,
      "speaker_label": "SPEAKER_00",
      "start": 882.525,
      "text": "Turning to margins, we are lowering our full-year margin guidance in light of increased GPU-related costs related to our AI initiatives."
    },
    {
      "end": 901.784,
      "speaker_label": "SPEAKER_00",
      "start": 892.755,
      "text": "We are operating in a rapidly evolving market, and we view these investments as key to unlocking additional revenue opportunities in the future."
    },
    {
      "end": 908.23,
      "speaker_label": "SPEAKER_00",
      "start": 902.504,
      "text": "As a reminder, we have GPU-related costs in both cost of revenue and R&D."
    },
    {
      "end": 915.335,
      "speaker_label": "SPEAKER_00",
      "start": 909.188,
      "text": "We announced our intent to acquire certain technology assets and hire key employees from Truera."
    },
    {
      "end": 927.029,
      "speaker_label": "SPEAKER_00",
      "start": 915.916,
      "text": "Truera is an AI observability platform that provides capabilities to evaluate and monitor large language model apps and machine learning models and production."
    },
    {
      "end": 932.896,
      "speaker_label": "SPEAKER_00",
      "start": 927.77,
      "text": "We are excited to welcome approximately 35 employees from Truera to Snowflake."
    },
    {
      "end": 936.58,
      "speaker_label": "SPEAKER_00",
      "start": 932.956,
      "text": "The impact of the transaction is reflected in our outlook."
    },
    {
      "end": 941.895,
      "speaker_label": "SPEAKER_00",
      "start": 937.471,
      "text": "For Q2, we expect 3% non-GAAP operating margin."
    },
    {
      "end": 955.748,
      "speaker_label": "SPEAKER_00",
      "start": 942.716,
      "text": "For FY25, we expect 75% non-GAAP product gross margin, 3% non-GAAP operating margin, and 26% non-GAAP adjusted free cash flow margin."
    },
    {
      "end": 966.178,
      "speaker_label": "SPEAKER_00",
      "start": 956.569,
      "text": "Finally, we will host our Investor Day on June 4th in San Francisco in conjunction with the Snowflake Data Cloud Summit, our annual users conference."
    },
    {
      "end": 971.566,
      "speaker_label": "SPEAKER_00",
      "start": 966.479,
      "text": "If you are interested in attending, please email IR at snowflake.com."
    },
    {
      "end": 975.171,
      "speaker_label": "SPEAKER_00",
      "start": 972.267,
      "text": "With that, operator, you can now open up the line for questions."
    },
    {
      "end": 978.195,
      "speaker_label": "SPEAKER_10",
      "start": 977.835,
      "text": "Thank you."
    },
    {
      "end": 980.618,
      "speaker_label": "SPEAKER_10",
      "start": 979.297,
      "text": "We will now begin the Q&A session."
    },
    {
      "end": 985.425,
      "speaker_label": "SPEAKER_10",
      "start": 981.62,
      "text": "If you would like to ask a question, please press star followed by 1 on your telephone keypad."
    },
    {
      "end": 989.17,
      "speaker_label": "SPEAKER_10",
      "start": 986.467,
      "text": "If you would like to remove that question, press star followed by 2."
    },
    {
      "end": 994.798,
      "speaker_label": "SPEAKER_10",
      "start": 990.452,
      "text": "And if you are using a speaker phone, please pick up your handset before asking your question."
    },
    {
      "end": 998.586,
      "speaker_label": "SPEAKER_10",
      "start": 996.044,
      "text": "Our first question today comes from Keith Wise with Morgan Stanley."
    },
    {
      "end": 999.767,
      "speaker_label": "SPEAKER_10",
      "start": 999.207,
      "text": "Please proceed."
    },
    {
      "end": 1003.17,
      "speaker_label": "SPEAKER_04",
      "start": 1002.57,
      "text": "Excellent."
    },
    {
      "end": 1006.553,
      "speaker_label": "SPEAKER_04",
      "start": 1003.371,
      "text": "Very nice quarter, guys, and thank you for taking the question."
    },
    {
      "end": 1014.781,
      "speaker_label": "SPEAKER_04",
      "start": 1008.455,
      "text": "Looking at the front page of the investor relations page, 5 billion queries."
    },
    {
      "end": 1018.424,
      "speaker_label": "SPEAKER_04",
      "start": 1014.801,
      "text": "Looks like your query volume is actually accelerating now again."
    },
    {
      "end": 1022.147,
      "speaker_label": "SPEAKER_04",
      "start": 1019.004,
      "text": "Can you walk us through some of the drivers of that acceleration?"
    },
    {
      "end": 1025.19,
      "speaker_label": "SPEAKER_04",
      "start": 1022.187,
      "text": "Is it new products that are driving the acceleration, or is it"
    },
    {
      "end": 1028.304,
      "speaker_label": "SPEAKER_04",
      "start": 1025.44,
      "text": "the relief of optimization or just like better data sharing."
    },
    {
      "end": 1031.629,
      "speaker_label": "SPEAKER_04",
      "start": 1028.324,
      "text": "So just a little bit more clarity on what's driving that acceleration."
    },
    {
      "end": 1038.399,
      "speaker_label": "SPEAKER_04",
      "start": 1031.989,
      "text": "And then on the other side of that equation, it looks like there's still pressures on like the price per query."
    },
    {
      "end": 1045.349,
      "speaker_label": "SPEAKER_04",
      "start": 1039.32,
      "text": "Any indications on whether that like pressure on the price per query is coming more from the compute side of the equation or the storage side of the equation?"
    },
    {
      "end": 1047.111,
      "speaker_label": "SPEAKER_04",
      "start": 1045.909,
      "text": "Any color there would be super helpful."
    },
    {
      "end": 1051.802,
      "speaker_label": "SPEAKER_07",
      "start": 1051.04,
      "text": "Thank you."
    },
    {
      "end": 1068.542,
      "speaker_label": "SPEAKER_07",
      "start": 1052.263,
      "text": "Overall, as both Mike and I said, our core business is very strong and growth is coming from both new customers as well as expansion from existing customers."
    },
    {
      "end": 1080.83,
      "speaker_label": "SPEAKER_07",
      "start": 1068.775,
      "text": "As we gain more on different kinds of workloads, for example, AI, data engineering are increasing quite nicely."
    },
    {
      "end": 1086.177,
      "speaker_label": "SPEAKER_07",
      "start": 1081.371,
      "text": "They're all contributing to additional query growth."
    },
    {
      "end": 1091.664,
      "speaker_label": "SPEAKER_07",
      "start": 1086.197,
      "text": "And the relationship between query growth and cost per query is not a simple, straightforward one."
    },
    {
      "end": 1095.289,
      "speaker_label": "SPEAKER_07",
      "start": 1092.265,
      "text": "And we look for broad growth across"
    },
    {
      "end": 1102.276,
      "speaker_label": "SPEAKER_07",
      "start": 1095.59,
      "text": "the different categories of workloads that we handle, and they've all been doing really well."
    },
    {
      "end": 1116.911,
      "speaker_label": "SPEAKER_10",
      "start": 1114.308,
      "text": "Our next question today comes from Mark Murphy with JPMorgan."
    },
    {
      "end": 1118.432,
      "speaker_label": "SPEAKER_10",
      "start": 1117.932,
      "text": "Please proceed."
    },
    {
      "end": 1120.894,
      "speaker_label": "SPEAKER_02",
      "start": 1119.493,
      "text": "Thank you very much."
    },
    {
      "end": 1122.576,
      "speaker_label": "SPEAKER_02",
      "start": 1120.914,
      "text": "I'll add my congratulations."
    },
    {
      "end": 1128.078,
      "speaker_label": "SPEAKER_02",
      "start": 1122.91,
      "text": "Sridhar, you trained Arctic LLM with pretty amazing efficiency."
    },
    {
      "end": 1136.772,
      "speaker_label": "SPEAKER_02",
      "start": 1128.419,
      "text": "Can you walk us through the architectural difference in the product that might allow it to run more efficiently than other products out there in the market?"
    },
    {
      "end": 1146.066,
      "speaker_label": "SPEAKER_02",
      "start": 1137.312,
      "text": "And Mike, is there any directional change to the $50 million target for GPU spend this year, just considering the"
    },
    {
      "end": 1151.847,
      "speaker_label": "SPEAKER_02",
      "start": 1146.417,
      "text": "The launch of Cortex and Arctic LLM, and it sounds like some snow park traction."
    },
    {
      "end": 1153.45,
      "speaker_label": "SPEAKER_02",
      "start": 1151.907,
      "text": "Should we think of that trending a little higher?"
    },
    {
      "end": 1157.357,
      "speaker_label": "SPEAKER_07",
      "start": 1156.976,
      "text": "Thank you."
    },
    {
      "end": 1158.819,
      "speaker_label": "SPEAKER_07",
      "start": 1157.537,
      "text": "So, absolutely."
    },
    {
      "end": 1170.4,
      "speaker_label": "SPEAKER_07",
      "start": 1159.18,
      "text": "We did train Arctic in a remarkably short period of time, a little over three months, on a remarkably small amount of GPU compute."
    },
    {
      "end": 1177.285,
      "speaker_label": "SPEAKER_07",
      "start": 1170.734,
      "text": "A lot of the training efficiency of these models do come from architectures."
    },
    {
      "end": 1181.592,
      "speaker_label": "SPEAKER_07",
      "start": 1177.805,
      "text": "We had a rather unique mixture of experts architecture."
    },
    {
      "end": 1191.848,
      "speaker_label": "SPEAKER_07",
      "start": 1182.052,
      "text": "These are increasingly the architectures that are driving impressive gains for all of the other leading AI companies."
    },
    {
      "end": 1222.189,
      "speaker_label": "SPEAKER_07",
      "start": 1192.199,
      "text": "But what also went into it was just an amazing amount of pre-experimentation in order to figure out things like what are the right data sets, what order should they be fed in, and how do we make sure that they're actually optimizing for enterprise metrics, the kind of things our customers care about, which are things like are these models really good at creating SQL queries, for example, so that they can talk to data."
    },
    {
      "end": 1235.503,
      "speaker_label": "SPEAKER_07",
      "start": 1222.388,
      "text": "And so we are taking very much the view of how do we make AI much better in an enterprise context because, you know, naturally that's the place where we have the most value to add."
    },
    {
      "end": 1243.452,
      "speaker_label": "SPEAKER_07",
      "start": 1235.72,
      "text": "And, you know, our AI budgets are modest in the scheme of things."
    },
    {
      "end": 1253.347,
      "speaker_label": "SPEAKER_07",
      "start": 1243.933,
      "text": "And so being creative in how we develop these models is something that the team, you know, comes to naturally expect."
    },
    {
      "end": 1260.218,
      "speaker_label": "SPEAKER_07",
      "start": 1253.728,
      "text": "And I think that kind of, you know, discipline and scarcity, to be honest, produces a lot of innovation."
    },
    {
      "end": 1263.583,
      "speaker_label": "SPEAKER_07",
      "start": 1260.719,
      "text": "And I think that's what you're seeing."
    },
    {
      "end": 1274.078,
      "speaker_label": "SPEAKER_07",
      "start": 1263.783,
      "text": "And then in terms of investments, I'll hand over to Mike in a second, but I'm comfortable with the amount of investments that we are making."
    },
    {
      "end": 1284.593,
      "speaker_label": "SPEAKER_07",
      "start": 1274.939,
      "text": "Part of what we gain as Snowflake is the ability to fast follow on a number of fronts, is the ability to optimize"
    },
    {
      "end": 1291.686,
      "speaker_label": "SPEAKER_07",
      "start": 1284.573,
      "text": "against metrics that we care about, not producing the latest, greatest, biggest model, let's say, for image generation."
    },
    {
      "end": 1300.662,
      "speaker_label": "SPEAKER_07",
      "start": 1291.706,
      "text": "And so having that kind of focus lets us operate on a relatively modest budget pretty efficiently."
    },
    {
      "end": 1305.45,
      "speaker_label": "SPEAKER_07",
      "start": 1301.323,
      "text": "And so the focus very much now is on"
    },
    {
      "end": 1310.239,
      "speaker_label": "SPEAKER_07",
      "start": 1305.65,
      "text": "How do we take all of the products that we have released into production?"
    },
    {
      "end": 1317.352,
      "speaker_label": "SPEAKER_07",
      "start": 1310.299,
      "text": "We have over 750 customers that are busy developing against our AI platform."
    },
    {
      "end": 1328.113,
      "speaker_label": "SPEAKER_07",
      "start": 1318.074,
      "text": "This is a fast-moving space, but we are very comfortable with both the pace, the investment, and the choices that we are making to make AI effective for Snowflakes."
    },
    {
      "end": 1328.654,
      "speaker_label": "SPEAKER_07",
      "start": 1328.093,
      "text": "Mike?"
    },
    {
      "end": 1339.189,
      "speaker_label": "SPEAKER_00",
      "start": 1329.335,
      "text": "And I will add that, yes, we think we may be spending a little bit more on GPUs, but it's also people that we're hiring specifically in AI."
    },
    {
      "end": 1342.133,
      "speaker_label": "SPEAKER_00",
      "start": 1339.269,
      "text": "We talked about the acquisition of Truera."
    },
    {
      "end": 1345.217,
      "speaker_label": "SPEAKER_00",
      "start": 1342.573,
      "text": "Those people all fall into that organization."
    },
    {
      "end": 1356.733,
      "speaker_label": "SPEAKER_00",
      "start": 1345.277,
      "text": "And so, as I mentioned, the world of AI is rapidly evolving and we're investing in that because we do think there's a massive opportunity for Snowflake to play there."
    },
    {
      "end": 1360.845,
      "speaker_label": "SPEAKER_00",
      "start": 1357,
      "text": "and it will have meaningful impact on future revenues."
    },
    {
      "end": 1364.269,
      "speaker_label": "SPEAKER_00",
      "start": 1363.608,
      "text": "Thank you very much."
    },
    {
      "end": 1372.138,
      "speaker_label": "SPEAKER_10",
      "start": 1367.613,
      "text": "Our next question today comes from Kirk Martin with Evercore."
    },
    {
      "end": 1372.658,
      "speaker_label": "SPEAKER_10",
      "start": 1372.158,
      "text": "Please proceed."
    },
    {
      "end": 1377.244,
      "speaker_label": "SPEAKER_06",
      "start": 1374.561,
      "text": "Yeah, thanks very much and congrats on the quarter."
    },
    {
      "end": 1384.172,
      "speaker_label": "SPEAKER_06",
      "start": 1377.264,
      "text": "Sridhar, can you just talk a little bit about how we should think about your customers' time to value with Cortex, meaning"
    },
    {
      "end": 1392.256,
      "speaker_label": "SPEAKER_06",
      "start": 1384.523,
      "text": "How long do you think it takes them to start using the technology before it can start to translate into a little bit faster consumption patterns?"
    },
    {
      "end": 1393.918,
      "speaker_label": "SPEAKER_06",
      "start": 1392.756,
      "text": "And then just one for Mike."
    },
    {
      "end": 1395.681,
      "speaker_label": "SPEAKER_06",
      "start": 1393.978,
      "text": "Mike, can you just talk a little bit about deferred?"
    },
    {
      "end": 1399.307,
      "speaker_label": "SPEAKER_06",
      "start": 1395.701,
      "text": "This quarter is down perhaps a little bit more sequentially than we've seen in prior years."
    },
    {
      "end": 1402.693,
      "speaker_label": "SPEAKER_06",
      "start": 1399.327,
      "text": "I don't know if there's any one time in nature there, but if you just touch upon that, that'd be great."
    },
    {
      "end": 1403.193,
      "speaker_label": "SPEAKER_06",
      "start": 1402.793,
      "text": "Thank you all."
    },
    {
      "end": 1406.879,
      "speaker_label": "SPEAKER_07",
      "start": 1406.499,
      "text": "Thank you."
    },
    {
      "end": 1411.527,
      "speaker_label": "SPEAKER_07",
      "start": 1406.92,
      "text": "One of the cool things about Cortex AI"
    },
    {
      "end": 1422.06,
      "speaker_label": "SPEAKER_07",
      "start": 1411.81,
      "text": "and our AI products in general in the context of the consumption model is that our customers don't have to make big investments to see what value that they're going to get."
    },
    {
      "end": 1430.469,
      "speaker_label": "SPEAKER_07",
      "start": 1423.562,
      "text": "Because they don't have to make commitments to how many GPUs that they're going to be renting, for example."
    },
    {
      "end": 1439.758,
      "speaker_label": "SPEAKER_07",
      "start": 1431.089,
      "text": "They just use Cortex AI, for example, from SQL, which is very, very easy to do without a pre-commit."
    },
    {
      "end": 1445.649,
      "speaker_label": "SPEAKER_07",
      "start": 1440.262,
      "text": "And this means that they can focus very much on sort of value creation."
    },
    {
      "end": 1453.2,
      "speaker_label": "SPEAKER_07",
      "start": 1446.15,
      "text": "And the structure of Cortex AI is also so that anybody that can write SQL can now begin to do really interesting things."
    },
    {
      "end": 1465.577,
      "speaker_label": "SPEAKER_07",
      "start": 1453.3,
      "text": "For example, look at how often, let's say, a particular product was mentioned in an earnings transcript, or being able to go from other kinds of unstructured information"
    },
    {
      "end": 1477.652,
      "speaker_label": "SPEAKER_07",
      "start": 1465.557,
      "text": "like whether it is text or whether it is images, to structured information, which Document AI, our AI product there, does."
    },
    {
      "end": 1493.151,
      "speaker_label": "SPEAKER_07",
      "start": 1478.072,
      "text": "And so we very much want to structure all of these efforts as ones in which our customers are able to iterate very quickly, take things to production, get value out of it, and then make bigger commitments on top."
    },
    {
      "end": 1499.381,
      "speaker_label": "SPEAKER_07",
      "start": 1493.333,
      "text": "And that's one of the benefits that you get from making the technology super easy to adopt."
    },
    {
      "end": 1501.043,
      "speaker_label": "SPEAKER_07",
      "start": 1499.421,
      "text": "There's not a massive learning curve."
    },
    {
      "end": 1509.534,
      "speaker_label": "SPEAKER_07",
      "start": 1501.704,
      "text": "Neither is there a GPU commitment or other kinds of software engineering that needs to happen in order to use AI with Snowflake."
    },
    {
      "end": 1520.168,
      "speaker_label": "SPEAKER_00",
      "start": 1509.554,
      "text": "Yeah, and your question on deferred, Kurt, if you're referring to January to today, the end of the year, Q4 is always a very, very big billing quarter."
    },
    {
      "end": 1526.843,
      "speaker_label": "SPEAKER_00",
      "start": 1520.418,
      "text": "Q1 is not as big of a billing quarter, so you have that flowing through on the deferred revenue."
    },
    {
      "end": 1542.176,
      "speaker_label": "SPEAKER_00",
      "start": 1527.244,
      "text": "However, RPO, and you can see RPO, as Sridhar mentioned, is up 46% year over year, and we do have, for instance, we signed a $100 million deal this quarter with a customer who pays us monthly in arrears so it doesn't show up in deferred revenue."
    },
    {
      "end": 1550.003,
      "speaker_label": "SPEAKER_00",
      "start": 1542.537,
      "text": "We've signed a number of deals with big companies that pass monthly in arrears that don't show up in deferred revenue, but they're in"
    },
    {
      "end": 1553.566,
      "speaker_label": "SPEAKER_00",
      "start": 1550.303,
      "text": "That's helpful."
    },
    {
      "end": 1554.247,
      "speaker_label": "SPEAKER_06",
      "start": 1553.686,
      "text": "Thanks, Mike."
    },
    {
      "end": 1554.727,
      "speaker_label": "SPEAKER_06",
      "start": 1554.267,
      "text": "Thanks, Radar."
    },
    {
      "end": 1555.388,
      "speaker_label": "SPEAKER_06",
      "start": 1554.747,
      "text": "Appreciate it."
    },
    {
      "end": 1562.655,
      "speaker_label": "SPEAKER_10",
      "start": 1559.292,
      "text": "Our next question today comes from Carl Curseed with UBS."
    },
    {
      "end": 1563.977,
      "speaker_label": "SPEAKER_10",
      "start": 1563.456,
      "text": "Please proceed."
    },
    {
      "end": 1575.628,
      "speaker_label": "SPEAKER_10",
      "start": 1574.507,
      "text": "Carl, your line is now open."
    },
    {
      "end": 1578.471,
      "speaker_label": "SPEAKER_03",
      "start": 1577.17,
      "text": "I'm sorry."
    },
    {
      "end": 1584.642,
      "speaker_label": "SPEAKER_03",
      "start": 1578.856,
      "text": "Mike, could you elaborate on the comment that usage growth moderated in April?"
    },
    {
      "end": 1588.427,
      "speaker_label": "SPEAKER_03",
      "start": 1585.283,
      "text": "Maybe you could unpack that and explain why it usually does."
    },
    {
      "end": 1594.353,
      "speaker_label": "SPEAKER_03",
      "start": 1588.647,
      "text": "And then also, when I look at your 2Q and fiscal 25 revenue guidance, it's actually pretty solid."
    },
    {
      "end": 1604.204,
      "speaker_label": "SPEAKER_03",
      "start": 1594.373,
      "text": "So that would lead one to believe that whatever moderation there might be in April, it doesn't feel like it, according to your guidance, rolled into May."
    },
    {
      "end": 1607.188,
      "speaker_label": "SPEAKER_03",
      "start": 1604.244,
      "text": "Just curious if that's the correct interpretation."
    },
    {
      "end": 1607.648,
      "speaker_label": "SPEAKER_03",
      "start": 1607.268,
      "text": "Thank you."
    },
    {
      "end": 1612.405,
      "speaker_label": "SPEAKER_00",
      "start": 1609.282,
      "text": "Well, what I would say is February and March were very strong."
    },
    {
      "end": 1615.088,
      "speaker_label": "SPEAKER_00",
      "start": 1613.206,
      "text": "And I'm saying April was more muted."
    },
    {
      "end": 1622.737,
      "speaker_label": "SPEAKER_00",
      "start": 1615.289,
      "text": "April, just as a reminder, and it really impacts you in Europe and some others, that is Ascension Day or Easter holiday."
    },
    {
      "end": 1624.919,
      "speaker_label": "SPEAKER_00",
      "start": 1622.777,
      "text": "And in Europe, they take a long time off."
    },
    {
      "end": 1627.162,
      "speaker_label": "SPEAKER_00",
      "start": 1624.939,
      "text": "That does have an impact on consumption."
    },
    {
      "end": 1630.125,
      "speaker_label": "SPEAKER_00",
      "start": 1627.362,
      "text": "Remember, this is a daily consumption model."
    },
    {
      "end": 1636.812,
      "speaker_label": "SPEAKER_00",
      "start": 1630.786,
      "text": "And the guidance we gave is based upon what we're seeing through our customers as of this week."
    },
    {
      "end": 1639.255,
      "speaker_label": "SPEAKER_03",
      "start": 1638.935,
      "text": "Okay."
    },
    {
      "end": 1641.212,
      "speaker_label": "SPEAKER_03",
      "start": 1639.69,
      "text": "And Mike, if I could ask a follow-up."
    },
    {
      "end": 1657.23,
      "speaker_label": "SPEAKER_03",
      "start": 1641.792,
      "text": "You had mentioned previously, including I think at a conference in March, that your efforts around that tiered storage side, whereby we could see some roll-off on the storage revenues, could begin to impact the P&L in the April quarter."
    },
    {
      "end": 1658.011,
      "speaker_label": "SPEAKER_03",
      "start": 1657.27,
      "text": "Was that the case?"
    },
    {
      "end": 1664.919,
      "speaker_label": "SPEAKER_03",
      "start": 1658.111,
      "text": "And would you be able to approximate what impact maybe the roll-off on the storage revenues had?"
    },
    {
      "end": 1665.56,
      "speaker_label": "SPEAKER_03",
      "start": 1665.199,
      "text": "Thank you."
    },
    {
      "end": 1667.622,
      "speaker_label": "SPEAKER_00",
      "start": 1667.322,
      "text": "Sure."
    },
    {
      "end": 1679.861,
      "speaker_label": "SPEAKER_00",
      "start": 1667.922,
      "text": "We did roll out to all of our customers, and we started, by the way, doing it at the end of last year, whereby depending on the amount of commitment you're making on an annual basis, you get tiered storage pricing."
    },
    {
      "end": 1684.969,
      "speaker_label": "SPEAKER_00",
      "start": 1679.901,
      "text": "So in essence, you get your storage discounted from the list price of $23 per terabyte."
    },
    {
      "end": 1692.26,
      "speaker_label": "SPEAKER_00",
      "start": 1685.429,
      "text": "We started rolling that out, and that actually in the quarter impacted us somewhere between $6 and $8 million."
    },
    {
      "end": 1694.824,
      "speaker_label": "SPEAKER_00",
      "start": 1692.28,
      "text": "I forget exactly what that is that is pure storage."
    },
    {
      "end": 1696.633,
      "speaker_label": "SPEAKER_00",
      "start": 1695.091,
      "text": "margin that that impacted."
    },
    {
      "end": 1703.02,
      "speaker_label": "SPEAKER_00",
      "start": 1696.693,
      "text": "That's not to say there are other customers, big customers, where we've always discounted their storage given their size."
    },
    {
      "end": 1713.591,
      "speaker_label": "SPEAKER_00",
      "start": 1703.04,
      "text": "That is just the pure because of the tiered storage that's rolled out to everyone and that will continue to have an impact as people continue to renew their contracts."
    },
    {
      "end": 1721.439,
      "speaker_label": "SPEAKER_00",
      "start": 1713.631,
      "text": "But storage mix as a percent of revenue has remained pretty much consistent at 11% of our revenue is associated with storage."
    },
    {
      "end": 1722.921,
      "speaker_label": "SPEAKER_00",
      "start": 1721.86,
      "text": "That did not change."
    },
    {
      "end": 1730.447,
      "speaker_label": "SPEAKER_00",
      "start": 1723.998,
      "text": "We're actually seeing growth in storage in Snowflake."
    },
    {
      "end": 1732.811,
      "speaker_label": "SPEAKER_00",
      "start": 1732.55,
      "text": "Got it."
    },
    {
      "end": 1733.371,
      "speaker_label": "SPEAKER_03",
      "start": 1733.151,
      "text": "Okay."
    },
    {
      "end": 1734.393,
      "speaker_label": "SPEAKER_03",
      "start": 1733.391,
      "text": "Thank you for both answers."
    },
    {
      "end": 1734.974,
      "speaker_label": "SPEAKER_03",
      "start": 1734.413,
      "text": "Super helpful."
    },
    {
      "end": 1742.504,
      "speaker_label": "SPEAKER_10",
      "start": 1739.36,
      "text": "Our next question comes from Raymond Lynchdow with Barclays."
    },
    {
      "end": 1743.105,
      "speaker_label": "SPEAKER_10",
      "start": 1742.524,
      "text": "Please proceed."
    },
    {
      "end": 1744.848,
      "speaker_label": "SPEAKER_09",
      "start": 1744.167,
      "text": "Thank you."
    },
    {
      "end": 1749.955,
      "speaker_label": "SPEAKER_09",
      "start": 1745.048,
      "text": "Thank you for all your comments around the AI evolution for you guys."
    },
    {
      "end": 1758.683,
      "speaker_label": "SPEAKER_09",
      "start": 1750.154,
      "text": "Is there a kind of a vision for you or where's the demarcation line in a way where you want to play versus where you don't want to play in this kind of new AI world?"
    },
    {
      "end": 1764.149,
      "speaker_label": "SPEAKER_09",
      "start": 1759.484,
      "text": "You know, obviously, you know, like, you know, there's like, how many LLMs do you need to own?"
    },
    {
      "end": 1770.856,
      "speaker_label": "SPEAKER_09",
      "start": 1764.409,
      "text": "You know, the acquisition today, the question is like, do you need to do observability or is that more a people hire with kind of knowledge?"
    },
    {
      "end": 1773.799,
      "speaker_label": "SPEAKER_09",
      "start": 1770.896,
      "text": "Can you just kind of, how is your thinking there evolving?"
    },
    {
      "end": 1774.32,
      "speaker_label": "SPEAKER_09",
      "start": 1773.979,
      "text": "Thank you."
    },
    {
      "end": 1779.385,
      "speaker_label": "SPEAKER_07",
      "start": 1776.442,
      "text": "This is a fabulous question."
    },
    {
      "end": 1795.623,
      "speaker_label": "SPEAKER_07",
      "start": 1779.618,
      "text": "Like, first and foremost, I think it is important for all of us to acknowledge that AI language models are going to have an impact at multiple levels of what you can think of as a data stack."
    },
    {
      "end": 1804.056,
      "speaker_label": "SPEAKER_07",
      "start": 1795.683,
      "text": "So, for example, the way in which people are going to be migrating from an old system, an on-prem system, to something like Snowflake."
    },
    {
      "end": 1810.089,
      "speaker_label": "SPEAKER_07",
      "start": 1804.34,
      "text": "is going to be aided by the presence of a co-pilot that can do much of the translation."
    },
    {
      "end": 1815.958,
      "speaker_label": "SPEAKER_07",
      "start": 1810.169,
      "text": "We already have such a translation product and we think AI is going to make that go even faster."
    },
    {
      "end": 1830.921,
      "speaker_label": "SPEAKER_07",
      "start": 1816.659,
      "text": "But in other areas like data cleansing, data engineering that are perhaps not as sexy but nevertheless require a huge amount of investment in order to make sure that the data is enterprise grade, we think AI is going to play a big role"
    },
    {
      "end": 1839.085,
      "speaker_label": "SPEAKER_07",
      "start": 1831.087,
      "text": "Both in the creation of those pipelines, but also in things like how does one make sure that the data is clean."
    },
    {
      "end": 1849.568,
      "speaker_label": "SPEAKER_07",
      "start": 1839.145,
      "text": "For example, if PII accidentally slips into a table or a distribution goes very wonky language models can help detect deviations from from patterns."
    },
    {
      "end": 1870.527,
      "speaker_label": "SPEAKER_07",
      "start": 1849.902,
      "text": "And then going up the stack, we have a very acclaimed product for writing SQL, our copilot within our user interface that can significantly accelerate an analyst's ability to get to know a data set and be productive with it."
    },
    {
      "end": 1882.626,
      "speaker_label": "SPEAKER_07",
      "start": 1870.827,
      "text": "And then of course to something like a data API, which now begins to put enterprise data into the hands of a business user, but with a very high degree of reliability."
    },
    {
      "end": 1887.893,
      "speaker_label": "SPEAKER_07",
      "start": 1882.842,
      "text": "And so my point is that there is broad impact."
    },
    {
      "end": 1901.323,
      "speaker_label": "SPEAKER_07",
      "start": 1888.374,
      "text": "And I think things like automating some of the work that an analyst has to do, for example, to troubleshoot problems, will be things that a language model can do."
    },
    {
      "end": 1925.235,
      "speaker_label": "SPEAKER_07",
      "start": 1901.624,
      "text": "Having said that, for a variety of problems, small models, which we are perfectly capable of developing from scratch, like we have done for Document AI, or more a mid-sized model, like what we did with Arctic, actually suffices for the vast majority of the applications that I'm talking about."
    },
    {
      "end": 1930.423,
      "speaker_label": "SPEAKER_07",
      "start": 1925.215,
      "text": "And so, you know, there are academic benchmarks like there's one called MMLU."
    },
    {
      "end": 1939.276,
      "speaker_label": "SPEAKER_07",
      "start": 1930.483,
      "text": "It's a notoriously difficult benchmark and depends very much on model size and how many dollars people are throwing at training those models."
    },
    {
      "end": 1945.705,
      "speaker_label": "SPEAKER_07",
      "start": 1940.177,
      "text": "We can get a huge amount done with a small team under modest investment."
    },
    {
      "end": 1953.418,
      "speaker_label": "SPEAKER_07",
      "start": 1945.685,
      "text": "without needing to play at that level where companies are talking about spending billions of dollars."
    },
    {
      "end": 1955.963,
      "speaker_label": "SPEAKER_07",
      "start": 1953.839,
      "text": "I don't think we need to be there."
    },
    {
      "end": 1965.82,
      "speaker_label": "SPEAKER_07",
      "start": 1956.604,
      "text": "I think being very focused on what we need to deliver for our customers will take us a long way with the amount of investments that we are making."
    },
    {
      "end": 1969.632,
      "speaker_label": "SPEAKER_07",
      "start": 1965.985,
      "text": "And finally, I will add that we have amazing partnerships with a ton of people."
    },
    {
      "end": 1980.334,
      "speaker_label": "SPEAKER_07",
      "start": 1970.053,
      "text": "Even today, I wrote about how we are collaborating with landing.ai, Andrew Ng's company, but we have partnerships with Mistral, with Reka, with a ton of other companies."
    },
    {
      "end": 1987.588,
      "speaker_label": "SPEAKER_07",
      "start": 1980.414,
      "text": "The field of AI is so large that I don't think there's going to be one company that is going to make every model that every person is going to use."
    },
    {
      "end": 2003.796,
      "speaker_label": "SPEAKER_07",
      "start": 1987.568,
      "text": "We are very good at developing the models that we need in our core, and we actively collaborate with a large set of players for other kinds of models, and obviously they see value in the 10,000 customers we have and being able to go to market together."
    },
    {
      "end": 2010.148,
      "speaker_label": "SPEAKER_07",
      "start": 2004.638,
      "text": "And so I think this is likely to continue for the indefinite future in terms of what we need to do."
    },
    {
      "end": 2012.512,
      "speaker_label": "SPEAKER_09",
      "start": 2012.231,
      "text": "Okay, perfect."
    },
    {
      "end": 2012.732,
      "speaker_label": "SPEAKER_09",
      "start": 2012.532,
      "text": "Thank you."
    },
    {
      "end": 2018.628,
      "speaker_label": "SPEAKER_10",
      "start": 2016.425,
      "text": "Our next question today comes from Brent Till with Jefferies."
    },
    {
      "end": 2019.729,
      "speaker_label": "SPEAKER_10",
      "start": 2019.148,
      "text": "Please proceed."
    },
    {
      "end": 2034.006,
      "speaker_label": "SPEAKER_17",
      "start": 2022.292,
      "text": "Mike, on the acceleration of RPO up 46%, I know you mentioned the $100 million deal, but was there anything else that was surprising to you in the quarter that helped in this re-acceleration?"
    },
    {
      "end": 2038.111,
      "speaker_label": "SPEAKER_17",
      "start": 2034.106,
      "text": "Any other notable trends that maybe you haven't seen or you're starting to see now?"
    },
    {
      "end": 2043.377,
      "speaker_label": "SPEAKER_00",
      "start": 2040.634,
      "text": "Remember that 46% is up year over year."
    },
    {
      "end": 2051.362,
      "speaker_label": "SPEAKER_00",
      "start": 2044.994,
      "text": "The year ago comparison didn't have the $250 million deal we signed in Q4 that went into there."
    },
    {
      "end": 2055.367,
      "speaker_label": "SPEAKER_00",
      "start": 2051.762,
      "text": "There was another $100 million deal that was signed subsequent to that too."
    },
    {
      "end": 2064.858,
      "speaker_label": "SPEAKER_00",
      "start": 2056.648,
      "text": "But what I will say is, as I mentioned, we're very pleased with the number of CAP1s in our bookings in Q1."
    },
    {
      "end": 2071.947,
      "speaker_label": "SPEAKER_00",
      "start": 2065.559,
      "text": "And there are, as I mentioned, we did a $100 million deal in Q1 and we will do another"
    },
    {
      "end": 2075.323,
      "speaker_label": "SPEAKER_00",
      "start": 2072.18,
      "text": "$100 million deal this quarter, potentially two."
    },
    {
      "end": 2083.852,
      "speaker_label": "SPEAKER_00",
      "start": 2076.504,
      "text": "So we're very pleased with our business and more of the commitment that our customers are making in Snowflake long term."
    },
    {
      "end": 2091.52,
      "speaker_label": "SPEAKER_17",
      "start": 2086.615,
      "text": "And quickly for Sridhar, I know you mentioned the priorities are the same, but you are the new CEO."
    },
    {
      "end": 2096.365,
      "speaker_label": "SPEAKER_17",
      "start": 2091.56,
      "text": "I guess from your perspective, where are your top priorities for the rest of 24?"
    },
    {
      "end": 2101.069,
      "speaker_label": "SPEAKER_07",
      "start": 2099.146,
      "text": "I question them."
    },
    {
      "end": 2106.319,
      "speaker_label": "SPEAKER_07",
      "start": 2101.17,
      "text": "Driving product innovation faster is definitely way up there in the list."
    },
    {
      "end": 2117.158,
      "speaker_label": "SPEAKER_07",
      "start": 2107.06,
      "text": "And you see this coming to fruition with things like how fast our AI platform, Cortex AI, came to market or what we did with Arctic."
    },
    {
      "end": 2122.487,
      "speaker_label": "SPEAKER_07",
      "start": 2117.178,
      "text": "But I want to stress again that we see incredible potential across"
    },
    {
      "end": 2134.64,
      "speaker_label": "SPEAKER_07",
      "start": 2122.467,
      "text": "Our AI data cloud, the AI layer is one part, but support for Iceberg is actually an exciting new chapter for all players in data."
    },
    {
      "end": 2151.057,
      "speaker_label": "SPEAKER_07",
      "start": 2135.16,
      "text": "We had an announcement yesterday and today at the build conference, but the general theme is we are able to bring Snowflake to bear on more of the data that is sitting in data lakes,"
    },
    {
      "end": 2162.35,
      "speaker_label": "SPEAKER_07",
      "start": 2151.037,
      "text": "And then beyond that, we have things like hybrid tables that are coming out, container services, which massively expand the kind of applications that can run on top of Snowflake."
    },
    {
      "end": 2165.334,
      "speaker_label": "SPEAKER_07",
      "start": 2162.611,
      "text": "So product innovation is one focus."
    },
    {
      "end": 2179.17,
      "speaker_label": "SPEAKER_07",
      "start": 2166.415,
      "text": "Just as equally importantly, helping our go-to-market teams take these products to market, having the specialization to be able to zone in on the applications that deliver the most value"
    },
    {
      "end": 2192.666,
      "speaker_label": "SPEAKER_07",
      "start": 2179.15,
      "text": "for our customers, upping the game on just enablement within Snowflake and also doing a great job of enablement with the many partners that we work with."
    },
    {
      "end": 2201.517,
      "speaker_label": "SPEAKER_07",
      "start": 2193.307,
      "text": "That broad suite of taking products to market, I would say, is my other priority insight."
    },
    {
      "end": 2206.623,
      "speaker_label": "SPEAKER_07",
      "start": 2201.937,
      "text": "I also spend a substantial amount of time on the road talking to customers."
    },
    {
      "end": 2208.465,
      "speaker_label": "SPEAKER_07",
      "start": 2206.703,
      "text": "I would say, on average,"
    },
    {
      "end": 2211.11,
      "speaker_label": "SPEAKER_07",
      "start": 2208.445,
      "text": "I'm out traveling every other week."
    },
    {
      "end": 2216.179,
      "speaker_label": "SPEAKER_07",
      "start": 2211.13,
      "text": "That's kind of how you get to meet over 100 customers in, what, 70-odd days."
    },
    {
      "end": 2230.085,
      "speaker_label": "SPEAKER_07",
      "start": 2216.761,
      "text": "But that's a rough breakdown of my priorities, make sure that I'm in front of customers and with folks in the field, focus on product execution, and also on just go-to-market efficiency."
    },
    {
      "end": 2230.386,
      "speaker_label": "SPEAKER_08",
      "start": 2230.106,
      "text": "Thank you."
    },
    {
      "end": 2238.687,
      "speaker_label": "SPEAKER_10",
      "start": 2235.243,
      "text": "Our next question today comes from Matt Hedberg with RBC."
    },
    {
      "end": 2240.368,
      "speaker_label": "SPEAKER_10",
      "start": 2239.788,
      "text": "Please proceed."
    },
    {
      "end": 2244.613,
      "speaker_label": "SPEAKER_05",
      "start": 2243.572,
      "text": "Thank you for my questions."
    },
    {
      "end": 2257.586,
      "speaker_label": "SPEAKER_05",
      "start": 2244.633,
      "text": "Sridhar, you know, we spend a lot of time focused on the investments you're making in R&D and GPUs, but I'm wondering about your sales and marketing forecasts and maybe what you've learned from your time there, especially when you noted expanding your reach."
    },
    {
      "end": 2264.473,
      "speaker_label": "SPEAKER_05",
      "start": 2257.606,
      "text": "And I guess specifically, does your sales motion need to change or evolve when talking to, say, data scientists, for instance?"
    },
    {
      "end": 2271.308,
      "speaker_label": "SPEAKER_07",
      "start": 2267.103,
      "text": "This is a great question, and I touched on this in answer to my previous question."
    },
    {
      "end": 2272.089,
      "speaker_label": "SPEAKER_07",
      "start": 2271.568,
      "text": "Absolutely."
    },
    {
      "end": 2290.09,
      "speaker_label": "SPEAKER_07",
      "start": 2272.97,
      "text": "I think the kind of product offerings that are needed to be able to effectively have a conversation with a data science team is a little bit different from, say, the team that's running warehouses."
    },
    {
      "end": 2308.264,
      "speaker_label": "SPEAKER_07",
      "start": 2290.373,
      "text": "What is exciting, and I can tell you that today from many conversations that I've had with customers, is that applications written on top of Snowflake, something we call managed applications where our customers write applications on top,"
    },
    {
      "end": 2314.991,
      "speaker_label": "SPEAKER_07",
      "start": 2308.48,
      "text": "and then using things like our collaboration to actively share data with their customers."
    },
    {
      "end": 2328.213,
      "speaker_label": "SPEAKER_07",
      "start": 2315.872,
      "text": "That actually puts us in conversation directly with business leaders in these companies because we now become a part of their top line of actually helping them generate revenue."
    },
    {
      "end": 2334.724,
      "speaker_label": "SPEAKER_07",
      "start": 2328.854,
      "text": "And yes, so there are different product motions that are needed for"
    },
    {
      "end": 2339.687,
      "speaker_label": "SPEAKER_07",
      "start": 2334.94,
      "text": "different products and the different people that are going to benefit from these."
    },
    {
      "end": 2355.43,
      "speaker_label": "SPEAKER_07",
      "start": 2340.388,
      "text": "We created a specialized partner organization, for example, that is focused explicitly on data providers, on, you know, who can bring additional data to Snowflake and then how do we drive revenue opportunities for them."
    },
    {
      "end": 2363.98,
      "speaker_label": "SPEAKER_07",
      "start": 2355.73,
      "text": "And similarly with AI, for example, we need people who are much more comfortable in the world of language models."
    },
    {
      "end": 2375.473,
      "speaker_label": "SPEAKER_07",
      "start": 2364,
      "text": "Our magic is also that we make AI available to all analysts, and that's a big boost that they are going to get from how they use Snowflake."
    },
    {
      "end": 2382.741,
      "speaker_label": "SPEAKER_07",
      "start": 2375.653,
      "text": "Absolutely, there is change going into our go-to-market motions, but as you know, it is a gradual change."
    },
    {
      "end": 2384.944,
      "speaker_label": "SPEAKER_07",
      "start": 2382.822,
      "text": "We are constantly looking"
    },
    {
      "end": 2392.99,
      "speaker_label": "SPEAKER_07",
      "start": 2385.16,
      "text": "for what's the best way to take a particular product to market or how to solve a specific customer problem."
    },
    {
      "end": 2400.179,
      "speaker_label": "SPEAKER_07",
      "start": 2393.591,
      "text": "And, you know, you see that reflected in how our field organizations are organized and managed."
    },
    {
      "end": 2403.844,
      "speaker_label": "SPEAKER_05",
      "start": 2402.602,
      "text": "That's great."
    },
    {
      "end": 2405.065,
      "speaker_label": "SPEAKER_05",
      "start": 2404.044,
      "text": "Maybe just a quick one for Mike."
    },
    {
      "end": 2406.907,
      "speaker_label": "SPEAKER_05",
      "start": 2405.345,
      "text": "Appreciate the color on consumption trends."
    },
    {
      "end": 2407.648,
      "speaker_label": "SPEAKER_05",
      "start": 2406.927,
      "text": "That's super helpful."
    },
    {
      "end": 2410.932,
      "speaker_label": "SPEAKER_05",
      "start": 2408.229,
      "text": "I know you said you based your guidance on what you've seen this week."
    },
    {
      "end": 2411.353,
      "speaker_label": "SPEAKER_05",
      "start": 2410.973,
      "text": "I guess"
    },
    {
      "end": 2413.35,
      "speaker_label": "SPEAKER_05",
      "start": 2411.688,
      "text": "You know, maybe just the question on May."
    },
    {
      "end": 2418.796,
      "speaker_label": "SPEAKER_05",
      "start": 2413.37,
      "text": "Have you seen May then bounce back a bit versus what sounds like a seasonally slow April traditionally?"
    },
    {
      "end": 2427.665,
      "speaker_label": "SPEAKER_00",
      "start": 2421.398,
      "text": "As I said, our guidance is based upon consumption patterns we're seeing in the quarter, and that's reflected inside there."
    },
    {
      "end": 2435.854,
      "speaker_label": "SPEAKER_10",
      "start": 2431.029,
      "text": "Thanks."
    },
    {
      "end": 2438.577,
      "speaker_label": "SPEAKER_10",
      "start": 2435.874,
      "text": "Our next question comes from Brent Bracelet with Piper Sandler."
    },
    {
      "end": 2439.838,
      "speaker_label": "SPEAKER_10",
      "start": 2439.257,
      "text": "Please proceed."
    },
    {
      "end": 2442.302,
      "speaker_label": "SPEAKER_11",
      "start": 2441.962,
      "text": "Thank you."
    },
    {
      "end": 2442.943,
      "speaker_label": "SPEAKER_11",
      "start": 2442.322,
      "text": "Good afternoon."
    },
    {
      "end": 2448.709,
      "speaker_label": "SPEAKER_11",
      "start": 2443.003,
      "text": "Shadar, in your opening remarks, you flagged iceberg as a potential unlock that could accelerate growth."
    },
    {
      "end": 2459.622,
      "speaker_label": "SPEAKER_11",
      "start": 2449.55,
      "text": "Maybe that's a longer term view, but can you just walk through how or why spending could actually go up for Snowflake in an environment where customer moves to iceberg?"
    },
    {
      "end": 2460.022,
      "speaker_label": "SPEAKER_11",
      "start": 2459.762,
      "text": "Thanks."
    },
    {
      "end": 2466.349,
      "speaker_label": "SPEAKER_07",
      "start": 2462.885,
      "text": "So, first of all, iceberg is a capability."
    },
    {
      "end": 2478,
      "speaker_label": "SPEAKER_07",
      "start": 2466.768,
      "text": "And it is a capability to be able to read and to write files in a structured, interoperable format."
    },
    {
      "end": 2492.995,
      "speaker_label": "SPEAKER_07",
      "start": 2478.32,
      "text": "And yes, there will be some customers that will move a portion of their data from Snowflake into an iceberg format because they have an application that they want to run on top of the data."
    },
    {
      "end": 2507.387,
      "speaker_label": "SPEAKER_07",
      "start": 2493.413,
      "text": "But the fact of the matter is that data lakes, or cloud storage in general for most customers, has data that is often 100 or 200 times the amount of data that is sitting inside Snowflake."
    },
    {
      "end": 2518.958,
      "speaker_label": "SPEAKER_07",
      "start": 2507.407,
      "text": "And now with Iceberg as a format under support for it, all of a sudden you can run workloads with Snowflake directly on top of this data."
    },
    {
      "end": 2521.581,
      "speaker_label": "SPEAKER_07",
      "start": 2519.339,
      "text": "And we don't have to wait for"
    },
    {
      "end": 2538.871,
      "speaker_label": "SPEAKER_07",
      "start": 2521.561,
      "text": "some future time in order to be able to pitch and win these use cases, whether it's data engineering or whether it is AI, Iceberg becomes a seamless pipe into all of this information that existing customers already have."
    },
    {
      "end": 2541.435,
      "speaker_label": "SPEAKER_07",
      "start": 2539.291,
      "text": "And that's the unlock that I'm talking about."
    },
    {
      "end": 2544.14,
      "speaker_label": "SPEAKER_07",
      "start": 2541.635,
      "text": "I'll also have Christian say a word."
    },
    {
      "end": 2547.265,
      "speaker_label": "SPEAKER_07",
      "start": 2544.2,
      "text": "He's been at this for a very long time and has a lot of insight on this."
    },
    {
      "end": 2550.271,
      "speaker_label": "SPEAKER_08",
      "start": 2547.768,
      "text": "Yeah, I would just add to what Trita said."
    },
    {
      "end": 2554.677,
      "speaker_label": "SPEAKER_08",
      "start": 2550.492,
      "text": "We have many of our existing customers echoing what Trita just described."
    },
    {
      "end": 2560.404,
      "speaker_label": "SPEAKER_08",
      "start": 2554.737,
      "text": "They have lots of data, tens of petabytes of data ready to be analyzed."
    },
    {
      "end": 2570.918,
      "speaker_label": "SPEAKER_08",
      "start": 2560.444,
      "text": "They don't think that it makes sense that they have to be copied or ingested into Snowflake, but they have use cases where they want to combine data in Snowflake with that existing data."
    },
    {
      "end": 2572.861,
      "speaker_label": "SPEAKER_08",
      "start": 2571.379,
      "text": "So the opportunity is very real."
    },
    {
      "end": 2575.564,
      "speaker_label": "SPEAKER_08",
      "start": 2573.481,
      "text": "And what Trita also alluded to,"
    },
    {
      "end": 2580.211,
      "speaker_label": "SPEAKER_08",
      "start": 2575.882,
      "text": "The announcement we made with Microsoft in the last two days is entirely about that."
    },
    {
      "end": 2588.449,
      "speaker_label": "SPEAKER_08",
      "start": 2580.231,
      "text": "How do we take the data that is available in Microsoft Average and through Iceberg, make it available to Snowflake?"
    },
    {
      "end": 2592.157,
      "speaker_label": "SPEAKER_08",
      "start": 2588.53,
      "text": "So the opportunity is not a long-term one."
    },
    {
      "end": 2595.645,
      "speaker_label": "SPEAKER_08",
      "start": 2592.318,
      "text": "It's not framed as something that we'll have to wait a lot for."
    },
    {
      "end": 2605.402,
      "speaker_label": "SPEAKER_11",
      "start": 2598.292,
      "text": "Quick clarification for Mike here, knocking down some big deals, another $100 million deal in Q1."
    },
    {
      "end": 2607.204,
      "speaker_label": "SPEAKER_11",
      "start": 2605.422,
      "text": "It sounds like another one in Q2."
    },
    {
      "end": 2609.908,
      "speaker_label": "SPEAKER_11",
      "start": 2608.286,
      "text": "Last I checked, the macro is pretty tough."
    },
    {
      "end": 2610.789,
      "speaker_label": "SPEAKER_11",
      "start": 2610.068,
      "text": "What's driving that?"
    },
    {
      "end": 2612.591,
      "speaker_label": "SPEAKER_11",
      "start": 2611.009,
      "text": "Is the AI roadmap helping?"
    },
    {
      "end": 2625.028,
      "speaker_label": "SPEAKER_00",
      "start": 2615.896,
      "text": "You know, these are all existing customers and large customers, and it still is core data warehousing, but they're all interested and want to have a discussion around what we're doing in AI."
    },
    {
      "end": 2627.151,
      "speaker_label": "SPEAKER_00",
      "start": 2625.088,
      "text": "But many of these..."
    },
    {
      "end": 2631.005,
      "speaker_label": "SPEAKER_00",
      "start": 2627.62,
      "text": "both the one in Q1, we are core to their business."
    },
    {
      "end": 2636.512,
      "speaker_label": "SPEAKER_00",
      "start": 2631.065,
      "text": "And the one that's going to do in Q, the current quarter now, we are core to how they run their business."
    },
    {
      "end": 2644.323,
      "speaker_label": "SPEAKER_00",
      "start": 2637.374,
      "text": "And that is what's really driving these customers to make these big long-term commitments with us."
    },
    {
      "end": 2656.26,
      "speaker_label": "SPEAKER_07",
      "start": 2644.904,
      "text": "And in several of these deals, not the one that Mike mentioned, but in several other very large ones, collaborations are actually having snowflakes"
    },
    {
      "end": 2668.813,
      "speaker_label": "SPEAKER_07",
      "start": 2656.477,
      "text": "be the conduit by which these large customers monetize their data by having their customers access this data serves as a very powerful catalyst."
    },
    {
      "end": 2679.127,
      "speaker_label": "SPEAKER_07",
      "start": 2669.514,
      "text": "And absolutely, AI is a help in all of these, and these are the folks that are leaning into and creating AI applications on top of Snowflake."
    },
    {
      "end": 2684.053,
      "speaker_label": "SPEAKER_07",
      "start": 2680.128,
      "text": "But at its core, you should see these very large investments"
    },
    {
      "end": 2688.731,
      "speaker_label": "SPEAKER_07",
      "start": 2684.287,
      "text": "as a bet on Snowflake as the AI data platform."
    },
    {
      "end": 2691.614,
      "speaker_label": "SPEAKER_10",
      "start": 2689.712,
      "text": "Our next question today comes from Patrick Colville."
    },
    {
      "end": 2694.136,
      "speaker_label": "SPEAKER_10",
      "start": 2691.654,
      "text": "Your line is actually open."
    },
    {
      "end": 2696.839,
      "speaker_label": "SPEAKER_01",
      "start": 2694.156,
      "text": "This is Joe Vandrick on for Patrick Colville."
    },
    {
      "end": 2698.06,
      "speaker_label": "SPEAKER_01",
      "start": 2696.879,
      "text": "Thanks for taking our question."
    },
    {
      "end": 2704.426,
      "speaker_label": "SPEAKER_01",
      "start": 2698.841,
      "text": "Sridhar, I know you joined Snowflake about a year ago, but you've now been CEO for about three months."
    },
    {
      "end": 2712.133,
      "speaker_label": "SPEAKER_01",
      "start": 2704.526,
      "text": "So just wondering if there's anything that surprised you or that's worth calling out that you've learned since stepping into the CEO role?"
    },
    {
      "end": 2722.663,
      "speaker_label": "SPEAKER_01",
      "start": 2712.569,
      "text": "And then also curious of your view on a few other products, Streamlit and Unistore, if you could talk a bit about customer engagement you're seeing there."
    },
    {
      "end": 2723.263,
      "speaker_label": "SPEAKER_01",
      "start": 2722.983,
      "text": "Thanks."
    },
    {
      "end": 2731.014,
      "speaker_label": "SPEAKER_07",
      "start": 2727.769,
      "text": "Yeah, I've been here at Snowflake close to a year."
    },
    {
      "end": 2736.501,
      "speaker_label": "SPEAKER_07",
      "start": 2731.054,
      "text": "And as I said, I've had a lot and I have a lot of customer conversations."
    },
    {
      "end": 2756.525,
      "speaker_label": "SPEAKER_07",
      "start": 2737.004,
      "text": "The amount of love and respect that our customers have for the core product, how easy it is to use, how efficient it is, and how maintenance-free, dramatically lowering total cost of ownership it is, is the thing that continues to pleasantly surprise me."
    },
    {
      "end": 2764.834,
      "speaker_label": "SPEAKER_07",
      "start": 2757.026,
      "text": "It's also obviously an important quality for us to preserve while we are releasing new products."
    },
    {
      "end": 2766.97,
      "speaker_label": "SPEAKER_07",
      "start": 2765.168,
      "text": "And we take the trouble to do that."
    },
    {
      "end": 2785.053,
      "speaker_label": "SPEAKER_07",
      "start": 2767.291,
      "text": "Uniformly, the feedback that we get about Cortex, which is our AI layer from pretty tough tech reviewers is that, yes, we truly make the hard easy because anybody that can write SQL now is able to do some pretty nifty things with AI."
    },
    {
      "end": 2789.539,
      "speaker_label": "SPEAKER_07",
      "start": 2785.854,
      "text": "I think that combination of simplicity and ease of use"
    },
    {
      "end": 2793.481,
      "speaker_label": "SPEAKER_07",
      "start": 2789.806,
      "text": "is an incredibly powerful quality for Snowflake."
    },
    {
      "end": 2799.968,
      "speaker_label": "SPEAKER_07",
      "start": 2793.863,
      "text": "And while I knew it, I think it is still a surprise, a pleasant surprise every time customers bring it up."
    },
    {
      "end": 2807.845,
      "speaker_label": "SPEAKER_07",
      "start": 2800.437,
      "text": "And then in terms of Streamlit, Streamlit is, for those that don't know, is a rapid prototyping environment."
    },
    {
      "end": 2815.833,
      "speaker_label": "SPEAKER_07",
      "start": 2807.985,
      "text": "It's a little bit like being able to write an application and have it be hosted on Snowflake without having to do any other work."
    },
    {
      "end": 2820.478,
      "speaker_label": "SPEAKER_07",
      "start": 2815.853,
      "text": "You don't have to bring up a Kubernetes cluster, you don't have to deploy a binary, none of that stuff."
    },
    {
      "end": 2824.202,
      "speaker_label": "SPEAKER_07",
      "start": 2820.758,
      "text": "You write a little application and it just runs."
    },
    {
      "end": 2828.166,
      "speaker_label": "SPEAKER_07",
      "start": 2824.562,
      "text": "There are a ton of applications inside Snowflake, for example,"
    },
    {
      "end": 2836.99,
      "speaker_label": "SPEAKER_07",
      "start": 2828.298,
      "text": "whether it's our compensation information or whether it is finance information or forecast or even chatbots that I personally have created."
    },
    {
      "end": 2850.928,
      "speaker_label": "SPEAKER_07",
      "start": 2837.27,
      "text": "These all run on Streamlit, but with just incredible operational efficiency because they just run as part of our Snowflake instance that is already running in the customer deployment."
    },
    {
      "end": 2857.377,
      "speaker_label": "SPEAKER_07",
      "start": 2851.549,
      "text": "There are folks that have adopted it very, very broadly, and we think of this"
    },
    {
      "end": 2868.338,
      "speaker_label": "SPEAKER_07",
      "start": 2857.559,
      "text": "as really like highlighting, showcasing Snowflake functionality, making it super easy to distribute these things to Snowflake users."
    },
    {
      "end": 2874.209,
      "speaker_label": "SPEAKER_07",
      "start": 2868.358,
      "text": "And in that perspective, it's been a hugely, hugely positive application."
    },
    {
      "end": 2879.398,
      "speaker_label": "SPEAKER_07",
      "start": 2874.609,
      "text": "And the team has also been the one, for example, that's been working on Notebooks."
    },
    {
      "end": 2883.292,
      "speaker_label": "SPEAKER_07",
      "start": 2879.648,
      "text": "which is going to be an important priority going forward."
    },
    {
      "end": 2885.655,
      "speaker_label": "SPEAKER_07",
      "start": 2883.893,
      "text": "So lots of positive things on that side."
    },
    {
      "end": 2902.294,
      "speaker_label": "SPEAKER_07",
      "start": 2886.155,
      "text": "And then on Unistore, or as we call them, hybrid tables, these are really meant to address a different kind of workload that is more transactional in nature than the analytic workload that often runs on top of Snowflake."
    },
    {
      "end": 2903.555,
      "speaker_label": "SPEAKER_07",
      "start": 2902.454,
      "text": "It is in public preview."
    },
    {
      "end": 2905.257,
      "speaker_label": "SPEAKER_07",
      "start": 2903.695,
      "text": "It will be in GA later this year."
    },
    {
      "end": 2907.9,
      "speaker_label": "SPEAKER_07",
      "start": 2905.798,
      "text": "I think it opens up"
    },
    {
      "end": 2913.789,
      "speaker_label": "SPEAKER_07",
      "start": 2907.88,
      "text": "several new classes of applications that can run very effectively on top of Snowflake."
    },
    {
      "end": 2918.355,
      "speaker_label": "SPEAKER_07",
      "start": 2914.109,
      "text": "It's the same Snowflake sort of magic, which is you don't need to stand up servers."
    },
    {
      "end": 2925.025,
      "speaker_label": "SPEAKER_07",
      "start": 2918.415,
      "text": "You don't need to go to a whole lot of work on top of them or deal with Kubernetes clusters."
    },
    {
      "end": 2932.355,
      "speaker_label": "SPEAKER_07",
      "start": 2925.526,
      "text": "And we see, I think it's close to 300 customers that are actively using hybrid tables."
    },
    {
      "end": 2935.901,
      "speaker_label": "SPEAKER_07",
      "start": 2933.077,
      "text": "We can absolutely expect that number to go up by a lot."
    },
    {
      "end": 2937.583,
      "speaker_label": "SPEAKER_07",
      "start": 2935.921,
      "text": "Christian, any other thoughts on these two?"
    },
    {
      "end": 2943.93,
      "speaker_label": "SPEAKER_08",
      "start": 2937.563,
      "text": "No, Streamlit is now generally available on all three clouds, and that has given a lot of interest in adoption."
    },
    {
      "end": 2952.721,
      "speaker_label": "SPEAKER_08",
      "start": 2944.571,
      "text": "And for hybrid tables, many of our customers have likely evaluation, and they are actually waiting for the general availability later this year."
    },
    {
      "end": 2963.133,
      "speaker_label": "SPEAKER_01",
      "start": 2957.306,
      "text": "Thank you."
    },
    {
      "end": 2965.736,
      "speaker_label": "SPEAKER_10",
      "start": 2963.153,
      "text": "Our next question today comes from Brad Arriba with Stifel."
    },
    {
      "end": 2966.997,
      "speaker_label": "SPEAKER_10",
      "start": 2966.436,
      "text": "Please proceed."
    },
    {
      "end": 2970.934,
      "speaker_label": "SPEAKER_15",
      "start": 2969.592,
      "text": "Hi, this is Rob on for Brad."
    },
    {
      "end": 2971.976,
      "speaker_label": "SPEAKER_15",
      "start": 2970.974,
      "text": "Thanks for taking the question."
    },
    {
      "end": 2980.789,
      "speaker_label": "SPEAKER_15",
      "start": 2972.637,
      "text": "Uh, for Christian or street R over the past few months, including yesterday's, it's like ventures has been investing in a few odds of observability of logging and some companies."
    },
    {
      "end": 2984.995,
      "speaker_label": "SPEAKER_15",
      "start": 2981.43,
      "text": "And I'm wondering what the underlying strategy is with these ability type investments."
    },
    {
      "end": 2991.445,
      "speaker_label": "SPEAKER_15",
      "start": 2985.096,
      "text": "And if maybe there's some big opportunity that you're trying to address."
    },
    {
      "end": 2991.706,
      "speaker_label": "SPEAKER_08",
      "start": 2991.505,
      "text": "Thanks."
    },
    {
      "end": 2994.85,
      "speaker_label": "SPEAKER_08",
      "start": 2992.106,
      "text": "Um, observability is very important for our customers."
    },
    {
      "end": 2997.895,
      "speaker_label": "SPEAKER_08",
      "start": 2995.251,
      "text": "One is data observability."
    },
    {
      "end": 3003.661,
      "speaker_label": "SPEAKER_08",
      "start": 2998.094,
      "text": "and be able to understand things like data quality and variations on data itself."
    },
    {
      "end": 3013.334,
      "speaker_label": "SPEAKER_08",
      "start": 3004.282,
      "text": "But also, as we have evolved Snowflake into being able to host business logic and be an application platform, there's also observability for code."
    },
    {
      "end": 3021.604,
      "speaker_label": "SPEAKER_08",
      "start": 3013.854,
      "text": "How do I know what my Snowpark container service is doing, or how do I troubleshoot and monitor on Snowpark?"
    },
    {
      "end": 3025.189,
      "speaker_label": "SPEAKER_08",
      "start": 3022.225,
      "text": "That is the context for observability."
    },
    {
      "end": 3026.751,
      "speaker_label": "SPEAKER_08",
      "start": 3025.209,
      "text": "It's an important priority for us."
    },
    {
      "end": 3042.477,
      "speaker_label": "SPEAKER_08",
      "start": 3027.136,
      "text": "both data as well as code, and we'll continue to partner with all the rich ecosystem that will help us go and more understand what's happening, data and code."
    },
    {
      "end": 3055.135,
      "speaker_label": "SPEAKER_07",
      "start": 3042.497,
      "text": "The general comment that I will make is that Snowflake is a great platform to develop applications on top of, and we end up collaborating, sometimes investing,"
    },
    {
      "end": 3060.342,
      "speaker_label": "SPEAKER_07",
      "start": 3055.334,
      "text": "in a lot of companies that build interesting applications on top of Snowflake."
    },
    {
      "end": 3068.955,
      "speaker_label": "SPEAKER_07",
      "start": 3061.103,
      "text": "Observability is one area, but just to give another example, we have close partnerships with several, you know, customer data platforms."
    },
    {
      "end": 3075.965,
      "speaker_label": "SPEAKER_07",
      "start": 3068.975,
      "text": "And that list sort of keeps going on and on because we want there to be a vibrant ecosystem on top of Snowflake."
    },
    {
      "end": 3079.951,
      "speaker_label": "SPEAKER_15",
      "start": 3079.731,
      "text": "Great."
    },
    {
      "end": 3080.312,
      "speaker_label": "SPEAKER_15",
      "start": 3079.972,
      "text": "Thank you."
    },
    {
      "end": 3088.292,
      "speaker_label": "SPEAKER_10",
      "start": 3085.287,
      "text": "Our next question today comes from Tyler Radke with Citi."
    },
    {
      "end": 3089.515,
      "speaker_label": "SPEAKER_10",
      "start": 3088.954,
      "text": "Please proceed."
    },
    {
      "end": 3093.081,
      "speaker_label": "SPEAKER_16",
      "start": 3092.48,
      "text": "Thank you very much."
    },
    {
      "end": 3097.349,
      "speaker_label": "SPEAKER_16",
      "start": 3093.201,
      "text": "Mike, you talked about some upside from smaller customers during the quarter."
    },
    {
      "end": 3109.371,
      "speaker_label": "SPEAKER_16",
      "start": 3098.191,
      "text": "Could you just talk about the nature of those small customers, those startups, maybe Gen AI companies, and was this more of a one-off or do you expect this strength to persist throughout the rest of the year?"
    },
    {
      "end": 3112.708,
      "speaker_label": "SPEAKER_00",
      "start": 3109.705,
      "text": "was very much broad-based and it's across all industries."
    },
    {
      "end": 3115.771,
      "speaker_label": "SPEAKER_00",
      "start": 3112.808,
      "text": "It's the non-G2K I'm talking about."
    },
    {
      "end": 3117.572,
      "speaker_label": "SPEAKER_00",
      "start": 3115.831,
      "text": "And some of these are very large companies."
    },
    {
      "end": 3121.916,
      "speaker_label": "SPEAKER_00",
      "start": 3118.673,
      "text": "There's private companies in there too, and it's across the board."
    },
    {
      "end": 3127.261,
      "speaker_label": "SPEAKER_16",
      "start": 3126.941,
      "text": "Got it."
    },
    {
      "end": 3130.184,
      "speaker_label": "SPEAKER_16",
      "start": 3127.281,
      "text": "And then quick follow-up on the sales and marketing side."
    },
    {
      "end": 3135.529,
      "speaker_label": "SPEAKER_16",
      "start": 3130.204,
      "text": "So both the expenses and headcount increased quite a bit sequentially."
    },
    {
      "end": 3138.572,
      "speaker_label": "SPEAKER_16",
      "start": 3136.049,
      "text": "Is that primarily quota-carrying hires?"
    },
    {
      "end": 3138.852,
      "speaker_label": "SPEAKER_16",
      "start": 3138.592,
      "text": "Is this"
    },
    {
      "end": 3145.808,
      "speaker_label": "SPEAKER_16",
      "start": 3139.321,
      "text": "you know, marketing folks, just give us a sense on exactly what's driving that higher investment."
    },
    {
      "end": 3159.023,
      "speaker_label": "SPEAKER_00",
      "start": 3147.51,
      "text": "Well, first of all, on the expense side, we mentioned at the end of last quarter, because of our change in comp plan, you were going to see more commission expense being expensed immediately versus deferred and amortized."
    },
    {
      "end": 3163.628,
      "speaker_label": "SPEAKER_00",
      "start": 3159.143,
      "text": "As I said, it doesn't really change the cash flow, but it did add to the expense."
    },
    {
      "end": 3167.472,
      "speaker_label": "SPEAKER_00",
      "start": 3164.248,
      "text": "And we are adding a number of"
    },
    {
      "end": 3178.98,
      "speaker_label": "SPEAKER_00",
      "start": 3167.789,
      "text": "reps principally a lot in the acquisition team, in the commercial space, as well as on the business development, the SDR side as well, too, within the company."
    },
    {
      "end": 3184.946,
      "speaker_label": "SPEAKER_00",
      "start": 3179,
      "text": "But we are adding people throughout the sales organization, including SEs this year."
    },
    {
      "end": 3185.626,
      "speaker_label": "SPEAKER_00",
      "start": 3185.006,
      "text": "You will see us."
    },
    {
      "end": 3188.009,
      "speaker_label": "SPEAKER_00",
      "start": 3186.187,
      "text": "And I think we feel pretty good about our business."
    },
    {
      "end": 3197.678,
      "speaker_label": "SPEAKER_00",
      "start": 3188.069,
      "text": "We've hit our numbers in the first quarter, and we're constantly looking at headcount, and we will continue to invest in the sales organization as we see"
    },
    {
      "end": 3199.495,
      "speaker_label": "SPEAKER_00",
      "start": 3198.113,
      "text": "that we can wrap them."
    },
    {
      "end": 3203.659,
      "speaker_label": "SPEAKER_16",
      "start": 3203.319,
      "text": "Thank you."
    },
    {
      "end": 3211.007,
      "speaker_label": "SPEAKER_10",
      "start": 3208.345,
      "text": "Our final question today comes from Alex Zukin with Wolf Research."
    },
    {
      "end": 3212.189,
      "speaker_label": "SPEAKER_10",
      "start": 3211.608,
      "text": "Please proceed."
    },
    {
      "end": 3214.652,
      "speaker_label": "SPEAKER_13",
      "start": 3214.271,
      "text": "Hey, guys."
    },
    {
      "end": 3218.236,
      "speaker_label": "SPEAKER_13",
      "start": 3214.672,
      "text": "I apologize for the background noise and congrats on a great quarter."
    },
    {
      "end": 3223.041,
      "speaker_label": "SPEAKER_13",
      "start": 3218.596,
      "text": "Maybe just first for Sridhar, you mentioned some really interesting cortex use cases."
    },
    {
      "end": 3225.831,
      "speaker_label": "SPEAKER_13",
      "start": 3223.308,
      "text": "from Sigma, I think, on the prepared remarks."
    },
    {
      "end": 3241.671,
      "speaker_label": "SPEAKER_13",
      "start": 3225.851,
      "text": "Can you maybe dig in a bit more, share some of the vision of how some of your larger customers are thinking of deploying Vortech and maybe ArcGIS, and how can it impact their consumption trends for their customers when they start deploying it in more production-grade use cases?"
    },
    {
      "end": 3247.899,
      "speaker_label": "SPEAKER_07",
      "start": 3245.997,
      "text": "I think I got the gist of your question."
    },
    {
      "end": 3251.003,
      "speaker_label": "SPEAKER_07",
      "start": 3248.84,
      "text": "I'll definitely address it."
    },
    {
      "end": 3272.974,
      "speaker_label": "SPEAKER_07",
      "start": 3251.557,
      "text": "What Snowflake makes easy is the ability to analyze, for example, unstructured text information for things like sentiment or even like categories of feedback or by using things like vector embedding."
    },
    {
      "end": 3288.018,
      "speaker_label": "SPEAKER_07",
      "start": 3273.258,
      "text": "and soon the Cortex index, be able to figure out what are the most related support cases, let's say, for a new question that came in, and auto-generate a response."
    },
    {
      "end": 3296.891,
      "speaker_label": "SPEAKER_07",
      "start": 3288.179,
      "text": "Increasingly, I think of this as the AI stack where there is a central repository, let's say a bunch of previously answered questions, and then a new question comes in."
    },
    {
      "end": 3301.577,
      "speaker_label": "SPEAKER_07",
      "start": 3297.291,
      "text": "You're able to generate an answer for the new customer problem simply based on your history."
    },
    {
      "end": 3314.019,
      "speaker_label": "SPEAKER_07",
      "start": 3301.76,
      "text": "This is a little bit like what companies do imperfectly today, where they will let you search over, let's say, a forum, Snowflake as a forum, for you to figure out, well, has this question already been answered?"
    },
    {
      "end": 3325.978,
      "speaker_label": "SPEAKER_07",
      "start": 3314.6,
      "text": "The magic of language models is that they can automate this process so the truly new questions can get dispatched to a customer service rep to answer from scratch because the company does not know about it."
    },
    {
      "end": 3332.011,
      "speaker_label": "SPEAKER_07",
      "start": 3326.245,
      "text": "But to me, that is a prototype, which is there is a central repository that's sitting in Snowflake."
    },
    {
      "end": 3342.883,
      "speaker_label": "SPEAKER_07",
      "start": 3332.312,
      "text": "There's a language model that is basically getting requests from outside routed in and control logic that decides what to do with this."
    },
    {
      "end": 3348.79,
      "speaker_label": "SPEAKER_07",
      "start": 3343.604,
      "text": "And obviously, something like just a pure chat bot where you can just interact."
    },
    {
      "end": 3353.535,
      "speaker_label": "SPEAKER_07",
      "start": 3348.83,
      "text": "We have one deployed on all of our IT questions internally at Snowflake, for example."
    },
    {
      "end": 3360.627,
      "speaker_label": "SPEAKER_07",
      "start": 3353.735,
      "text": "is just so you can have a quick conversation about a problem that somebody has already solved."
    },
    {
      "end": 3367.298,
      "speaker_label": "SPEAKER_07",
      "start": 3360.647,
      "text": "We make things like this trivial, but perhaps what is really interesting about Cortex is basically language transformation."
    },
    {
      "end": 3379.438,
      "speaker_label": "SPEAKER_07",
      "start": 3367.478,
      "text": "I talked about sentiment detection, but there's also other stuff like summarization or extracting data from JSON or more complicated, extracting information from, let's say, images."
    },
    {
      "end": 3382.26,
      "speaker_label": "SPEAKER_07",
      "start": 3379.756,
      "text": "We automate all of those things."
    },
    {
      "end": 3387.247,
      "speaker_label": "SPEAKER_07",
      "start": 3383.522,
      "text": "And the beauty of our model is all of this is driven by consumption."
    },
    {
      "end": 3389.43,
      "speaker_label": "SPEAKER_07",
      "start": 3387.327,
      "text": "There is no pre-commit to spend."
    },
    {
      "end": 3391.593,
      "speaker_label": "SPEAKER_07",
      "start": 3389.811,
      "text": "These applications get deployed."
    },
    {
      "end": 3394.257,
      "speaker_label": "SPEAKER_07",
      "start": 3391.613,
      "text": "If they get a lot of usage, that generates consumption."
    },
    {
      "end": 3400.126,
      "speaker_label": "SPEAKER_07",
      "start": 3394.638,
      "text": "And so it's almost Darwinian in how great applications come up and drive usage."
    },
    {
      "end": 3403.671,
      "speaker_label": "SPEAKER_07",
      "start": 3400.707,
      "text": "And obviously making it this simple also means"
    },
    {
      "end": 3415.959,
      "speaker_label": "SPEAKER_07",
      "start": 3403.904,
      "text": "that complex tasks that required software engineering before just become a little pipeline that runs in Snowflake every hour, every two hours, that's acting on all of the data that is coming into Snowflake anyway."
    },
    {
      "end": 3425.351,
      "speaker_label": "SPEAKER_07",
      "start": 3416.299,
      "text": "So I would say the use cases that I'm talking about, these are just like things that you could do with Snowflake that are massively accelerated by the presence of language models."
    },
    {
      "end": 3426.452,
      "speaker_label": "SPEAKER_07",
      "start": 3425.371,
      "text": "This is one category."
    },
    {
      "end": 3435.181,
      "speaker_label": "SPEAKER_07",
      "start": 3426.753,
      "text": "The second one really is in how do language models make it much easier to access data that is structured data that is in Snowflake."
    },
    {
      "end": 3438.745,
      "speaker_label": "SPEAKER_07",
      "start": 3436.042,
      "text": "You heard me refer to it as like a data API."
    },
    {
      "end": 3442.449,
      "speaker_label": "SPEAKER_07",
      "start": 3439.186,
      "text": "But the idea basically is that it's currently quite hard."
    },
    {
      "end": 3448.054,
      "speaker_label": "SPEAKER_07",
      "start": 3442.709,
      "text": "You have to go through an analyst, perhaps a BI tool, to get any new pieces of information."
    },
    {
      "end": 3455.562,
      "speaker_label": "SPEAKER_07",
      "start": 3448.975,
      "text": "What we are working on, this is not yet in public preview, it'll be soon, is a product by which by"
    },
    {
      "end": 3463.366,
      "speaker_label": "SPEAKER_07",
      "start": 3456.115,
      "text": "giving semantic information about a snowflake schema, you essentially make it possible for people to have a conversation with it."
    },
    {
      "end": 3476.065,
      "speaker_label": "SPEAKER_07",
      "start": 3464.387,
      "text": "We aren't quite here yet, but I'd like to give Mike Scarpelli an app that knows about finance information that he's able to query, but actually trust the information that is coming out of it."
    },
    {
      "end": 3490.023,
      "speaker_label": "SPEAKER_07",
      "start": 3476.045,
      "text": "Obviously, the big unlock there is that any business user now has access to data within Snowflake, authorized and governed, of course, but it's a much larger user base that can directly interact with Snowflake."
    },
    {
      "end": 3495.37,
      "speaker_label": "SPEAKER_07",
      "start": 3490.344,
      "text": "And that's the complement, you know, where there is a direct access to data to a much larger user base."
    },
    {
      "end": 3496.922,
      "speaker_label": "SPEAKER_07",
      "start": 3495.721,
      "text": "There's lots more."
    },
    {
      "end": 3498.764,
      "speaker_label": "SPEAKER_07",
      "start": 3496.982,
      "text": "This is a topic that I'm super passionate about."
    },
    {
      "end": 3500.165,
      "speaker_label": "SPEAKER_07",
      "start": 3498.904,
      "text": "I can keep going on and on."
    },
    {
      "end": 3503.248,
      "speaker_label": "SPEAKER_07",
      "start": 3500.445,
      "text": "But hopefully you get a feel for the kinds of applications."
    },
    {
      "end": 3504.87,
      "speaker_label": "SPEAKER_07",
      "start": 3503.268,
      "text": "The first class is unstructured data."
    },
    {
      "end": 3506.591,
      "speaker_label": "SPEAKER_07",
      "start": 3504.95,
      "text": "The second class is structured data."
    },
    {
      "end": 3516.781,
      "speaker_label": "SPEAKER_07",
      "start": 3506.952,
      "text": "Our vision is to bring all of these together into like a single box for the enterprise where you can ask any question and be able to get an answer to it."
    },
    {
      "end": 3519.884,
      "speaker_label": "SPEAKER_14",
      "start": 3519.283,
      "text": "Makes sense."
    },
    {
      "end": 3525.289,
      "speaker_label": "SPEAKER_14",
      "start": 3519.904,
      "text": "And then, Mike, you talked about consumption exceeding expectations, exceeding quotas."
    },
    {
      "end": 3531.262,
      "speaker_label": "SPEAKER_14",
      "start": 3525.691,
      "text": "I guess I just wanted to maybe dig into, you talked about a broad-based driver."
    },
    {
      "end": 3547.395,
      "speaker_label": "SPEAKER_14",
      "start": 3531.302,
      "text": "It wasn't like specific to any maybe customer size, but is there anything around any verticals or any geos that were specifically strong or did snow park momentum contribute to that strength or anything more you can give us there?"
    },
    {
      "end": 3553.48,
      "speaker_label": "SPEAKER_00",
      "start": 3548.995,
      "text": "It's really the strength in our core business, and it was across all verticals."
    },
    {
      "end": 3556.784,
      "speaker_label": "SPEAKER_00",
      "start": 3553.7,
