      "speaker_label": "SPEAKER_10",
      "start": 339.593,
      "text": "We hosted our first ever developers day with over 3,000 attendees."
    },
    {
      "end": 346.631,
      "speaker_label": "SPEAKER_10",
      "start": 343.387,
      "text": "the energy was simply incredible."
    },
    {
      "end": 358.406,
      "speaker_label": "SPEAKER_10",
      "start": 346.651,
      "text": "And if you were there, you experienced a lot of our innovation and product momentum where we brought to life Cortex AI and announced Iceberg being generally available, both of which have gained a lot of traction already with customers."
    },
    {
      "end": 369.36,
      "speaker_label": "SPEAKER_10",
      "start": 360.128,
      "text": "Penske Logistics, a leading provider of transportation and warehousing solutions, has developed a variety of innovative use cases involving Cortex AI."
    },
    {
      "end": 377.385,
      "speaker_label": "SPEAKER_10",
      "start": 370.454,
      "text": "In one example, Penske plans to use Cortex to consume various performance metrics related to its transportation business."
    },
    {
      "end": 388.902,
      "speaker_label": "SPEAKER_10",
      "start": 378.486,
      "text": "Cortex analyses will help provide feedback to Penske's operations managers with the goal of improving performance and enhancing truck driver retention."
    },
    {
      "end": 395.432,
      "speaker_label": "SPEAKER_10",
      "start": 388.922,
      "text": "Also, one of the largest financial services companies is using Cortex AI to analyze unstructured text data."
    },
    {
      "end": 401.525,
      "speaker_label": "SPEAKER_10",
      "start": 396.239,
      "text": "running sentiment analysis on call center transcripts to improve their customer support expedience."
    },
    {
      "end": 414.839,
      "speaker_label": "SPEAKER_10",
      "start": 403.286,
      "text": "Twilio segments reverse ETL integrates with Snowflake's Cortex AI and enables Twilio customers to derive insight from their unstructured data to improve the customer journey."
    },
    {
      "end": 424.609,
      "speaker_label": "SPEAKER_10",
      "start": 416.16,
      "text": "And Iceberg is providing one of the largest consumer services and hospitality companies with a more flexible and interoperable deployment model"
    },
    {
      "end": 429.278,
      "speaker_label": "SPEAKER_10",
      "start": 424.893,
      "text": "enabling them to accelerate their migration to the cloud."
    },
    {
      "end": 434.084,
      "speaker_label": "SPEAKER_10",
      "start": 429.298,
      "text": "Iceberg is enabling us to play offense and address a larger data footprint."
    },
    {
      "end": 441.794,
      "speaker_label": "SPEAKER_10",
      "start": 435.226,
      "text": "Many of our largest customers have indicated they will now leverage Snowflake for more of their workloads as a result of this functionality."
    },
    {
      "end": 446.78,
      "speaker_label": "SPEAKER_10",
      "start": 442.995,
      "text": "More than 400 accounts are using Iceberg as of the end of Q2."
    },
    {
      "end": 453.668,
      "speaker_label": "SPEAKER_10",
      "start": 449.082,
      "text": "I told you last quarter that product delivery is one of our highest priorities, and in Q2,"
    },
    {
      "end": 463.653,
      "speaker_label": "SPEAKER_10",
      "start": 453.901,
      "text": "We made nine net new product announcements and brought more than 15 product capabilities to general availability to the market."
    },
    {
      "end": 465.476,
      "speaker_label": "SPEAKER_10",
      "start": 463.673,
      "text": "That's what we call progress."
    },
    {
      "end": 470.122,
      "speaker_label": "SPEAKER_10",
      "start": 466.257,
      "text": "We're also seeing broad adoption of our products across our customer base."
    },
    {
      "end": 477.471,
      "speaker_label": "SPEAKER_10",
      "start": 471.403,
      "text": "As of the end of Q2, more than 2,500 accounts were using Snowflake AI on a weekly basis."
    },
    {
      "end": 482.878,
      "speaker_label": "SPEAKER_10",
      "start": 478.532,
      "text": "We expect this adoption to continue to increase and revenue contribution to follow."
    },
    {
      "end": 489.675,
      "speaker_label": "SPEAKER_10",
      "start": 483.787,
      "text": "Our notebooks offering is also seeing great traction in public preview with more than 1,600 accounts using that feature."
    },
    {
      "end": 497.527,
      "speaker_label": "SPEAKER_10",
      "start": 490.517,
      "text": "This is critical to engage with data scientists and will unlock new opportunities that we previously did not address."
    },
    {
      "end": 502.674,
      "speaker_label": "SPEAKER_10",
      "start": 498.869,
      "text": "We are in the early innings of this opportunity and will continue to bring new features to market."
    },
    {
      "end": 508.883,
      "speaker_label": "SPEAKER_10",
      "start": 503.936,
      "text": "Cortex Search and Cortex Analyst are expected to be generally available in Q3."
    },
    {
      "end": 518.976,
      "speaker_label": "SPEAKER_10",
      "start": 510.263,
      "text": "We are continuing to responsibly invest in AI and machine learning to deliver enterprise AI that is easy, efficient, and most of all, trusted."
    },
    {
      "end": 522.2,
      "speaker_label": "SPEAKER_10",
      "start": 520.197,
      "text": "It's great to have so much momentum on the product front."
    },
    {
      "end": 527.227,
      "speaker_label": "SPEAKER_10",
      "start": 522.861,
      "text": "It's fueling our incredible go-to-market team, which, as you know, is one of our biggest advantages."
    },
    {
      "end": 534.218,
      "speaker_label": "SPEAKER_10",
      "start": 528.289,
      "text": "To wrap things up, our innovation engine and product delivery are in overdrive."
    },
    {
      "end": 538.043,
      "speaker_label": "SPEAKER_10",
      "start": 534.238,
      "text": "The combination of our platform and the network effect of collaboration"
    },
    {
      "end": 545.037,
      "speaker_label": "SPEAKER_10",
      "start": 538.529,
      "text": "As well as the innovation we are working on in AI, it snowflakes future and creates a huge opportunity ahead."
    },
    {
      "end": 551.705,
      "speaker_label": "SPEAKER_10",
      "start": 546.098,
      "text": "We have a lot of work to do, but it's in our hands to deliver and take advantage of it."
    },
    {
      "end": 553.187,
      "speaker_label": "SPEAKER_08",
      "start": 551.725,
      "text": "Mike, I'll turn it over to you."
    },
    {
      "end": 554.649,
      "speaker_label": "SPEAKER_08",
      "start": 553.948,
      "text": "Thank you, Sridhar."
    },
    {
      "end": 561.037,
      "speaker_label": "SPEAKER_08",
      "start": 555.61,
      "text": "Q2 product revenue grew 30% year over year, totaling $829 million."
    },
    {
      "end": 565.903,
      "speaker_label": "SPEAKER_08",
      "start": 561.698,
      "text": "Financial services and technology verticals drove growth in the quarter."
    },
    {
      "end": 570.288,
      "speaker_label": "SPEAKER_08",
      "start": 566.643,
      "text": "We continue to see signs of a stable optimization environment."
    },
    {
      "end": 576.615,
      "speaker_label": "SPEAKER_08",
      "start": 570.908,
      "text": "Our largest customers are contributing sequential product revenue growth in line with historical patterns."
    },
    {
      "end": 579.439,
      "speaker_label": "SPEAKER_08",
      "start": 577.456,
      "text": "We delivered strong bookings in the quarter."
    },
    {
      "end": 584.826,
      "speaker_label": "SPEAKER_08",
      "start": 580.22,
      "text": "Our PO grew 48% year on year to reach more than $5.2 billion."
    },
    {
      "end": 588.41,
      "speaker_label": "SPEAKER_08",
      "start": 585.426,
      "text": "We signed two nine-figure deals in the quarter."
    },
    {
      "end": 595.519,
      "speaker_label": "SPEAKER_08",
      "start": 589.512,
      "text": "Earlier this year, we announced FY25 sales incentives that would prioritize consumption"
    },
    {
      "end": 597.449,
      "speaker_label": "SPEAKER_08",
      "start": 595.887,
      "text": "and new customer acquisitions."
    },
    {
      "end": 603.298,
      "speaker_label": "SPEAKER_08",
      "start": 597.93,
      "text": "In order to drive consumption, sales reps prosecute new use cases and sell new product features."
    },
    {
      "end": 607.445,
      "speaker_label": "SPEAKER_08",
      "start": 603.859,
      "text": "We believe this focus will convert into meaningful revenue over time."
    },
    {
      "end": 610.83,
      "speaker_label": "SPEAKER_08",
      "start": 608.386,
      "text": "Our new customer acquisition motion is ramping."
    },
    {
      "end": 614.456,
      "speaker_label": "SPEAKER_08",
      "start": 611.271,
      "text": "We expect it to have a more material impact in FY26."
    },
    {
      "end": 621.827,
      "speaker_label": "SPEAKER_08",
      "start": 614.616,
      "text": "In Q2, non-GAAP product gross margin of 76% was down slightly year over year."
    },
    {
      "end": 629.658,
      "speaker_label": "SPEAKER_08",
      "start": 622.448,
      "text": "As mentioned on our prior call, we are incurring GPU-related costs in order to fulfill customer demand for our newer product features."
    },
    {
      "end": 636.869,
      "speaker_label": "SPEAKER_08",
      "start": 630.58,
      "text": "Non-GAAP operating margin of 5% exceeded our guidance, benefiting from revenue outperformance."
    },
    {
      "end": 645.261,
      "speaker_label": "SPEAKER_08",
      "start": 637.45,
      "text": "As expected, non-GAAP operating margin is down year on year as a result of R&D and go-to-market investments."
    },
    {
      "end": 648.045,
      "speaker_label": "SPEAKER_08",
      "start": 645.281,
      "text": "Our non-GAAP adjusted free cash flow margin was 8%."
    },
    {
      "end": 651.51,
      "speaker_label": "SPEAKER_08",
      "start": 649.187,
      "text": "We continue to see approximately 80%"
    },
    {
      "end": 654.954,
      "speaker_label": "SPEAKER_08",
      "start": 651.71,
      "text": "of our customers paying annually in advance."
    },
    {
      "end": 661.582,
      "speaker_label": "SPEAKER_08",
      "start": 654.974,
      "text": "We ended the quarter with $3.9 billion in cash, cash equivalents, short-term and long-term investments."
    },
    {
      "end": 666.808,
      "speaker_label": "SPEAKER_08",
      "start": 662.343,
      "text": "In Q2, we used $400 million to repurchase 3 million shares."
    },
    {
      "end": 674.577,
      "speaker_label": "SPEAKER_08",
      "start": 667.669,
      "text": "From our original $2 billion repurchase plan, we have $492 million remaining through March 2025."
    },
    {
      "end": 679.303,
      "speaker_label": "SPEAKER_08",
      "start": 675.398,
      "text": "Our board of directors authorized the repurchase of an additional"
    },
    {
      "end": 684.638,
      "speaker_label": "SPEAKER_08",
      "start": 679.553,
      "text": "$2.5 billion under our stock repurchase program through March 2027."
    },
    {
      "end": 691.804,
      "speaker_label": "SPEAKER_08",
      "start": 684.698,
      "text": "This allows us to use our cash balance and expected free cash flow to manage dilution over this period."
    },
    {
      "end": 697.95,
      "speaker_label": "SPEAKER_08",
      "start": 692.465,
      "text": "Our share count guidance does not include the impact from the stock repurchase."
    },
    {
      "end": 699.912,
      "speaker_label": "SPEAKER_08",
      "start": 697.97,
      "text": "Now, let's turn to our outlook."
    },
    {
      "end": 703.675,
      "speaker_label": "SPEAKER_08",
      "start": 700.732,
      "text": "We forecast product revenue based on observed behavior."
    },
    {
      "end": 709.24,
      "speaker_label": "SPEAKER_08",
      "start": 704.275,
      "text": "Our FY25 guidance includes contribution from Snow Park, as previously stated."
    },
    {
      "end": 714.483,
      "speaker_label": "SPEAKER_08",
      "start": 709.658,
      "text": "Our guidance does not include material contribution from the newer product features."
    },
    {
      "end": 719.208,
      "speaker_label": "SPEAKER_08",
      "start": 715.084,
      "text": "Our forecast does include revenue headwinds associated with performance improvements."
    },
    {
      "end": 726.216,
      "speaker_label": "SPEAKER_08",
      "start": 719.869,
      "text": "For Q3, we expect product revenue between $850 and $855 million."
    },
    {
      "end": 731.441,
      "speaker_label": "SPEAKER_08",
      "start": 727.317,
      "text": "We are increasing our FY25 product revenue guidance."
    },
    {
      "end": 737.708,
      "speaker_label": "SPEAKER_08",
      "start": 731.962,
      "text": "We now expect full year product revenue of approximately $3.356 billion."
    },
    {
      "end": 740.803,
      "speaker_label": "SPEAKER_08",
      "start": 738.059,
      "text": "representing 26% year-over-year growth."
    },
    {
      "end": 747.013,
      "speaker_label": "SPEAKER_08",
      "start": 741.685,
      "text": "Turning to margins, for Q3, we expect 3% non-GAAP operating margin."
    },
    {
      "end": 749.777,
      "speaker_label": "SPEAKER_08",
      "start": 747.634,
      "text": "We are maintaining full-year margin guidance."
    },
    {
      "end": 762.397,
      "speaker_label": "SPEAKER_08",
      "start": 750.198,
      "text": "For FY25, we expect approximately 75% non-GAAP product margin, 3% non-GAAP operating margin, and 26% non-GAAP adjusted free cash flow margin."
    },
    {
      "end": 766.243,
      "speaker_label": "SPEAKER_08",
      "start": 763.098,
      "text": "With that, operator, you can now open up the line for questions."
    },
    {
      "end": 770.271,
      "speaker_label": "SPEAKER_05",
      "start": 769.75,
      "text": "Great."
    },
    {
      "end": 773.634,
      "speaker_label": "SPEAKER_05",
      "start": 770.311,
      "text": "If you'd like to queue for a question, you can do so by pressing star 1."
    },
    {
      "end": 777.058,
      "speaker_label": "SPEAKER_05",
      "start": 774.115,
      "text": "And if for any reason you'd like to remove your question, you can press star 2."
    },
    {
      "end": 780.282,
      "speaker_label": "SPEAKER_05",
      "start": 778.079,
      "text": "Again, it is star 1 to join the question queue."
    },
    {
      "end": 785.387,
      "speaker_label": "SPEAKER_05",
      "start": 781.483,
      "text": "Our first question is from Keith Weiss with Morgan Stanley."
    },
    {
      "end": 786.589,
      "speaker_label": "SPEAKER_05",
      "start": 785.668,
      "text": "Your line is now open."
    },
    {
      "end": 789.752,
      "speaker_label": "SPEAKER_05",
      "start": 789.392,
      "text": "Excellent."
    },
    {
      "end": 794.037,
      "speaker_label": "SPEAKER_05",
      "start": 789.973,
      "text": "Thank you guys for taking the question, and congratulations on a solid quarter."
    },
    {
      "end": 798.861,
      "speaker_label": "SPEAKER_05",
      "start": 794.354,
      "text": "Really good to hear about the optimization starting to normalize."
    },
    {
      "end": 805.951,
      "speaker_label": "SPEAKER_05",
      "start": 799.161,
      "text": "You guys are, it seems to be settling into just about like a 30% product revenue growth rate over the past couple of quarters."
    },
    {
      "end": 813.662,
      "speaker_label": "SPEAKER_05",
      "start": 807.053,
      "text": "There was a lot of concerns coming into this quarter about impacts from iceberg cables."
    },
    {
      "end": 819.771,
      "speaker_label": "SPEAKER_05",
      "start": 814.223,
      "text": "There was concerns that accrued during the quarter about the"
    },
    {
      "end": 821.745,
      "speaker_label": "SPEAKER_05",
      "start": 820.223,
      "text": "data leakage."
    },
    {
      "end": 824.91,
      "speaker_label": "SPEAKER_05",
      "start": 821.765,
      "text": "That wasn't your fault, but it definitely was a marketing headwind."
    },
    {
      "end": 830.158,
      "speaker_label": "SPEAKER_05",
      "start": 825.17,
      "text": "There's concern about the CrowdStrike cybersecurity incident may be impacting consumption."
    },
    {
      "end": 840.032,
      "speaker_label": "SPEAKER_05",
      "start": 830.719,
      "text": "Were any of these outsized impacts, were any of these additional impacts on the consumption in the corridor versus what you guys were expecting when you originally gave us the guide?"
    },
    {
      "end": 847.243,
      "speaker_label": "SPEAKER_08",
      "start": 843.037,
      "text": "I would say the cybersecurity incident was still really had no"
    },
    {
      "end": 851.032,
      "speaker_label": "SPEAKER_08",
      "start": 847.628,
      "text": "impact on us at all from a consumption standpoint."
    },
    {
      "end": 854.397,
      "speaker_label": "SPEAKER_08",
      "start": 851.052,
      "text": "And the CrowdStrike outage was minimal."
    },
    {
      "end": 858.782,
      "speaker_label": "SPEAKER_08",
      "start": 854.457,
      "text": "It was a day with a few customers, but nothing of any substance."
    },
    {
      "end": 861.866,
      "speaker_label": "SPEAKER_08",
      "start": 858.843,
      "text": "And it never really impacted us itself."
    },
    {
      "end": 866.392,
      "speaker_label": "SPEAKER_08",
      "start": 861.987,
      "text": "And our production does not rely on Microsoft for that."
    },
    {
      "end": 871.339,
      "speaker_label": "SPEAKER_08",
      "start": 866.412,
      "text": "So we didn't have."
    },
    {
      "end": 871.679,
      "speaker_label": "SPEAKER_05",
      "start": 871.359,
      "text": "Got it."
    },
    {
      "end": 873.822,
      "speaker_label": "SPEAKER_05",
      "start": 871.739,
      "text": "And then was Iceberg Cables in line with your expectations?"
    },
    {
      "end": 878.965,
      "speaker_label": "SPEAKER_08",
      "start": 875.54,
      "text": "You know, Iceberg Tables is rolling out."
    },
    {
      "end": 881.609,
      "speaker_label": "SPEAKER_08",
      "start": 879.005,
      "text": "As we said, we have about 400 customers that are using it."
    },
    {
      "end": 887.297,
      "speaker_label": "SPEAKER_08",
      "start": 881.709,
      "text": "We haven't seen customers move storage out of Snowflake, but we're seeing a lot of our customers."
    },
    {
      "end": 894.407,
      "speaker_label": "SPEAKER_08",
      "start": 887.657,
      "text": "We mentioned 400 that we know of that are actually using Iceberg with new workloads or trying that out."
    },
    {
      "end": 897.932,
      "speaker_label": "SPEAKER_08",
      "start": 895.228,
      "text": "And we're very pleased with the progress we're seeing there."
    },
    {
      "end": 900.636,
      "speaker_label": "SPEAKER_08",
      "start": 898.212,
      "text": "Storage is still running about 11% of our revenue."
    },
    {
      "end": 903.079,
      "speaker_label": "SPEAKER_08",
      "start": 902.839,
      "text": "Got it."
    },
    {
      "end": 903.72,
      "speaker_label": "SPEAKER_08",
      "start": 903.24,
      "text": "That's super helpful."
    },
    {
      "end": 904.281,
      "speaker_label": "SPEAKER_05",
      "start": 903.961,
      "text": "Thank you, Mike."
    },
    {
      "end": 913.418,
      "speaker_label": "SPEAKER_05",
      "start": 909.593,
      "text": "Our next question is from Ramo Linchao with Barclays."
    },
    {
      "end": 914.76,
      "speaker_label": "SPEAKER_05",
      "start": 913.819,
      "text": "Your line is now open."
    },
    {
      "end": 916.703,
      "speaker_label": "SPEAKER_11",
      "start": 916.422,
      "text": "Perfect."
    },
    {
      "end": 917.284,
      "speaker_label": "SPEAKER_11",
      "start": 916.743,
      "text": "Thank you."
    },
    {
      "end": 918.065,
      "speaker_label": "SPEAKER_11",
      "start": 917.364,
      "text": "Two quick questions."
    },
    {
      "end": 923.733,
      "speaker_label": "SPEAKER_11",
      "start": 918.325,
      "text": "Mike, the gross margins this quarter were better than what a lot of people have modeled."
    },
    {
      "end": 925.816,
      "speaker_label": "SPEAKER_11",
      "start": 923.753,
      "text": "Can you speak to some of the factors for that?"
    },
    {
      "end": 936.951,
      "speaker_label": "SPEAKER_11",
      "start": 926.276,
      "text": "And then, Sridhar, for you, around the iceberg ecosystem, there was a lot of change this quarter with the tabular acquisition by someone else."
    },
    {
      "end": 942.216,
      "speaker_label": "SPEAKER_11",
      "start": 937.252,
      "text": "What do you see in terms of attracting talent to drive that roadmap forward there?"
    },
    {
      "end": 946.58,
      "speaker_label": "SPEAKER_11",
      "start": 942.977,
      "text": "How is your positioning in that iceberg ecosystem evolving?"
    },
    {
      "end": 947.001,
      "speaker_label": "SPEAKER_11",
      "start": 946.66,
      "text": "Thank you."
    },
    {
      "end": 960.272,
      "speaker_label": "SPEAKER_08",
      "start": 950.123,
      "text": "On the margin side, the margins were slightly better than what we had forecast internally, but it doesn't change the guide that we've given 75% per the year."
    },
    {
      "end": 965.537,
      "speaker_label": "SPEAKER_08",
      "start": 961.353,
      "text": "Part of that is we're still waiting in some deployments for GPUs."
    },
    {
      "end": 971.383,
      "speaker_label": "SPEAKER_08",
      "start": 965.855,
      "text": "that around the world that we don't have yet that we were anticipating would have come in this quarter."
    },
    {
      "end": 975.608,
      "speaker_label": "SPEAKER_08",
      "start": 971.683,
      "text": "That's really on the margin side, the gross margin side."
    },
    {
      "end": 992.031,
      "speaker_label": "SPEAKER_10",
      "start": 977.331,
      "text": "And then on the Iceberg side, it's important to understand that the acquisition of Tabular, the company, has no impact on the Iceberg project, which is an Apache open source project."
    },
    {
      "end": 999.858,
      "speaker_label": "SPEAKER_10",
      "start": 992.787,
      "text": "This has contributors and program committee members from a number of cloud companies."
    },
    {
      "end": 1002.782,
      "speaker_label": "SPEAKER_10",
      "start": 999.898,
      "text": "The hyperscalers, yes, but also other companies."
    },
    {
      "end": 1006.789,
      "speaker_label": "SPEAKER_10",
      "start": 1002.883,
      "text": "And we also have members within Snowflake."
    },
    {
      "end": 1018.086,
      "speaker_label": "SPEAKER_10",
      "start": 1006.809,
      "text": "So we very much intend for this to be an industry standard that we take a pretty significant role in shaping."
    },
    {
      "end": 1032.604,
      "speaker_label": "SPEAKER_10",
      "start": 1018.285,
      "text": "And so from that perspective, we actually feel that the tabular acquisition in many ways is a vindication of our strategy to bet on iceberg because that was the format that was truly interoperable."
    },
    {
      "end": 1041.896,
      "speaker_label": "SPEAKER_10",
      "start": 1033.104,
      "text": "You know, hopefully this is the, you know, end of the Betamax wars and everybody with everybody centering around the one format that has broad support."
    },
    {
      "end": 1046.622,
      "speaker_label": "SPEAKER_10",
      "start": 1042.417,
      "text": "And as I said, we will continue to be,"
    },
    {
      "end": 1055.033,
      "speaker_label": "SPEAKER_10",
      "start": 1046.804,
      "text": "a key player in this ecosystem to ensure that the format truly serves everybody and moves the industry forward."
    },
    {
      "end": 1057.956,
      "speaker_label": "SPEAKER_11",
      "start": 1057.396,
      "text": "Okay, perfect."
    },
    {
      "end": 1058.257,
      "speaker_label": "SPEAKER_11",
      "start": 1057.976,
      "text": "Thank you."
    },
    {
      "end": 1058.577,
      "speaker_label": "SPEAKER_11",
      "start": 1058.277,
      "text": "Well done."
    },
    {
      "end": 1066.486,
      "speaker_label": "SPEAKER_05",
      "start": 1063.623,
      "text": "Our next question is from Mark Murphy with J.P."
    },
    {
      "end": 1066.806,
      "speaker_label": "SPEAKER_05",
      "start": 1066.526,
      "text": "Morgan."
    },
    {
      "end": 1068.228,
      "speaker_label": "SPEAKER_05",
      "start": 1067.407,
      "text": "Your line is now open."
    },
    {
      "end": 1071.731,
      "speaker_label": "SPEAKER_17",
      "start": 1070.83,
      "text": "Thank you very much, Elad."
    },
    {
      "end": 1072.272,
      "speaker_label": "SPEAKER_17",
      "start": 1071.751,
      "text": "My congratulations."
    },
    {
      "end": 1076.064,
      "speaker_label": "SPEAKER_17",
      "start": 1072.64,
      "text": "Mike, you mentioned a couple of nine-figure deals in the quarter."
    },
    {
      "end": 1083.412,
      "speaker_label": "SPEAKER_17",
      "start": 1076.224,
      "text": "I'm curious if those are renewals with expansion or perhaps if they're related to anything else."
    },
    {
      "end": 1100.352,
      "speaker_label": "SPEAKER_17",
      "start": 1083.473,
      "text": "For instance, iceberg tables unlocking new business where companies want to tap into some larger data sources that are in an open format or just whether there's anything else to call out on the nine-figure deals and have a quick follow-up."
    },
    {
      "end": 1112.433,
      "speaker_label": "SPEAKER_08",
      "start": 1102.12,
      "text": "Those who are existing customers, you're never going to see, I never want to say never, but you're going to see a nine-figure deal from a net new customer."
    },
    {
      "end": 1122.285,
      "speaker_label": "SPEAKER_08",
      "start": 1113.394,
      "text": "But those are really as part of the renewal process, but expansion in both of those customers as they're looking to do more."
    },
    {
      "end": 1132.077,
      "speaker_label": "SPEAKER_08",
      "start": 1123.667,
      "text": "I can't specifically say that iceberg on either of those that I'm seeing, but they both plan on you doing more with Snowflake."
    },
    {
      "end": 1163.599,
      "speaker_label": "SPEAKER_17",
      "start": 1134.183,
      "text": "yeah i understand okay and then um um as a follow-up as we start to think you know forward into the next uh fiscal year i think we're trying to balance out the large slate of products that recently reached a ga that you mentioned treat r and might start to contribute uh then on the other side of the ledger you know potential for any discrete headwinds from hardware and software software improvements that you pass along um you know storage compression the in the past you had auto warehouse sizing"
    },
    {
      "end": 1173.741,
      "speaker_label": "SPEAKER_17",
      "start": 1163.849,
      "text": "Any high-level thoughts on Sridhar on how to pencil that out in terms of new products, you know, ramping, and then on the other side, some of those improvements?"
    },
    {
      "end": 1181.711,
      "speaker_label": "SPEAKER_10",
      "start": 1177.546,
      "text": "I'll start to answer, and Christian should and Mike should chime in."
    },
    {
      "end": 1185.176,
      "speaker_label": "SPEAKER_10",
      "start": 1181.731,
      "text": "First of all, you know, we obviously can't say anything about next year."
    },
    {
      "end": 1186.177,
      "speaker_label": "SPEAKER_10",
      "start": 1185.376,
      "text": "It is next year."
    },
    {
      "end": 1190.903,
      "speaker_label": "SPEAKER_10",
      "start": 1187.499,
      "text": "But wherever possible, where we have..."
    },
    {
      "end": 1194.266,
      "speaker_label": "SPEAKER_10",
      "start": 1191.322,
      "text": "indication about how new products are going to perform."
    },
    {
      "end": 1196.649,
      "speaker_label": "SPEAKER_10",
      "start": 1195.047,
      "text": "We certainly tell you about it."
    },
    {
      "end": 1202.437,
      "speaker_label": "SPEAKER_10",
      "start": 1196.85,
      "text": "We have given guidance, for example, about what Snowpark is going to do this year."
    },
    {
      "end": 1215.135,
      "speaker_label": "SPEAKER_10",
      "start": 1203.178,
      "text": "And then similarly, with the AI products, as I said, we are seeing broad adoption, and we expect that it will begin to contribute materially to revenue next year."
    },
    {
      "end": 1220.294,
      "speaker_label": "SPEAKER_10",
      "start": 1215.487,
      "text": "With respect to performance optimizations, I would say that's more of an ongoing thing."
    },
    {
      "end": 1226.503,
      "speaker_label": "SPEAKER_10",
      "start": 1220.334,
      "text": "We have talked to you about the things that we have on tap for this year."
    },
    {
      "end": 1238.541,
      "speaker_label": "SPEAKER_10",
      "start": 1226.964,
      "text": "It is important to understand that these optimizations turn into massive cost savings for our customers and make the core product strong."
    },
    {
      "end": 1246.372,
      "speaker_label": "SPEAKER_10",
      "start": 1238.842,
      "text": "And it's really important that our teams continue to do that because that's what protects our overall base."
    },
    {
      "end": 1247.454,
      "speaker_label": "SPEAKER_14",
      "start": 1247.113,
      "text": "Christian?"
    },
    {
      "end": 1255.885,
      "speaker_label": "SPEAKER_09",
      "start": 1249.036,
      "text": "I would just emphasize that our leadership position on price performance continues to be a priority for all of us."
    },
    {
      "end": 1262.714,
      "speaker_label": "SPEAKER_09",
      "start": 1256.406,
      "text": "And at this point, you've seen several years of us continuing to innovate, but also the growth and additional use from our customers."
    },
    {
      "end": 1265.558,
      "speaker_label": "SPEAKER_14",
      "start": 1265.137,
      "text": "Thank you."
    },
    {
      "end": 1274.792,
      "speaker_label": "SPEAKER_05",
      "start": 1271.647,
      "text": "We have a question from Kirk Matern with Evercore."
    },
    {
      "end": 1276.175,
      "speaker_label": "SPEAKER_05",
      "start": 1275.233,
      "text": "Your line is now open."
    },
    {
      "end": 1279.059,
      "speaker_label": "SPEAKER_07",
      "start": 1278.238,
      "text": "Yeah, thanks."
    },
    {
      "end": 1280.281,
      "speaker_label": "SPEAKER_07",
      "start": 1279.079,
      "text": "Just two really quick ones."
    },
    {
      "end": 1290.979,
      "speaker_label": "SPEAKER_07",
      "start": 1280.862,
      "text": "Sridhar, actually, a lot of your partners and customers at the Summit event talked about, you know, the excitement around some of these newer products like Cortex and Snowpark."
    },
    {
      "end": 1296.388,
      "speaker_label": "SPEAKER_07",
      "start": 1291.119,
      "text": "But one of the was we just need better maps to understand how to use them."
    },
    {
      "end": 1299.239,
      "speaker_label": "SPEAKER_07",
      "start": 1296.757,
      "text": "I think from an industry perspective that came up a lot too."
    },
    {
      "end": 1300.26,
      "speaker_label": "SPEAKER_07",
      "start": 1299.299,
      "text": "So I'm kind of curious."
    },
    {
      "end": 1316.695,
      "speaker_label": "SPEAKER_07",
      "start": 1300.48,
      "text": "Really, if you are being a product that they can push in the ROI that the current current your your line is breaking up and we can't really hear you."
    },
    {
      "end": 1323.542,
      "speaker_label": "SPEAKER_08",
      "start": 1319.838,
      "text": "Is that a better plan?"
    },
    {
      "end": 1325.143,
      "speaker_label": "SPEAKER_08",
      "start": 1323.562,
      "text": "Getting a really bad echo."
    },
    {
      "end": 1327.039,
      "speaker_label": "SPEAKER_08",
      "start": 1325.917,
      "text": "and it's hard to hear you."
    },
    {
      "end": 1330.424,
      "speaker_label": "SPEAKER_14",
      "start": 1329.262,
      "text": "I'll stop here."
    },
    {
      "end": 1330.824,
      "speaker_label": "SPEAKER_08",
      "start": 1330.444,
      "text": "Thanks."
    },
    {
      "end": 1338.355,
      "speaker_label": "SPEAKER_08",
      "start": 1336.873,
      "text": "Okay, we'll go to the next question."
    },
    {
      "end": 1341.84,
      "speaker_label": "SPEAKER_05",
      "start": 1338.375,
      "text": "We have a question from Kash Rangan with Goldman."
    },
    {
      "end": 1343.142,
      "speaker_label": "SPEAKER_05",
      "start": 1342.241,
      "text": "Your line is now open."
    },
    {
      "end": 1346.046,
      "speaker_label": "SPEAKER_14",
      "start": 1344.705,
      "text": "Hey, thank you, guys."
    },
    {
      "end": 1347.889,
      "speaker_label": "SPEAKER_14",
      "start": 1346.167,
      "text": "So one for you, Sridhar, one for you, Mike."
    },
    {
      "end": 1353.257,
      "speaker_label": "SPEAKER_14",
      "start": 1348.33,
      "text": "Sridhar, when you look at the product portfolio, some clearly initiative is to get these services"
    },
    {
      "end": 1354.48,
      "speaker_label": "SPEAKER_14",
      "start": 1353.659,
      "text": "out in quick cadence."
    },
    {
      "end": 1356.763,
      "speaker_label": "SPEAKER_14",
      "start": 1354.5,
      "text": "I think you pointed out the net new eight or nine services."
    },
    {
      "end": 1372.221,
      "speaker_label": "SPEAKER_14",
      "start": 1357.624,
      "text": "One of the conversations with customers, like when they are discussing the services with you, what is your take on where are we going to be a year out with the consumption profile of an average Snowflake customer in Canada?"
    },
    {
      "end": 1373.322,
      "speaker_label": "SPEAKER_14",
      "start": 1372.241,
      "text": "There's something called an average."
    },
    {
      "end": 1380.831,
      "speaker_label": "SPEAKER_14",
      "start": 1373.663,
      "text": "How do you see that mix changing between the core, if you want to just bluntly call it, warehousing-related revenues,"
    },
    {
      "end": 1386.248,
      "speaker_label": "SPEAKER_14",
      "start": 1380.98,
      "text": "versus unstructured data, whatever you want to call it, Cortex, AI, and the other emerging buckets."
    },
    {
      "end": 1393.078,
      "speaker_label": "SPEAKER_14",
      "start": 1386.268,
      "text": "How does that mix change for customers as they start to appreciate the net new products you have coming out?"
    },
    {
      "end": 1405.295,
      "speaker_label": "SPEAKER_14",
      "start": 1393.098,
      "text": "And one for you, Mike, you said that the Salesforce compensation towards consumption is still in its early days, but you also intimated that in fiscal 26, we could start to see the fruit of all this."
    },
    {
      "end": 1406.397,
      "speaker_label": "SPEAKER_14",
      "start": 1405.315,
      "text": "So help us"
    },
    {
      "end": 1419.726,
      "speaker_label": "SPEAKER_14",
      "start": 1406.849,
      "text": "understand what you mean by that and what are the KPIs that you'd be internally monitoring to inform you and therefore us that that tilt towards getting more consumption within your customers is actually working to your advantage."
    },
    {
      "end": 1420.427,
      "speaker_label": "SPEAKER_14",
      "start": 1419.786,
      "text": "Thank you so much."
    },
    {
      "end": 1424.633,
      "speaker_label": "SPEAKER_10",
      "start": 1423.311,
      "text": "Thank you, Kaush."
    },
    {
      "end": 1436.569,
      "speaker_label": "SPEAKER_10",
      "start": 1424.973,
      "text": "On the product side, I would say that our customers go through a journey, typically starting with a desire"
    },
    {
      "end": 1440.935,
      "speaker_label": "SPEAKER_10",
      "start": 1436.87,
      "text": "to have a really good data platform that gives visibility."
    },
    {
      "end": 1456.175,
      "speaker_label": "SPEAKER_10",
      "start": 1441.376,
      "text": "They end up adopting different architectures, but often the enterprise's most pristine, clean data, the gold layer, so to say, is the one that's put into Snowflake."
    },
    {
      "end": 1462.764,
      "speaker_label": "SPEAKER_10",
      "start": 1456.516,
      "text": "And there are lots of customers that have standardized on Snowflake as that key data backplane."
    },
    {
      "end": 1465.307,
      "speaker_label": "SPEAKER_10",
      "start": 1463.545,
      "text": "Next, usually,"
    },
    {
      "end": 1473.248,
      "speaker_label": "SPEAKER_10",
      "start": 1465.557,
      "text": "There is a leaning towards collaboration because all companies exist in the context of an ecosystem."
    },
    {
      "end": 1474.089,
      "speaker_label": "SPEAKER_10",
      "start": 1473.268,
      "text": "They have partners."
    },
    {
      "end": 1474.97,
      "speaker_label": "SPEAKER_10",
      "start": 1474.129,
      "text": "They have customers."
    },
    {
      "end": 1483.222,
      "speaker_label": "SPEAKER_10",
      "start": 1475.551,
      "text": "And collaboration of various kinds, certainly starting with data sharing, becomes the key next thing that they adopt broadly."
    },
    {
      "end": 1491.153,
      "speaker_label": "SPEAKER_10",
      "start": 1483.702,
      "text": "And you've often heard Christian talk about things like stable edges, which is a metric that we track because it creates value."
    },
    {
      "end": 1495.058,
      "speaker_label": "SPEAKER_10",
      "start": 1491.573,
      "text": "And it obviously also creates a network effect."
    },
    {
      "end": 1508.014,
      "speaker_label": "SPEAKER_10",
      "start": 1495.477,
      "text": "Our overall strategy at Snowflake is to make sure that all of the sort of data workloads that a company has is satisfied by Snowflake."
    },
    {
      "end": 1518.349,
      "speaker_label": "SPEAKER_10",
      "start": 1508.976,
      "text": "And this is where things like data engineering, which you have played a pretty significant role in for a while, has been an investment for us."
    },
    {
      "end": 1524.437,
      "speaker_label": "SPEAKER_10",
      "start": 1519.19,
      "text": "And this is where things like Iceberg become pretty key because all of a sudden,"
    },
    {
      "end": 1540.524,
      "speaker_label": "SPEAKER_10",
      "start": 1524.687,
      "text": "the universe of data that can be acted upon by Snowflake goes through a large expansion precisely because not all data needs to be ingested into Snowflake before things happen."
    },
    {
      "end": 1549.294,
      "speaker_label": "SPEAKER_10",
      "start": 1541.786,
      "text": "I would say AI is a little unusual in this front because of obviously the industry excitement around it."
    },
    {
      "end": 1559.037,
      "speaker_label": "SPEAKER_10",
      "start": 1549.527,
      "text": "But we approach it very much from a viewpoint that I think this was part of the previous question of how do we go about creating utility to our customers."
    },
    {
      "end": 1561.419,
      "speaker_label": "SPEAKER_10",
      "start": 1559.357,
      "text": "We just don't go in and say, use AI."
    },
    {
      "end": 1574.392,
      "speaker_label": "SPEAKER_10",
      "start": 1561.479,
      "text": "We talk about how it can be used to derive much better insights or unstructured information, for example, by using an LLM function for doing data transformation like sentiment detection."
    },
    {
      "end": 1579.517,
      "speaker_label": "SPEAKER_10",
      "start": 1575.053,
      "text": "And easier access to data, whether it is with a chatbot or text docs"
    },
    {
      "end": 1585.571,
      "speaker_label": "SPEAKER_10",
      "start": 1579.784,
      "text": "or using something like Analyst to give a business user access to structured data."
    },
    {
      "end": 1588.956,
      "speaker_label": "SPEAKER_10",
      "start": 1586.012,
      "text": "Those tend to be the follow-on applications."
    },
    {
      "end": 1597.827,
      "speaker_label": "SPEAKER_10",
      "start": 1589.576,
      "text": "And really, we feel comfortable enough to be able to be investing in these in parallel and driving revenue growth."
    },
    {
      "end": 1603.334,
      "speaker_label": "SPEAKER_10",
      "start": 1598.207,
      "text": "I would say it's too early to talk about X percent for this versus Y percent for that."
    },
    {
      "end": 1605.196,
      "speaker_label": "SPEAKER_10",
      "start": 1604.095,
      "text": "Our goal is to be relevant."
    },
    {
      "end": 1606.838,
      "speaker_label": "SPEAKER_10",
      "start": 1605.316,
      "text": "And for me, relevance is"
    },
    {
      "end": 1619.713,
      "speaker_label": "SPEAKER_10",
      "start": 1606.936,
      "text": "Lots and lots of our customers, thousands of customers using our products and driving meaningful, you know, nine, ten-digit revenue for us."
    },
    {
      "end": 1630.167,
      "speaker_label": "SPEAKER_08",
      "start": 1619.733,
      "text": "And on cash, on your question for me on the sales comp changes, what I was meaning by that is, you know, we really bifurcated our sales force into the acquisition reps."
    },
    {
      "end": 1634.833,
      "speaker_label": "SPEAKER_08",
      "start": 1630.888,
      "text": "And those customers that are landing today, we really have them focused on"
    },
    {
      "end": 1637.557,
      "speaker_label": "SPEAKER_08",
      "start": 1635.134,
      "text": "trying to land the right type of customer that can grow."
    },
    {
      "end": 1643.425,
      "speaker_label": "SPEAKER_08",
      "start": 1637.597,
      "text": "We think they will have a meaningful impact on revenue next year with those new ones."
    },
    {
      "end": 1651.856,
      "speaker_label": "SPEAKER_08",
      "start": 1643.605,
      "text": "And then also the new muscle that we've been building in the sales organization where the reps are just being paid on consumption is what is driving them."
    },
    {
      "end": 1654.48,
      "speaker_label": "SPEAKER_08",
      "start": 1651.876,
      "text": "And it's really the growth within customers' consumption."
    },
    {
      "end": 1662.711,
      "speaker_label": "SPEAKER_08",
      "start": 1655.061,
      "text": "It's a new muscle for them to learn how to go and find and help forecast new workloads coming online."
    },
    {
      "end": 1669.401,
      "speaker_label": "SPEAKER_08",
      "start": 1663.012,
      "text": "and that muscle they're developing we see is going to have a really positive impact in 2026 for us."
    },
    {
      "end": 1671.905,
      "speaker_label": "SPEAKER_14",
      "start": 1671.564,
      "text": "Excellent."
    },
    {
      "end": 1672.546,
      "speaker_label": "SPEAKER_05",
      "start": 1671.945,
      "text": "Thank you so much."
    },
    {
      "end": 1679.376,
      "speaker_label": "SPEAKER_05",
      "start": 1672.566,
      "text": "We have a question from Carl Kersted with UBS."
    },
    {
      "end": 1680.377,
      "speaker_label": "SPEAKER_05",
      "start": 1679.396,
      "text": "Your line is now open."
    },
    {
      "end": 1683.462,
      "speaker_label": "SPEAKER_04",
      "start": 1682.761,
      "text": "Okay, great."
    },
    {
      "end": 1690.572,
      "speaker_label": "SPEAKER_04",
      "start": 1683.622,
      "text": "Hey, Mike, I'd love to just ask you about usage trends as you closed the July quarter"
    },
    {
      "end": 1695.141,
      "speaker_label": "SPEAKER_04",
      "start": 1691.075,
      "text": "what assumptions you're embedding in the second half product revenue guide."
    },
    {
      "end": 1703.393,
      "speaker_label": "SPEAKER_04",
      "start": 1695.201,
      "text": "I think everybody on the line has heard fairly ample evidence from Microsoft all the way down that it's a tough IT spending environment."
    },
    {
      "end": 1716.912,
      "speaker_label": "SPEAKER_04",
      "start": 1703.413,
      "text": "So I'm just curious, as you set the 3Q and 4Q product revs guide, what you would call out as key variables or maybe changes in macro-related assumptions that you embedded in that guide."
    },
    {
      "end": 1717.513,
      "speaker_label": "SPEAKER_04",
      "start": 1717.153,
      "text": "Thank you."
    },
    {
      "end": 1720.778,
      "speaker_label": "SPEAKER_08",
      "start": 1720.097,
      "text": "I'll just say it."
    },
    {
      "end": 1729.532,
      "speaker_label": "SPEAKER_08",
      "start": 1721.078,
      "text": "The quarter showed from a booking standpoint that it's a normal environment, and we're very pleased with the deals we closed in the quarter."
    },
    {
      "end": 1732.778,
      "speaker_label": "SPEAKER_08",
      "start": 1730.093,
      "text": "I don't see it any worse."
    },
    {
      "end": 1737.706,
      "speaker_label": "SPEAKER_08",
      "start": 1732.798,
      "text": "It's not euphoric or anything, but it's a very stable customer buying pattern we're seeing."
    },
    {
      "end": 1744.257,
      "speaker_label": "SPEAKER_08",
      "start": 1737.746,
      "text": "And in terms of consumption trends, obviously we just guided our revenue right now for the quarter."
    },
    {
      "end": 1746.681,
      "speaker_label": "SPEAKER_08",
      "start": 1744.417,
      "text": "We've beaten, we've raised the full year."
    },
    {
      "end": 1752.021,
      "speaker_label": "SPEAKER_08",
      "start": 1747.015,
      "text": "as well, too, and that's seeing the consumption trends up through this week."
    },
    {
      "end": 1755.065,
      "speaker_label": "SPEAKER_08",
      "start": 1752.081,
      "text": "So, we're pleased with that right now with what we're seeing."
    },
    {
      "end": 1759.591,
      "speaker_label": "SPEAKER_04",
      "start": 1757.768,
      "text": "Okay, Mike, and then just maybe a follow-up."
    },
    {
      "end": 1771.285,
      "speaker_label": "SPEAKER_04",
      "start": 1759.651,
      "text": "I know that you've embedded in your guidance the assumption of some degree of runoff of the storage revenues that you just repeated earlier still represent 11 percent of"
    },
    {
      "end": 1782.991,
      "speaker_label": "SPEAKER_04",
      "start": 1771.72,
      "text": "Is the expected pace of that storage runoff in this new guidance tracking similar to what you embedded three months ago, or is it a little bit lighter or a little bit faster?"
    },
    {
      "end": 1800.748,
      "speaker_label": "SPEAKER_08",
      "start": 1784.652,
      "text": "Yeah, well, as I said earlier, we really haven't seen any storage leave Snowflake yet, but that was always forecast to happen in the second half of this year, and we are expecting that is some of that is going to happen, and that is factored into our guidance."
    },
    {
      "end": 1804.096,
      "speaker_label": "SPEAKER_08",
      "start": 1803.395,
      "text": "Okay."
    },
    {
      "end": 1809.183,
      "speaker_label": "SPEAKER_04",
      "start": 1804.116,
      "text": "Thank you, Mike."
    },
    {
      "end": 1809.503,
      "speaker_label": "SPEAKER_05",
      "start": 1809.203,
      "text": "You're welcome."
    },
    {
      "end": 1812.647,
      "speaker_label": "SPEAKER_05",
      "start": 1809.523,
      "text": "Our next question is from Brent Hill with Jefferies."
    },
    {
      "end": 1813.989,
      "speaker_label": "SPEAKER_05",
      "start": 1813.048,
      "text": "Your line is now open."
    },
    {
      "end": 1817.313,
      "speaker_label": "SPEAKER_15",
      "start": 1817.053,
      "text": "Thanks."
    },
    {
      "end": 1823.361,
      "speaker_label": "SPEAKER_15",
      "start": 1817.614,
      "text": "Sridhar, can you give us an update on the adoption of Cortex and how you're seeing that trend?"
    },
    {
      "end": 1831.512,
      "speaker_label": "SPEAKER_15",
      "start": 1824.082,
      "text": "And for Mike, just on RPO, it was good to see really good sequential growth and the acceleration of RPO."
    },
    {
      "end": 1837.535,
      "speaker_label": "SPEAKER_15",
      "start": 1831.93,
      "text": "But the gap between, you know, revenue and RPO continues to be one of the highest we've seen."
    },
    {
      "end": 1841.639,
      "speaker_label": "SPEAKER_15",
      "start": 1837.575,
      "text": "Is there anything that's going on that we should consider there?"
    },
    {
      "end": 1845.723,
      "speaker_label": "SPEAKER_15",
      "start": 1842.56,
      "text": "Is this just similar, you know, consistent patterns you've seen in the past?"
    },
    {
      "end": 1850.027,
      "speaker_label": "SPEAKER_08",
      "start": 1847.284,
      "text": "I'll actually answer that first just while it's on my mind."
    },
    {
      "end": 1855.592,
      "speaker_label": "SPEAKER_08",
      "start": 1850.487,
      "text": "You know, as we said before, we have customers that sign long-term contracts."
    },
    {
      "end": 1861.718,
      "speaker_label": "SPEAKER_08",
      "start": 1855.612,
      "text": "If they have consumed everything under their contract, they have the ability to buy monthly."
    },
    {
      "end": 1869.783,
      "speaker_label": "SPEAKER_08",
      "start": 1861.951,
      "text": "We have two of our top 10 customers right now that can continue to buy through the end of the year, and we're seeing that."
    },
    {
      "end": 1877.636,
      "speaker_label": "SPEAKER_08",
      "start": 1869.844,
      "text": "So they're in their top 10 customers, and top 10 customers are roughly in the $50 million to $40 million range."
    },
    {
      "end": 1883.686,
      "speaker_label": "SPEAKER_08",
      "start": 1878.417,
      "text": "Those aren't reflected in current RPO very much because they're just buying as they go."
    },
    {
      "end": 1887.351,
      "speaker_label": "SPEAKER_09",
      "start": 1886.67,
      "text": "Great question here."
    },
    {
      "end": 1888.954,
      "speaker_label": "SPEAKER_09",
      "start": 1887.372,
      "text": "In the adoption of Cortex,"
    },
    {
      "end": 1893.26,
      "speaker_label": "SPEAKER_09",
      "start": 1889.137,
      "text": "I believe we have a number of product capabilities under that umbrella."
    },
    {
      "end": 1899.486,
      "speaker_label": "SPEAKER_09",
      "start": 1894.221,
      "text": "Cortex-LM, which represents the different language models that are available."
    },
    {
      "end": 1901.568,
      "speaker_label": "SPEAKER_09",
      "start": 1900.066,
      "text": "That one, the adoption is quite strong."
    },
    {
      "end": 1909.394,
      "speaker_label": "SPEAKER_09",
      "start": 1901.608,
      "text": "Lots of the use cases that Sridhar alluded to on text summarization, text sentiment analysis, that's very strong."
    },
    {
      "end": 1918.722,
      "speaker_label": "SPEAKER_09",
      "start": 1909.454,
      "text": "But also, we introduced at Summit both Cortex Analyst and Cortex Search as a way to enable users across"
    },
    {
      "end": 1925.9,
      "speaker_label": "SPEAKER_09",
      "start": 1919.174,
      "text": "all types of organizations to be able to chat and interrogate their data, whether it's structured or unstructured."
    },
    {
      "end": 1930.425,
      "speaker_label": "SPEAKER_09",
      "start": 1926.381,
      "text": "Those two are in public preview, but the adoption at this stage is quite strong."
    },
    {
      "end": 1934.729,
      "speaker_label": "SPEAKER_09",
      "start": 1930.485,
      "text": "We have quite a bit of demand for going to general availability."
    },
    {
      "end": 1938.892,
      "speaker_label": "SPEAKER_09",
      "start": 1935.349,
      "text": "And maybe the last one that I will call out is the Snowflake Copilot."
    },
    {
      "end": 1946.66,
      "speaker_label": "SPEAKER_09",
      "start": 1938.993,
      "text": "We see a lot of usage on customers getting assistance on how to write better SQL queries, which also drives consumption back into Snowflake."
    },
    {
      "end": 1948.101,
      "speaker_label": "SPEAKER_09",
      "start": 1947.06,
      "text": "So all ops"
    },
    {
      "end": 1951.894,
      "speaker_label": "SPEAKER_09",
      "start": 1948.469,
      "text": "A strong product suite and interest in adoption across LLM."
    },
    {
      "end": 1954.939,
      "speaker_label": "SPEAKER_04",
      "start": 1954.698,
      "text": "Thanks."
    },
    {
      "end": 1963.191,
      "speaker_label": "SPEAKER_05",
      "start": 1959.806,
      "text": "We have a question from Brad Zelnick with Deutsche Bank."
    },
    {
      "end": 1964.413,
      "speaker_label": "SPEAKER_05",
      "start": 1963.531,
      "text": "Your line is now open."
    },
    {
      "end": 1966.416,
      "speaker_label": "SPEAKER_03",
      "start": 1966.215,
      "text": "Great."
    },
    {
      "end": 1967.637,
      "speaker_label": "SPEAKER_03",
      "start": 1966.436,
      "text": "Thanks so much for taking the question."
    },
    {
      "end": 1971.623,
      "speaker_label": "SPEAKER_03",
      "start": 1968.098,
      "text": "It's really a bigger picture question for Sridhar or maybe Christian."
    },
    {
      "end": 1976.13,
      "speaker_label": "SPEAKER_03",
      "start": 1971.864,
      "text": "You know, if the world increasingly interacts with data through generative AI and LLMs,"
    },
    {
      "end": 1980.663,
      "speaker_label": "SPEAKER_03",
      "start": 1976.617,
      "text": "How does the role of the data warehouse, as we've known it for decades, evolve from here?"
    },
    {
      "end": 1989.435,
      "speaker_label": "SPEAKER_03",
      "start": 1981.304,
      "text": "And why is Snowflake well-positioned to help enterprises bridge these worlds, leveraging mountains of enterprise data to build newer generation AI applications?"
    },
    {
      "end": 1989.736,
      "speaker_label": "SPEAKER_03",
      "start": 1989.455,
      "text": "Thanks."
    },
    {
      "end": 2002.874,
      "speaker_label": "SPEAKER_10",
      "start": 1993.982,
      "text": "I mean, first of all, Snowflake is often at the center of all of the interesting data in companies."
    },
    {
      "end": 2003.455,
      "speaker_label": "SPEAKER_10",
      "start": 2002.895,
      "text": "Absolutely."
    },
    {
      "end": 2005.358,
      "speaker_label": "SPEAKER_10",
      "start": 2003.596,
      "text": "We started as a warehouse."
    },
    {
      "end": 2011.07,
      "speaker_label": "SPEAKER_10",
      "start": 2005.844,
      "text": "But increasingly, we are the data backplane that provides the single unified view."
    },
    {
      "end": 2027.63,
      "speaker_label": "SPEAKER_10",
      "start": 2011.791,
      "text": "Obviously, this comes from production systems, but also increasingly from multiple connectors we have to other systems, whether they are Salesforce or Segment or SAP or any of the other applications that you use."
    },
    {
      "end": 2034.298,
      "speaker_label": "SPEAKER_10",
      "start": 2028.391,
      "text": "And what we are doing with additional capabilities like machine learning, like AI,"
    },
    {
      "end": 2041.099,
      "speaker_label": "SPEAKER_10",
      "start": 2034.532,
      "text": "is to be able to act on that data to then drive operational systems."
    },
    {
      "end": 2048.187,
      "speaker_label": "SPEAKER_10",
      "start": 2041.119,
      "text": "Disney, for example, uses Snowflake to do a lot of in-park optimization."
    },
    {
      "end": 2056.997,
      "speaker_label": "SPEAKER_10",
      "start": 2048.768,
      "text": "And we see a lot of people that bring supply chain data into Snowflake and then optimize within Snowflake."
    },
    {
      "end": 2063.104,
      "speaker_label": "SPEAKER_10",
      "start": 2057.017,
      "text": "And obviously there are also partners like Blue Yonder, which is a supply chain company that platform on Snowflake"
    },
    {
      "end": 2070.472,
      "speaker_label": "SPEAKER_10",
      "start": 2063.303,
      "text": "and then provide additional capability to their customers so they can combine the supply chain data with other data that there is."
    },
    {
      "end": 2077.721,
      "speaker_label": "SPEAKER_10",
      "start": 2071.593,
      "text": "Our bet is really that AI and machine learning are going to go where the data is."
    },
    {
      "end": 2084.89,
      "speaker_label": "SPEAKER_10",
      "start": 2077.741,
      "text": "Data is going to have strong gravity, and this is the reason why we are seeing such broad adoption."
    },
    {
      "end": 2093.373,
      "speaker_label": "SPEAKER_10",
      "start": 2085.123,
      "text": "And by providing easy to use products with Cortex AI, for example, any analyst that knows SQL now is able to use language models."
    },
    {
      "end": 2104.005,
      "speaker_label": "SPEAKER_10",
      "start": 2093.433,
      "text": "You don't need to go buy new systems, set up new things, and things like data transformation, text transformations become as simple as writing like a two line SQL."
    },
    {
      "end": 2113.476,
      "speaker_label": "SPEAKER_10",
      "start": 2104.766,
      "text": "It is really this ease of use that makes Snowflake such an amazing platform to be able to do all these value add applications"
    },
    {
      "end": 2119.882,
      "speaker_label": "SPEAKER_10",
      "start": 2113.675,
      "text": "in addition to the core analytics applications and the data sharing that people have done on Snowflake."
    },
    {
      "end": 2123.627,
      "speaker_label": "SPEAKER_03",
      "start": 2122.205,
      "text": "Thank you very much for that, Sridhar."
    },
    {
      "end": 2125.529,
      "speaker_label": "SPEAKER_03",
      "start": 2123.667,
      "text": "Maybe just a quick one for you, Mike."
    },
    {
      "end": 2131.676,
      "speaker_label": "SPEAKER_03",
      "start": 2125.549,
      "text": "Am I too optimistic to think that NRR can stabilize here, especially in light of all the new product that you guys are bringing online?"
    },
    {
      "end": 2132.037,
      "speaker_label": "SPEAKER_03",
      "start": 2131.696,
      "text": "Thank you."
    },
    {
      "end": 2138.024,
      "speaker_label": "SPEAKER_08",
      "start": 2134.119,
      "text": "You know, as we've said before, I'm not really going to guide NRR."
    },
    {
      "end": 2142.048,
      "speaker_label": "SPEAKER_08",
      "start": 2138.604,
      "text": "And I've said it will, over time, converge with our revenue."
    },
    {
      "end": 2143.53,
      "speaker_label": "SPEAKER_08",
      "start": 2142.108,
      "text": "And"
    },
    {
      "end": 2150.771,
      "speaker_label": "SPEAKER_08",
      "start": 2144.303,
      "text": "Clearly, we'd like to see NRR stabilized at this level, but we'll see at the end of the quarter."
    },
    {
      "end": 2154.135,
      "speaker_label": "SPEAKER_08",
      "start": 2151.992,
      "text": "I'm not disappointed with our NRR."
    },
    {
      "end": 2156.077,
      "speaker_label": "SPEAKER_08",
      "start": 2154.195,
      "text": "Given our revenue growth, I'm happy with it."
    },
    {
      "end": 2158.199,
      "speaker_label": "SPEAKER_03",
      "start": 2157.759,
      "text": "Makes sense."
    },
    {
      "end": 2159,
      "speaker_label": "SPEAKER_03",
      "start": 2158.24,
      "text": "Thanks so much, guys."
    },
    {
      "end": 2168.452,
      "speaker_label": "SPEAKER_05",
      "start": 2163.586,
      "text": "Our next question is from Mike Sikos with Needham Company."
    },
    {
      "end": 2169.653,
      "speaker_label": "SPEAKER_05",
      "start": 2168.752,
      "text": "Your line is now open."
    },
    {
      "end": 2172.332,
      "speaker_label": "SPEAKER_13",
      "start": 2172.012,
      "text": "Great."
    },
    {
      "end": 2174.015,
      "speaker_label": "SPEAKER_13",
      "start": 2172.453,
      "text": "Thanks for taking the questions here, guys."
    },
    {
      "end": 2179.662,
      "speaker_label": "SPEAKER_13",
      "start": 2174.956,
      "text": "The first one for Sridhar, and I just wanted to come back to Keith's question at the top of the Q&A."
    },
    {
      "end": 2197.345,
      "speaker_label": "SPEAKER_13",
      "start": 2180.583,
      "text": "I know we're saying that there wasn't an impact on consumption in the quarter related to the muddled headlines around security, but has Snowflake noticed any change when thinking about the timeline for sales cycles or the demand gen as it relates to some of those headlines that were out there?"
    },
    {
      "end": 2201.31,
      "speaker_label": "SPEAKER_13",
      "start": 2198.106,
      "text": "And then the follow-up for Mike would be,"
    },
    {
      "end": 2206.384,
      "speaker_label": "SPEAKER_13",
      "start": 2201.78,
      "text": "When we look at the reiterated margin guidance that we have today, is there anything to think about?"
    },
    {
      "end": 2214.471,
      "speaker_label": "SPEAKER_13",
      "start": 2206.684,
      "text": "Was there any delayed spend that's now expected in the back half of the year, just given Snowflake's outperformance on a year-to-date basis through the first half?"
    },
    {
      "end": 2231.685,
      "speaker_label": "SPEAKER_10",
      "start": 2218.534,
      "text": "On the first one about the model security headlines, obviously, we make sure that we bring up the topic whether we talk to an existing customer or to a new customer."
    },
    {
      "end": 2246.254,
      "speaker_label": "SPEAKER_10",
      "start": 2232.155,
      "text": "We point to the security capabilities that we have had, honestly, for close to a decade and try to ensure that all existing customers, for example, follow best practices."
    },
    {
      "end": 2253.283,
      "speaker_label": "SPEAKER_10",
      "start": 2246.434,
      "text": "You know, they're simple, like multi-factor authentication, like network policies when it comes to security."
    },
    {
      "end": 2259.411,
      "speaker_label": "SPEAKER_10",
      "start": 2253.924,
      "text": "And our sales team, as well as I, whenever we have conversations with potential new customers,"
    },
    {
      "end": 2262.363,
      "speaker_label": "SPEAKER_10",
      "start": 2259.56,
      "text": "bring this up front and center."
    },
    {
      "end": 2277.258,
      "speaker_label": "SPEAKER_10",
      "start": 2263.164,
      "text": "And part of the reason why we are slightly muted about this is like, the people that got breached, these are our customers, and we want to work closely with them to make sure that they get out of the difficult situation that they are in."
    },
    {
      "end": 2287.288,
      "speaker_label": "SPEAKER_10",
      "start": 2277.959,
      "text": "And both existing customers and new customers appreciate that spirit of partnership and helping them get through a difficult situation,"
    },
    {
      "end": 2289.571,
      "speaker_label": "SPEAKER_10",
      "start": 2287.488,
      "text": "We have them talk to our CISOs."
    },
    {
      "end": 2295.459,
      "speaker_label": "SPEAKER_10",
      "start": 2289.591,
      "text": "We have them talk to our security field CTOs, advise them on best practices."
    },
    {
      "end": 2313.023,
      "speaker_label": "SPEAKER_10",
      "start": 2296.34,
      "text": "So like roughly, I would say that there's not really been any noticeable effect or delay in things like our ability to sign up customers or get, I mean, sign up new customers or get existing customers to deploy new projects."
    },
    {
      "end": 2314.845,
      "speaker_label": "SPEAKER_10",
      "start": 2313.043,
      "text": "We just need to be more proactive"
    },
    {
      "end": 2318.516,
      "speaker_label": "SPEAKER_10",
      "start": 2315.011,
      "text": "about having the security conversation, and we absolutely do that."
    },
    {
      "end": 2333.019,
      "speaker_label": "SPEAKER_08",
      "start": 2319.798,
      "text": "In your question, Mike, on whether there's any delayed spend or not having an impact, there's no delayed spend, but I will tell you is we are looking at accelerating, and it doesn't change our guidance."
    },
    {
      "end": 2334.581,
      "speaker_label": "SPEAKER_08",
      "start": 2333.079,
      "text": "Our guidance is the same what it was."
    },
    {
      "end": 2343.415,
      "speaker_label": "SPEAKER_08",
      "start": 2334.661,
      "text": "We are looking at potentially accelerating some of our hiring in the second half of the year, in particular for the sales force in some of the areas where we want, and that's factored into our"
    },
    {
      "end": 2347.191,
      "speaker_label": "SPEAKER_08",
      "start": 2343.766,
      "text": "full year guidance, which is guidance we gave last quarter."
    },
    {
      "end": 2349.435,
      "speaker_label": "SPEAKER_13",
      "start": 2348.994,
      "text": "That's great."
    },
    {
      "end": 2349.995,
      "speaker_label": "SPEAKER_13",
      "start": 2349.695,
      "text": "Thank you."
    },
    {
      "end": 2351.217,
      "speaker_label": "SPEAKER_13",
      "start": 2350.015,
      "text": "Appreciate the additional color."
    },
    {
      "end": 2359.009,
      "speaker_label": "SPEAKER_05",
      "start": 2355.444,
      "text": "Our next question is from Joel Fishpin with Truist."
    },
    {
      "end": 2359.89,
      "speaker_label": "SPEAKER_05",
      "start": 2359.029,
