    {
      "end": 2466.666,
      "speaker_label": "SPEAKER_01",
      "start": 2457.976,
      "text": "new analytical workloads coming online, query pricing competition in analytics now versus six months ago."
    },
    {
      "end": 2467.747,
      "speaker_label": "SPEAKER_01",
      "start": 2466.686,
      "text": "Is there anything to call out there?"
