      "end": 2472.273,
      "speaker_label": "SPEAKER_10",
      "start": 2471.672,
      "text": "Yeah."
    },
    {
      "end": 2484.827,
      "speaker_label": "SPEAKER_10",
      "start": 2472.293,
      "text": "In the code analytics space, we are the best in the world, that is, especially when people consider migrating from complex on-prem systems"
    },
    {
      "end": 2496.542,
      "speaker_label": "SPEAKER_10",
      "start": 2485.229,
      "text": "We have a professional services team that is exceptionally skilled at it and a very large ecosystem of partners that have been battle tested with massive migrations."
    },
    {
      "end": 2513.042,
      "speaker_label": "SPEAKER_10",
      "start": 2497.183,
      "text": "And we have done migrations from on-prem workloads that end up saving something like 60% of the cost the customer has to bear."
