    {
      "end": 2652.531,
      "speaker_label": "SPEAKER_09",
      "start": 2633.041,
      "text": "Yeah, and we have been public about a snowflake performance index, where we take not synthetic benchmarks, but actual customer workloads, and we measure the performance improvement over time, and that's how we give a straight answer to our customers that the economics are getting better on a regular basis."
