      "end": 2761.521,
      "speaker_label": "SPEAKER_02",
      "start": 2745.745,
      "text": "As we're thinking about those newer product efforts and you're having those initial customer conversations, particularly around Summit, what are the couple of product areas beyond Snowpark that you see the most early demand signals or just customer conversation around?"
