    {
      "end": 2848.538,
      "speaker_label": "SPEAKER_10",
      "start": 2832.82,
      "text": "And we will be making an effort around making sure that those get into the hands of data scientists so that they can run the most complex machine learning algorithms that they want to run on top of Snowflake."
