      "speaker_label": "SPEAKER_08",
      "start": 424.87,
      "text": "And global hotel chain Hyatt is using Snowflake to better understand guests' preferences across their properties, helping craft a more personalized stay for guests throughout their travel journey."
    },
    {
      "end": 439.329,
      "speaker_label": "SPEAKER_08",
      "start": 437.667,
      "text": "And we are accelerating across the business."
    },
    {
      "end": 443.292,
      "speaker_label": "SPEAKER_08",
      "start": 439.809,
      "text": "As I said, our foot's on the gas when it comes to product innovation."
    },
    {
      "end": 448.337,
      "speaker_label": "SPEAKER_08",
      "start": 443.312,
      "text": "Just last week, we held our Build Developer Summit for more than 10,000 attendees worldwide."
    },
    {
      "end": 460.448,
      "speaker_label": "SPEAKER_08",
      "start": 449.638,
      "text": "We made some key announcements in our core business, like the general availability of Unistore and internal marketplace, and cutting-edge AI innovations like Snowflake Intelligence, a platform to create data agents."
    },
    {
      "end": 464.232,
      "speaker_label": "SPEAKER_08",
      "start": 461.71,
      "text": "Our AI adoption continues to be strong."
    },
    {
      "end": 476.449,
      "speaker_label": "SPEAKER_08",
      "start": 464.735,
      "text": "As of the end of Q3, we have over 1,000 deployed use cases, which you can think of as individual projects we manage with our customers, of our AI and ML products in production deployment."
    },
    {
      "end": 481.194,
      "speaker_label": "SPEAKER_08",
      "start": 477.29,
      "text": "More than 3,200 accounts are now using our AI and ML features."
    },
    {
      "end": 486,
      "speaker_label": "SPEAKER_08",
      "start": 482.276,
      "text": "Equally exciting is the momentum that our latest data engineering features are seeing."
    },
    {
      "end": 496.025,
      "speaker_label": "SPEAKER_08",
      "start": 486.571,
      "text": "Our push into interoperability and transforming data that previously would not have been addressed by Snowflake is proving to be a key differentiator with our customers."
    },
    {
      "end": 501.753,
      "speaker_label": "SPEAKER_08",
      "start": 496.886,
      "text": "These features are now north of a $200 million run rate as of the end of Q3."
    },
    {
      "end": 514.131,
      "speaker_label": "SPEAKER_08",
      "start": 502.915,
      "text": "We're also partnering with Microsoft and ServiceNow to increase data interoperability, making it easier for our customers to bring data in and out of Snowflake to build and run applications faster."
    },
    {
      "end": 530.721,
      "speaker_label": "SPEAKER_08",
      "start": 515.225,
      "text": "As we launch new products like Unistore, Snowflake Open Catalog, and others, we are fine-tuning our go-to-market motion that brings together engineering, product, marketing, and sales to rapidly launch, test, iterate, and scale products."
    },
    {
      "end": 535.946,
      "speaker_label": "SPEAKER_08",
      "start": 530.741,
      "text": "It is giving us a scalable way to broaden our footprint with our customers and also acquire new ones."
    },
    {
      "end": 541.772,
      "speaker_label": "SPEAKER_08",
      "start": 537.187,
      "text": "Our product innovation is fueling alignment with our cloud infrastructure partners."
    },
    {
      "end": 552.116,
      "speaker_label": "SPEAKER_08",
      "start": 542.562,
      "text": "Through our collaboration with AWS, we have booked over $3.9 billion over the past four quarters, an increase of 68% versus the preceding four quarters."
    },
    {
      "end": 562.992,
      "speaker_label": "SPEAKER_08",
      "start": 553.257,
      "text": "Looking at our results in Q3, I can tell you that these shifts are working and enabling us to drive multi-product adoption and further strengthen our position in the market."
    },
    {
      "end": 568.66,
      "speaker_label": "SPEAKER_08",
      "start": 564.814,
      "text": "Finally, I want to talk about the tectonic shifts happening in the world of data."
    },
    {
      "end": 572.265,
      "speaker_label": "SPEAKER_08",
      "start": 569.721,
      "text": "We're seeing massive adoption of open data formats"
    },
    {
      "end": 576.22,
      "speaker_label": "SPEAKER_08",
      "start": 572.617,
      "text": "especially truly open formats like Apache Iceberg."
    },
    {
      "end": 589.571,
      "speaker_label": "SPEAKER_08",
      "start": 576.24,
      "text": "We are justifiably proud of our support for and our investments in Iceberg and the Snowflake Open Catalog based on Apache Polaris that is seeing rapid adoption with developers and enterprises."
    },
    {
      "end": 593.715,
      "speaker_label": "SPEAKER_08",
      "start": 589.591,
      "text": "Similarly, it is clear that AI is going to change how people consume data."
    },
    {
      "end": 601.982,
      "speaker_label": "SPEAKER_08",
      "start": 594.516,
      "text": "Not only is AI going to make structured and unstructured data more interchangeable, it is also going to heavily influence areas like business intelligence."
    },
    {
      "end": 619.675,
      "speaker_label": "SPEAKER_08",
      "start": 603.43,
      "text": "With our unmatched product capability, ease of use, architectural flexibility, comprehensive governance, and prescient bets in Iceberg, Polaris, Cortex, and many others, we are well positioned to be the data platform of choice for enterprises for the next decade."
    },
    {
      "end": 630.552,
      "speaker_label": "SPEAKER_08",
      "start": 620.917,
      "text": "Our intended acquisition of DataVolo strengthens our foundation to deliver an extensible and flexible connectivity platform for unstructured as well as structured data."
    },
    {
      "end": 636.632,
      "speaker_label": "SPEAKER_08",
      "start": 631.105,
      "text": "It accelerates our ability to bring in and vastly simplify data engineering workloads for our customers."
    },
    {
      "end": 649.728,
      "speaker_label": "SPEAKER_08",
      "start": 637.914,
      "text": "On the consumption side, the GA of Snowflake Notebooks, as well as the success and adoption of products like Cortex AI, position us well to take advantage of the new capabilities that AI will enable us to create."
    },
    {
      "end": 659.02,
      "speaker_label": "SPEAKER_08",
      "start": 650.83,
      "text": "As you've probably seen, we just announced a partnership with Anthropic to bring their most powerful models to our customers through Snowflake Cortex AI."
    },
    {
      "end": 669.923,
      "speaker_label": "SPEAKER_08",
      "start": 659.793,
      "text": "This gives enterprises the choice to build cutting-edge AI applications using the model of their choice with the ease, built-in security, and governance of the Snowflake platform."
    },
    {
      "end": 686.34,
      "speaker_label": "SPEAKER_08",
      "start": 670.884,
      "text": "The cost efficiency, flexibility, and extensibility we deliver are why iconic brands like Accor, Chipotle, Comcast, Hyatt, Kraft Heinz, NBCUniversal, Sanofi, Toyota, and thousands more are betting their business on Snowflake."
    },
    {
      "end": 693.879,
      "speaker_label": "SPEAKER_08",
      "start": 687.451,
      "text": "As we move forward, we have a big opportunity to continue to expand with AI throughout the data journey continuum."
    },
    {
      "end": 696.041,
      "speaker_label": "SPEAKER_08",
      "start": 694.52,
      "text": "This isn't just our product vision."
    },
    {
      "end": 698.745,
      "speaker_label": "SPEAKER_08",
      "start": 696.061,
      "text": "It's the ask from some of our most significant customers."
    },
    {
      "end": 709.418,
      "speaker_label": "SPEAKER_08",
      "start": 699.546,
      "text": "They see the ease of use and quality and savings we provide today and want us to expand further so they can reduce even more cost by Snowflake handling more and more of their data journey."
    },
    {
      "end": 715.365,
      "speaker_label": "SPEAKER_08",
      "start": 710.239,
      "text": "We see a day when we can power the end-to-end data lifecycle for our customers, and that's for an art star."
    },
    {
      "end": 719.198,
      "speaker_label": "SPEAKER_08",
      "start": 716.054,
      "text": "We come at this from a position of strength that we will continue to leverage."
    },
    {
      "end": 732.974,
      "speaker_label": "SPEAKER_08",
      "start": 720.199,
      "text": "Our core long-term differentiation of an easy-to-use, simple, efficient, integrated product with comprehensive governance, cross-cloud consistency, and collaboration will continue to set us apart."
    },
    {
      "end": 738.84,
      "speaker_label": "SPEAKER_08",
      "start": 733.815,
      "text": "This is exciting, and I look forward to sharing more and more of our progress along the way."
    },
    {
      "end": 741.624,
      "speaker_label": "SPEAKER_08",
      "start": 739.681,
      "text": "With that, Mike, I'll turn it over to you."
    },
    {
      "end": 742.905,
      "speaker_label": "SPEAKER_12",
      "start": 742.124,
      "text": "Thank you, Sridhar."
    },
    {
      "end": 748.576,
      "speaker_label": "SPEAKER_12",
      "start": 743.408,
      "text": "Q3 was a quarter of strong execution across revenue, bookings, and margins."
    },
    {
      "end": 752.102,
      "speaker_label": "SPEAKER_12",
      "start": 749.257,
      "text": "Broke and a poor business outperformed."
    },
    {
      "end": 754.646,
      "speaker_label": "SPEAKER_12",
      "start": 752.122,
      "text": "Net revenue retention rate stabilized at 127%."
    },
    {
      "end": 759.574,
      "speaker_label": "SPEAKER_12",
      "start": 754.686,
      "text": "New product initiatives are beginning to contribute to growth."
    },
    {
      "end": 766.485,
      "speaker_label": "SPEAKER_12",
      "start": 760.135,
      "text": "As Sridhar mentioned, Snoke Park is well on track to represent 3% of product revenue and growing nicely."
    },
    {
      "end": 770.732,
      "speaker_label": "SPEAKER_12",
      "start": 767.807,
      "text": "With approximately 500 accounts adopting Iceberg,"
    },
    {
      "end": 777.622,
      "speaker_label": "SPEAKER_12",
      "start": 771.033,
      "text": "and storage remaining 11% of our consumption, we have seen minimal headwinds from customers moving to Iceberg."
    },
    {
      "end": 789.418,
      "speaker_label": "SPEAKER_12",
      "start": 778.163,
      "text": "We believe our contribution from data engineering features like snow park, dynamic tables, connectors, and snow pipe streaming will more than offset the potential loss of storage revenue."
    },
    {
      "end": 794.485,
      "speaker_label": "SPEAKER_12",
      "start": 790.319,
      "text": "Bookings were strong in the quarter, and we are seeing a large deal volume increase."
    },
    {
      "end": 797.749,
      "speaker_label": "SPEAKER_12",
      "start": 795.065,
      "text": "We signed three $50 million-plus contracts"
    },
    {
      "end": 802.808,
      "speaker_label": "SPEAKER_12",
      "start": 797.982,
      "text": "total contract value deals, and we expect this momentum to continue in Q4."
    },
    {
      "end": 806.733,
      "speaker_label": "SPEAKER_12",
      "start": 803.589,
      "text": "We added 18 global 2,000 customers in the quarter."
    },
    {
      "end": 813.942,
      "speaker_label": "SPEAKER_12",
      "start": 807.534,
      "text": "Turning to margins for Q3, non-GAAP product gross margin of 76% stabilized sequentially."
    },
    {
      "end": 827.179,
      "speaker_label": "SPEAKER_12",
      "start": 814.663,
      "text": "Non-GAAP operating margin of 6% exceeded our guidance, benefiting from revenue of performance, efficiencies in R&D, and expenses related to our new Bay Area office space being pushed to Q4."
    },
    {
      "end": 833.821,
      "speaker_label": "SPEAKER_12",
      "start": 828.492,
      "text": "Our non-GAAP adjusted free cash flow margin was 9%, driven by strong bookings."
    },
    {
      "end": 839.731,
      "speaker_label": "SPEAKER_12",
      "start": 834.402,
      "text": "We continue to see approximately 80% of our customers paying us annually in advance."
    },
    {
      "end": 854.196,
      "speaker_label": "SPEAKER_12",
      "start": 840.513,
      "text": "In Q3, we issued $1.15 billion in 0% convertible senior notes due in 2027 and $1.15 billion in 0% convertible senior notes due in 2029."
    },
    {
      "end": 859.836,
      "speaker_label": "SPEAKER_12",
      "start": 854.75,
      "text": "Proceeds from the offering were used to pay for the cap calls and concurrent share repurchase."
    },
    {
      "end": 868.146,
      "speaker_label": "SPEAKER_12",
      "start": 860.497,
      "text": "We expect to use the remaining proceeds to fund stock for purchases and potential acquisitions and for general corporate purposes."
    },
    {
      "end": 879.88,
      "speaker_label": "SPEAKER_12",
      "start": 868.967,
      "text": "Year-to-date, we have used $1.9 billion to repurchase 14.8 million shares at a weighted average price per share of $130.87."
    },
    {
      "end": 884.853,
      "speaker_label": "SPEAKER_12",
      "start": 880.467,
      "text": "We have $2 billion remaining on our authorization through March 2027."
    },
    {
      "end": 891.661,
      "speaker_label": "SPEAKER_12",
      "start": 886.154,
      "text": "Our share count guidance does not include the impact from potential upcoming stock purchases."
    },
    {
      "end": 898.65,
      "speaker_label": "SPEAKER_12",
      "start": 892.462,
      "text": "We ended the quarter with $5 billion in cash, cash equivalents, short-term and long-term investments."
    },
    {
      "end": 901.213,
      "speaker_label": "SPEAKER_12",
      "start": 899.952,
      "text": "Now let's turn to guidance."
    },
    {
      "end": 910.305,
      "speaker_label": "SPEAKER_12",
      "start": 901.834,
      "text": "For the fourth quarter, we expect product revenue between $906 and $911 million, representing 23%"
    },
    {
      "end": 911.526,
      "speaker_label": "SPEAKER_12",
      "start": 910.505,
      "text": "year-over-year growth."
    },
    {
      "end": 915.85,
      "speaker_label": "SPEAKER_12",
      "start": 912.167,
      "text": "We are increasing our FY25 product revenue guidance."
    },
    {
      "end": 924.559,
      "speaker_label": "SPEAKER_12",
      "start": 916.391,
      "text": "We now expect full-year product revenue of approximately $3.43 billion, representing 29% year-over-year growth."
    },
    {
      "end": 930.385,
      "speaker_label": "SPEAKER_12",
      "start": 925.42,
      "text": "This includes contributions from our newer product features and product efficiency headwinds."
    },
    {
      "end": 938.993,
      "speaker_label": "SPEAKER_12",
      "start": 931.025,
      "text": "We view product efficiencies as a normal part of our business, so we will not be breaking out those assumptions going forward."
    },
    {
      "end": 950.556,
      "speaker_label": "SPEAKER_12",
      "start": 939.58,
      "text": "Turning to margins, in FY25, we are increasing our non-GAAP product gross margin guidance to 76%, our non-GAAP operating margin guidance to 5%."
    },
    {
      "end": 957.086,
      "speaker_label": "SPEAKER_12",
      "start": 951.658,
      "text": "We expect approximately 26% non-GAAP adjusted free cash flow margin for the year."
    },
    {
      "end": 963.055,
      "speaker_label": "SPEAKER_12",
      "start": 957.987,
      "text": "As Sridhar mentioned, we have gone through a rigorous process of evaluating our cost structure."
    },
    {
      "end": 968.102,
      "speaker_label": "SPEAKER_12",
      "start": 963.595,
      "text": "We believe we can invest aggressively to address the large opportunity in front of us,"
    },
    {
      "end": 969.942,
      "speaker_label": "SPEAKER_12",
      "start": 968.42,
      "text": "while also being more efficient."
    },
    {
      "end": 979.314,
      "speaker_label": "SPEAKER_12",
      "start": 970.683,
      "text": "Our innovation and revenue driving functions are being resourced to drive durable growth while also enabling us to show operating leverage for years to come."
    },
    {
      "end": 982.739,
      "speaker_label": "SPEAKER_12",
      "start": 980.015,
      "text": "With that operator, you can now open up the line for questions."
    },
    {
      "end": 989.848,
      "speaker_label": "SPEAKER_07",
      "start": 985.523,
      "text": "If you'd like to ask a question, please press star followed by one on your telephone keypad."
    },
    {
      "end": 993.073,
      "speaker_label": "SPEAKER_07",
      "start": 989.868,
      "text": "If for any reason you'd like to remove that question, please press star followed by two."
    },
    {
      "end": 995.676,
      "speaker_label": "SPEAKER_07",
      "start": 993.673,
      "text": "Again, to ask a question, press star one."
    },
    {
      "end": 1000.623,
      "speaker_label": "SPEAKER_07",
      "start": 996.078,
      "text": "As a reminder, if you're using a speakerphone, please remember to pick up your handset before asking your question."
    },
    {
      "end": 1003.126,
      "speaker_label": "SPEAKER_07",
      "start": 1001.124,
      "text": "We will pause here briefly as questions register."
    },
    {
      "end": 1007.812,
      "speaker_label": "SPEAKER_07",
      "start": 1005.169,
      "text": "The first question is from the line of Mark Murphy with J.P."
    },
    {
      "end": 1008.112,
      "speaker_label": "SPEAKER_07",
      "start": 1007.832,
      "text": "Morgan."
    },
    {
      "end": 1011.256,
      "speaker_label": "SPEAKER_07",
      "start": 1008.132,
      "text": "Your line is now open."
    },
    {
      "end": 1011.857,
      "speaker_label": "SPEAKER_02",
      "start": 1011.296,
      "text": "Thank you, Mike."
    },
    {
      "end": 1023.01,
      "speaker_label": "SPEAKER_02",
      "start": 1011.957,
      "text": "It's impressive to see the strength here simultaneously in both the consumption revenue and the bookings, especially given the prioritization of consumption incentives this year."
    },
    {
      "end": 1025.933,
      "speaker_label": "SPEAKER_02",
      "start": 1023.891,
      "text": "I'm curious to what you might"
    },
    {
      "end": 1035.278,
      "speaker_label": "SPEAKER_02",
      "start": 1026.284,
      "text": "attribute that, and specifically whether Iceberg Tables might have contributed at all or whether Snowpark might have picked up in any meaningful way, and then I have a quick follow-up."
    },
    {
      "end": 1053.507,
      "speaker_label": "SPEAKER_12",
      "start": 1037.241,
      "text": "I would say we're starting to see the positive benefit of Iceberg with a number of customers that are now bringing new workloads that are now being addressed by Snowflake in Iceberg Tables, but I would just say it's broad-based demand across our customers."
    },
    {
      "end": 1067.573,
      "speaker_label": "SPEAKER_12",
      "start": 1053.841,
      "text": "Yeah, there's a few verticals that were very strong, technology, financial services, and healthcare, but it's really broad-based, and we are seeing the uptick, as Sridhar was mentioning, a lot of the data engineering stuff as well, too, and Snowpark is part of that."
    },
    {
      "end": 1071.356,
      "speaker_label": "SPEAKER_02",
      "start": 1070.856,
      "text": "Great to hear."
    },
    {
      "end": 1076.901,
      "speaker_label": "SPEAKER_02",
      "start": 1071.857,
      "text": "And Sridhar, I believe you had mentioned displacing the competition over and over again."
    },
    {
      "end": 1078.502,
      "speaker_label": "SPEAKER_02",
      "start": 1076.961,
      "text": "That stood out to me."
    },
    {
      "end": 1083.747,
      "speaker_label": "SPEAKER_02",
      "start": 1078.823,
      "text": "I'm curious if you saw an increase in those competitive displacements during Q3."
    },
    {
      "end": 1095.807,
      "speaker_label": "SPEAKER_02",
      "start": 1084.047,
      "text": "And what you think might be triggering it, because we always hear that data sharing is unparalleled, but you had released a slew of AI-related products."
    },
    {
      "end": 1101.837,
      "speaker_label": "SPEAKER_02",
      "start": 1095.827,
      "text": "And I'm also wondering if you think that that might be swaying some of those competitive accounts over."
    },
    {
      "end": 1116.581,
      "speaker_label": "SPEAKER_08",
      "start": 1103.858,
      "text": "At one level, the products that we are releasing that we release makes everybody feel great about sort of the future of the platform, what they can do with it both today and also tomorrow."
    },
    {
      "end": 1124.555,
      "speaker_label": "SPEAKER_08",
      "start": 1116.641,
      "text": "The kind of things that people are already getting done with Cortex AI search and unlist is already pretty impressive."
    },
    {
      "end": 1127.2,
      "speaker_label": "SPEAKER_08",
      "start": 1125.257,
      "text": "But when it comes to the displacements,"
    },
    {
      "end": 1144.075,
      "speaker_label": "SPEAKER_08",
      "start": 1127.585,
      "text": "I would say that the core aspects of the product, which is the ease of use, the faster time to value, the lack of needing a very large team to set up deployments and maintain them as we go along,"
    },
    {
      "end": 1156.995,
      "speaker_label": "SPEAKER_08",
      "start": 1144.055,
      "text": "Those are the things that contribute most to people then, you know, like trying something and coming back to Snowflake and going, this is a much better way to make progress with data."
    },
    {
      "end": 1163.846,
      "speaker_label": "SPEAKER_08",
      "start": 1157.156,
      "text": "And this is the reason why we obsess about making sure Cortex, for example, is integrated very tightly with everything else."
    },
    {
      "end": 1171.378,
      "speaker_label": "SPEAKER_08",
      "start": 1164.167,
      "text": "You build a chatbot on Snowflake, it is automatically going to obey all of the permissions on the data that is underneath."
    },
    {
      "end": 1173.321,
      "speaker_label": "SPEAKER_08",
      "start": 1171.358,
      "text": "And that's the magic of Snowflake."
    },
    {
      "end": 1174.543,
      "speaker_label": "SPEAKER_08",
      "start": 1173.341,
      "text": "Christian, any additional thoughts?"
    },
    {
      "end": 1184.4,
      "speaker_label": "SPEAKER_01",
      "start": 1175.024,
      "text": "The governance continues to be an important region, and we continue to invest on security, privacy, and compliance."
    },
    {
      "end": 1188.968,
      "speaker_label": "SPEAKER_02",
      "start": 1187.786,
      "text": "Thank you very much, and congrats."
    },
    {
      "end": 1191.332,
      "speaker_label": "SPEAKER_02",
      "start": 1190.851,
      "text": "Thank you, Mark."
    },
    {
      "end": 1192.735,
      "speaker_label": "SPEAKER_07",
      "start": 1191.893,
      "text": "Thank you for your question."
    },
    {
      "end": 1196.321,
      "speaker_label": "SPEAKER_07",
      "start": 1193.736,
      "text": "Next question is from the line of Keith Weiss with Morgan Stanley."
    },
    {
      "end": 1197.062,
      "speaker_label": "SPEAKER_07",
      "start": 1196.341,
      "text": "Your line is now open."
    },
    {
      "end": 1200.311,
      "speaker_label": "SPEAKER_05",
      "start": 1199.81,
      "text": "Excellent."
    },
    {
      "end": 1204.978,
      "speaker_label": "SPEAKER_05",
      "start": 1200.331,
      "text": "Thank you guys for taking the question and congratulations on a really solid quarter."
    },
    {
      "end": 1209.526,
      "speaker_label": "SPEAKER_05",
      "start": 1206.14,
      "text": "Mike, a question for you just in terms of like the strength of the quarter."
    },
    {
      "end": 1219.101,
      "speaker_label": "SPEAKER_05",
      "start": 1210.347,
      "text": "From your commentary, things like the core business, like the core data warehousing business was really the standout in the quarter and that firming up and the NRR firming up."
    },
    {
      "end": 1226.105,
      "speaker_label": "SPEAKER_05",
      "start": 1219.537,
      "text": "But I'm hoping you give us some kind of visibility into the ramp that you're seeing with the new AI products like Cortex."
    },
    {
      "end": 1231.812,
      "speaker_label": "SPEAKER_05",
      "start": 1226.125,
      "text": "And how does that compare to what you saw with Snowpark, if we think about them in the same time in their evolution?"
    },
    {
      "end": 1234.215,
      "speaker_label": "SPEAKER_05",
      "start": 1232.873,
      "text": "That's a top line question."
    },
    {
      "end": 1236.497,
      "speaker_label": "SPEAKER_05",
      "start": 1234.555,
      "text": "Then also a bottom line question for you."
    },
    {
      "end": 1241.123,
      "speaker_label": "SPEAKER_05",
      "start": 1237.258,
      "text": "Last quarter, we talked about sort of accelerating investments, particularly in distribution."
    },
    {
      "end": 1250.187,
      "speaker_label": "SPEAKER_05",
      "start": 1241.39,
      "text": "It sounds like that's being somewhat offset by being able to find sort of redundancies or headcount reductions because we didn't really see it in the headcount numbers."
    },
    {
      "end": 1253.192,
      "speaker_label": "SPEAKER_05",
      "start": 1250.207,
      "text": "Like that net addition was relatively modest."
    },
    {
      "end": 1263.432,
      "speaker_label": "SPEAKER_05",
      "start": 1253.693,
      "text": "So it seems like you guys were able to kind of drive investment but also find sort of like nets to take out of headcount."
    },
    {
      "end": 1264.714,
      "speaker_label": "SPEAKER_05",
      "start": 1263.512,
      "text": "Is that the right way to think about it?"
    },
    {
      "end": 1273.399,
      "speaker_label": "SPEAKER_12",
      "start": 1266.128,
      "text": "Yeah, so on your first question, when I talked about the core business, the core business is data warehousing with data engineering."
    },
    {
      "end": 1277.926,
      "speaker_label": "SPEAKER_12",
      "start": 1273.8,
      "text": "What we're talking about is the newer data engineering features that Sridhar was talking about."
    },
    {
      "end": 1284.677,
      "speaker_label": "SPEAKER_12",
      "start": 1277.946,
      "text": "But there's a lot of data engineering that's done in Snowflake, and that was very strong."
    },
    {
      "end": 1289.925,
      "speaker_label": "SPEAKER_12",
      "start": 1284.717,
      "text": "As well, we are seeing the uptick in new products, I would say."
    },
    {
      "end": 1292.48,
      "speaker_label": "SPEAKER_12",
      "start": 1290.277,
      "text": "Cortex is starting to take off."
    },
    {
      "end": 1299.108,
      "speaker_label": "SPEAKER_12",
      "start": 1292.54,
      "text": "It's still very much in the early innings, and we're very optimistic of what that's going to do in the future based upon what we're seeing."
    },
    {
      "end": 1307.74,
      "speaker_label": "SPEAKER_12",
      "start": 1299.729,
      "text": "And Snow Park continues to track, as expected, will be 3% of our revenue for the year and growing very nicely year over year."
    },
    {
      "end": 1314.208,
      "speaker_label": "SPEAKER_12",
      "start": 1307.76,
      "text": "In terms of the efficiencies, we've gone through and done a lot of"
    },
    {
      "end": 1318.138,
      "speaker_label": "SPEAKER_12",
      "start": 1314.593,
      "text": "performance management, especially in the sales organization they've been hiring."
    },
    {
      "end": 1322.643,
      "speaker_label": "SPEAKER_12",
      "start": 1318.198,
      "text": "And there's going to be a lot of hiring in the sales organization this quarter they're doing."
    },
    {
      "end": 1330.474,
      "speaker_label": "SPEAKER_12",
      "start": 1323.284,
      "text": "And we really have really looked across the company at combining teams together where possible."
    },
    {
      "end": 1334.879,
      "speaker_label": "SPEAKER_12",
      "start": 1331.134,
      "text": "And we're not replacing backfills as quickly because of that."
    },
    {
      "end": 1338.103,
      "speaker_label": "SPEAKER_12",
      "start": 1334.899,
      "text": "And that's why we're seeing the operating savings that we're doing."
    },
    {
      "end": 1341.408,
      "speaker_label": "SPEAKER_12",
      "start": 1338.123,
      "text": "There is no mass riff or anything like that."
    },
    {
      "end": 1342.309,
      "speaker_label": "SPEAKER_12",
      "start": 1341.468,
      "text": "Don't think about that."
    },
    {
      "end": 1343.25,
      "speaker_label": "SPEAKER_12",
      "start": 1342.329,
      "text": "We're not doing that."
    },
    {
      "end": 1348.978,
      "speaker_label": "SPEAKER_12",
      "start": 1343.551,
      "text": "It's normal performance management and really being thoughtful of where we put people."
    },
    {
      "end": 1352.262,
      "speaker_label": "SPEAKER_12",
      "start": 1352.022,
      "text": "Got it."
    },
    {
      "end": 1352.863,
      "speaker_label": "SPEAKER_12",
      "start": 1352.303,
      "text": "That's super helpful."
    },
    {
      "end": 1353.244,
      "speaker_label": "SPEAKER_12",
      "start": 1352.963,
      "text": "Thank you."
    },
    {
      "end": 1358.631,
      "speaker_label": "SPEAKER_07",
      "start": 1357.77,
      "text": "Thank you for your question."
    },
    {
      "end": 1362.416,
      "speaker_label": "SPEAKER_07",
      "start": 1359.412,
      "text": "Next question is from the line of Cash Rangan with Goldman Sachs."
    },
    {
      "end": 1365.48,
      "speaker_label": "SPEAKER_07",
      "start": 1362.436,
      "text": "Your line is now open."
    },
    {
      "end": 1365.7,
      "speaker_label": "SPEAKER_11",
      "start": 1365.58,
      "text": "Hi."
    },
    {
      "end": 1366.561,
      "speaker_label": "SPEAKER_11",
      "start": 1365.72,
      "text": "Thank you very much."
    },
    {
      "end": 1368.263,
      "speaker_label": "SPEAKER_11",
      "start": 1366.641,
      "text": "One for you, Sridhar, and one for Mike."
    },
    {
      "end": 1368.664,
      "speaker_label": "SPEAKER_11",
      "start": 1368.284,
      "text": "Sridhar."
    },
    {
      "end": 1381.476,
      "speaker_label": "SPEAKER_11",
      "start": 1369.117,
      "text": "There is a narrative which you will definitely dispute that the core of the Snowflake data platform, that structured data does not really have a long runway in the world of generative AI."
    },
    {
      "end": 1388.306,
      "speaker_label": "SPEAKER_11",
      "start": 1382.417,
      "text": "And that also Snowflake has a lot to prove with respect to generative AI on the unstructured data."
    },
    {
      "end": 1395.778,
      "speaker_label": "SPEAKER_11",
      "start": 1388.827,
      "text": "What proof points can you talk to the quarter that would invalidate that bearish view and reinforce your conviction?"
    },
    {
      "end": 1397.841,
      "speaker_label": "SPEAKER_11",
      "start": 1396.299,
      "text": "And one for you, Mike, would be"
    },
    {
      "end": 1415.887,
      "speaker_label": "SPEAKER_11",
      "start": 1398.243,
      "text": "With the defendants from storage not being as much as was dialed in, should we safely assume that maybe guiding the product revenue 29% for the year, take away three points for snow park container services, that the core is actually at a point where you can see it being stable going to next year."
    },
    {
      "end": 1417.429,
      "speaker_label": "SPEAKER_11",
      "start": 1415.927,
      "text": "I know you're not giving guidance."
    },
    {
      "end": 1422.456,
      "speaker_label": "SPEAKER_11",
      "start": 1417.449,
      "text": "And if we can start to think about dream to dream of all the new products being largely incremental to that growth rate."
    },
    {
      "end": 1423.097,
      "speaker_label": "SPEAKER_11",
      "start": 1422.496,
      "text": "Thank you so much."
    },
    {
      "end": 1424.098,
      "speaker_label": "SPEAKER_11",
      "start": 1423.277,
      "text": "Congratulations."
    },
    {
      "end": 1427.112,
      "speaker_label": "SPEAKER_08",
      "start": 1426.07,
      "text": "Thank you, Kash."
    },
    {
      "end": 1435.425,
      "speaker_label": "SPEAKER_08",
      "start": 1427.893,
      "text": "On the core business side, analytics still is going to be pretty important."
    },
    {
      "end": 1446.323,
      "speaker_label": "SPEAKER_08",
      "start": 1436.227,
      "text": "Getting the most important data about your business, but increasingly being able to act on it quickly in real time."
    },
    {
      "end": 1449.727,
      "speaker_label": "SPEAKER_08",
      "start": 1446.623,
      "text": "is the thing that is going to set great companies apart."
    },
    {
      "end": 1460.222,
      "speaker_label": "SPEAKER_08",
      "start": 1449.928,
      "text": "If you look at the best companies that have been created in the past two and a half decades, these are companies that have integrated data into the core of how they are operating."
    },
    {
      "end": 1473.441,
      "speaker_label": "SPEAKER_08",
      "start": 1460.903,
      "text": "And when I talk to customers, not just about the analytics, the view of clean data, but also about being able to act on it, being able to see trends, being able to"
    },
    {
      "end": 1481.401,
      "speaker_label": "SPEAKER_08",
      "start": 1473.421,
      "text": "you know, figure out things like guest experiences like our customers and Disney do at scale."
    },
    {
      "end": 1485.27,
      "speaker_label": "SPEAKER_08",
      "start": 1481.421,
      "text": "So there's a very long runway because analytics"
    },
    {
      "end": 1490.185,
      "speaker_label": "SPEAKER_08",
      "start": 1485.554,
      "text": "flows over seamlessly and fluidly into things like machine learning."
    },
    {
      "end": 1499.748,
      "speaker_label": "SPEAKER_08",
      "start": 1490.706,
      "text": "And AI then becomes even more of an accelerant because you can now go from unstructured data to structured data very, very easily."
    },
    {
      "end": 1503.597,
      "speaker_label": "SPEAKER_08",
      "start": 1500.189,
      "text": "And that's the magic of products like Cortex AI."
    },
    {
      "end": 1509.767,
      "speaker_label": "SPEAKER_08",
      "start": 1503.577,
      "text": "And the new things that we announced in Build where you can bring multimodal models."
    },
    {
      "end": 1517.8,
      "speaker_label": "SPEAKER_08",
      "start": 1509.787,
      "text": "Imagine a world in which you just write a SQL statement that goes to act on a PDF and produces a bunch of structured information out on the other side."
    },
    {
      "end": 1525.433,
      "speaker_label": "SPEAKER_08",
      "start": 1518.442,
      "text": "It redefines what you and I think of as analytics because just a lot more can be done."
    },
    {
      "end": 1540.519,
      "speaker_label": "SPEAKER_08",
      "start": 1525.7,
      "text": "And so that's the world that we are driving towards, and that's where investments in companies like DataVolo that bring even more data into Snowflake is exciting and empowering for us as a data platform."
    },
    {
      "end": 1546.307,
      "speaker_label": "SPEAKER_08",
      "start": 1541.08,
      "text": "And then on the other side, when it comes to unstructured data or just AI applications, as I said in my remarks,"
    },
    {
      "end": 1550.247,
      "speaker_label": "SPEAKER_08",
      "start": 1546.523,
      "text": "We have over 1,000 deployed use cases."
    },
    {
      "end": 1553.51,
      "speaker_label": "SPEAKER_08",
      "start": 1551.007,
      "text": "And in all of them, these are not toy deployments."
    },
    {
      "end": 1554.711,
      "speaker_label": "SPEAKER_08",
      "start": 1553.53,
      "text": "We work with our customers."
    },
    {
      "end": 1557.413,
      "speaker_label": "SPEAKER_08",
      "start": 1554.751,
      "text": "We make sure that they get value from it."
    },
    {
      "end": 1559.555,
      "speaker_label": "SPEAKER_08",
      "start": 1557.674,
      "text": "That's the first thing that I tell all our customers."
    },
    {
      "end": 1561.657,
      "speaker_label": "SPEAKER_08",
      "start": 1559.856,
      "text": "AI needs to be a business accelerant."
    },
    {
      "end": 1563.079,
      "speaker_label": "SPEAKER_08",
      "start": 1561.718,
      "text": "It's not a hobby."
    },
    {
      "end": 1567.823,
      "speaker_label": "SPEAKER_08",
      "start": 1563.479,
      "text": "And the products that we have created, which do things like take trustability."
    },
    {
      "end": 1575.771,
      "speaker_label": "SPEAKER_08",
      "start": 1568.384,
      "text": "The work that we are doing with the Truera acquisition, for example, that brings observability to how people create AI applications."
    },
    {
      "end": 1585.769,
      "speaker_label": "SPEAKER_08",
      "start": 1576.038,
      "text": "are the ones that are creating rock-solid applications, and where increasingly the difference between structured and unstructured is going to be less and less meaningful as we go forward."
    },
    {
      "end": 1588.432,
      "speaker_label": "SPEAKER_08",
      "start": 1586.149,
      "text": "And then in terms of examples, you know, there are a ton of them."
    },
    {
      "end": 1590.895,
      "speaker_label": "SPEAKER_08",
      "start": 1588.452,
      "text": "Siemens, Bayer, these are all folks."
    },
    {
      "end": 1597.342,
      "speaker_label": "SPEAKER_08",
      "start": 1591.275,
      "text": "Zoom, these are all folks that have used our AI product, gotten immense value, and talked publicly about them."
    },
    {
      "end": 1602.608,
      "speaker_label": "SPEAKER_08",
      "start": 1597.722,
      "text": "So I feel very good about where we are executing on that side."
    },
    {
      "end": 1605.471,
      "speaker_label": "SPEAKER_12",
      "start": 1602.628,
      "text": "And, Kash, on your question on the "
    },
    {
      "end": 1607.359,
      "speaker_label": "SPEAKER_12",
      "start": 1605.637,
      "text": "stability of the business."
    },
    {
      "end": 1611.283,
      "speaker_label": "SPEAKER_12",
      "start": 1607.559,
      "text": "As I said, the core business is very stable and strong."
    },
    {
      "end": 1618.872,
      "speaker_label": "SPEAKER_12",
      "start": 1611.684,
      "text": "We just had a very good quarter, but more importantly, our NRR has remained at 127% the last two quarters."
    },
    {
      "end": 1621.875,
      "speaker_label": "SPEAKER_12",
      "start": 1620.173,
      "text": "We're guiding to 23%."
    },
    {
      "end": 1635.39,
      "speaker_label": "SPEAKER_12",
      "start": 1621.935,
      "text": "I do want to remind you Q4 has the most number of holidays in it, and there is some seasonality that we experienced during that period of time, but our business is very strong, and I feel really good about next year right now where we're sitting"
    },
    {
      "end": 1648.601,
      "speaker_label": "SPEAKER_12",
      "start": 1635.725,
      "text": "And why I say that is because we've really built a good muscle in our sales organization this year for really identifying new workloads that customers are going to move into production next year."
    },
    {
      "end": 1655.69,
      "speaker_label": "SPEAKER_12",
      "start": 1648.621,
      "text": "And we have a very good backlog of those things that our salespeople are calling for next year, including Q4 as well."
    },
    {
      "end": 1660.056,
      "speaker_label": "SPEAKER_11",
      "start": 1659.094,
      "text": "Great to see this turnaround."
    },
    {
      "end": 1660.696,
      "speaker_label": "SPEAKER_11",
      "start": 1660.076,
      "text": "Thank you so much."
    },
    {
      "end": 1664.301,
      "speaker_label": "SPEAKER_11",
      "start": 1660.716,
      "text": "Congrats."
    },
    {
      "end": 1665.242,
      "speaker_label": "SPEAKER_07",
      "start": 1664.321,
      "text": "Thank you for your question."
    },
    {
      "end": 1668.398,
      "speaker_label": "SPEAKER_07",
      "start": 1665.593,
      "text": "Next question is from the line of Remo Lincho with Barclays."
    },
    {
      "end": 1669.099,
      "speaker_label": "SPEAKER_07",
      "start": 1668.418,
      "text": "Your line is now open."
    },
    {
      "end": 1671.063,
      "speaker_label": "SPEAKER_10",
      "start": 1670.502,
      "text": "Hey, thank you."
    },
    {
      "end": 1675.551,
      "speaker_label": "SPEAKER_10",
      "start": 1671.804,
      "text": "Speaker, can you talk a little bit about the acquisition from today?"
    },
    {
      "end": 1682.904,
      "speaker_label": "SPEAKER_10",
      "start": 1675.571,
      "text": "Historically, you always said you wanted to do some ETL, but there's obviously quite a few ETL players in the market."
    },
    {
      "end": 1689.215,
      "speaker_label": "SPEAKER_10",
      "start": 1683.645,
      "text": "How do you see that evolving between what you want to do, what the other players want to do, and what does it bring to Snowflake?"
    },
    {
      "end": 1690.437,
      "speaker_label": "SPEAKER_10",
      "start": 1689.235,
      "text": "And then I have a follow-up from Mike."
    },
    {
      "end": 1696.387,
      "speaker_label": "SPEAKER_08",
      "start": 1692.222,
      "text": "First of all, these are all very, very, very large spaces."
    },
    {
      "end": 1721.335,
      "speaker_label": "SPEAKER_08",
      "start": 1697.628,
      "text": "The overall vision, especially with the era of interoperable data that's upon us, is we think that there is a very large opportunity for Snowflake to help our customers act on all of their data, not just the gold data that they used to put into Snowflake for analytics,"
    },
    {
      "end": 1733.795,
      "speaker_label": "SPEAKER_08",
      "start": 1721.669,
      "text": "But the kind of examples that I get from talking to our customers is they have hundreds, sometimes thousand times as much data sitting in cloud storage as they will do in a structured data platform."
    },
    {
      "end": 1739.948,
      "speaker_label": "SPEAKER_08",
      "start": 1734.196,
      "text": "And more and more, they also feel like it's important that they own that data."
    },
    {
      "end": 1756.645,
      "speaker_label": "SPEAKER_08",
      "start": 1740.265,
      "text": "And so you're seeing a shift in which things like application data is getting desiloed, deconstructed, so that great new things that you can imagine, both for data transformation, data engineering, but also AI, is going to happen."
    },
    {
      "end": 1762.192,
      "speaker_label": "SPEAKER_08",
      "start": 1757.006,
      "text": "And this is the context in which something like a DataVolo is really important for us."
    },
    {
      "end": 1766.037,
      "speaker_label": "SPEAKER_08",
      "start": 1762.352,
      "text": "It comes with over 100 different connectors out of the box."
    },
    {
      "end": 1768.861,
      "speaker_label": "SPEAKER_08",
      "start": 1766.017,
      "text": "It is going to run as part of Snowflake."
    },
    {
      "end": 1777.351,
      "speaker_label": "SPEAKER_08",
      "start": 1768.961,
      "text": "It can also be deployed in customer VPCs, which lets us bring data in from places that normally we would not be able to run Snowflake on."
    },
    {
      "end": 1787.224,
      "speaker_label": "SPEAKER_08",
      "start": 1777.792,
      "text": "And so it's really a force multiplier for the data that our data engineering pipelines can take on, but our AI products can be built on."
    },
    {
      "end": 1795.534,
      "speaker_label": "SPEAKER_08",
      "start": 1788.105,
      "text": "But as I said, this is a very, very large space, estimated just data engineering data products as a whole,"
    },
    {
      "end": 1800.161,
      "speaker_label": "SPEAKER_08",
      "start": 1795.514,
      "text": "we think will be on the order of several hundred billion dollars 10 years from now."
    },
    {
      "end": 1801.944,
      "speaker_label": "SPEAKER_08",
      "start": 1800.522,
      "text": "And so there's going to be lots of companies."
    },
    {
      "end": 1809.396,
      "speaker_label": "SPEAKER_08",
      "start": 1802.425,
      "text": "Our value add is this easy, integrated, highly efficient platform that we can bring for our customers."
    },
    {
      "end": 1813.182,
      "speaker_label": "SPEAKER_08",
      "start": 1809.997,
      "text": "And things like DataVolo are an important piece here."
    },
    {
      "end": 1813.623,
      "speaker_label": "SPEAKER_08",
      "start": 1813.282,
      "text": "Christian?"
    },
    {
      "end": 1816.628,
      "speaker_label": "SPEAKER_01",
      "start": 1815.285,
      "text": "I think you covered it well."
    },
    {
      "end": 1819.412,
      "speaker_label": "SPEAKER_01",
      "start": 1816.648,
      "text": "And, of course, we have plenty of partners here."
    },
    {
      "end": 1822.022,
      "speaker_label": "SPEAKER_01",
      "start": 1819.679,
      "text": "also doing data integration."
    },
    {
      "end": 1825.506,
      "speaker_label": "SPEAKER_01",
      "start": 1822.422,
      "text": "And the reality is there's so many sources of data."
    },
    {
      "end": 1830.452,
      "speaker_label": "SPEAKER_01",
      "start": 1825.987,
      "text": "A big area of focus of data model was the unstructured data that Sridhar mentioned."
    },
    {
      "end": 1832.755,
      "speaker_label": "SPEAKER_10",
      "start": 1831.974,
      "text": "Okay, perfect."
    },
    {
      "end": 1837.32,
      "speaker_label": "SPEAKER_10",
      "start": 1832.775,
      "text": "And Mike, if you look at this quarter, there's much better performance congrats for me as well."
    },
    {
      "end": 1842.386,
      "speaker_label": "SPEAKER_10",
      "start": 1838.262,
      "text": "If you think about the question that everyone is going to ask is, like, is it economy or are you guys executing better?"
    },
    {
      "end": 1846.952,
      "speaker_label": "SPEAKER_10",
      "start": 1842.447,
      "text": "Is there any comments you can make in terms of what you're seeing in the field from just end-to-mind getting better?"
    },
    {
      "end": 1852.79,
      "speaker_label": "SPEAKER_12",
      "start": 1848.485,
      "text": "I would say from the economy, it's very similar to what I said last quarter."
    },
    {
      "end": 1854.793,
      "speaker_label": "SPEAKER_12",
      "start": 1852.81,
      "text": "It's not euphoric, but it's good."
    },
    {
      "end": 1855.814,
      "speaker_label": "SPEAKER_12",
      "start": 1854.913,
      "text": "It's not bad."
    },
    {
      "end": 1874.597,
      "speaker_label": "SPEAKER_12",
      "start": 1855.854,
      "text": "And I think we are just executing very well, and we are really seeing the results of our go-to-market efforts that we've had this year and really working to identify new workloads rather than just trying to focus on bookings."
    },
    {
      "end": 1877.04,
      "speaker_label": "SPEAKER_12",
      "start": 1874.617,
      "text": "And I think that's paying off right now, and it's forcing it."
    },
    {
      "end": 1879.447,
      "speaker_label": "SPEAKER_12",
      "start": 1877.324,
      "text": "our sales people to be closer to customers."
    },
    {
      "end": 1881.711,
      "speaker_label": "SPEAKER_10",
      "start": 1881.37,
      "text": "Okay, perfect."
    },
    {
      "end": 1882.231,
      "speaker_label": "SPEAKER_10",
      "start": 1881.731,
      "text": "Makes sense."
    },
    {
      "end": 1885.016,
      "speaker_label": "SPEAKER_10",
      "start": 1882.251,
      "text": "Thank you, Congress."
    },
    {
      "end": 1885.877,
      "speaker_label": "SPEAKER_07",
      "start": 1885.036,
      "text": "Thank you for your question."
    },
    {
      "end": 1889.923,
      "speaker_label": "SPEAKER_07",
      "start": 1886.678,
      "text": "The next question is from the line of Kirk Matern with Evercore ISI."
    },
    {
      "end": 1890.644,
      "speaker_label": "SPEAKER_07",
      "start": 1889.943,
      "text": "Your line is now open."
    },
    {
      "end": 1894.871,
      "speaker_label": "SPEAKER_15",
      "start": 1892.026,
      "text": "Yeah, thanks very much, and I'll echo the congrats on a nice quarter."
    },
    {
      "end": 1901.661,
      "speaker_label": "SPEAKER_15",
      "start": 1895.572,
      "text": "Sridhar, obviously we're going to hear a lot more about autonomous agents over the next year from a lot of providers in the markets."
    },
    {
      "end": 1911.116,
      "speaker_label": "SPEAKER_15",
      "start": 1901.928,
      "text": "Can you just talk about what that means for consumption on Snowflake data platforms, meaning it would seem that agents are going to be heavy consumers of data?"
    },
    {
      "end": 1917.622,
      "speaker_label": "SPEAKER_15",
      "start": 1911.557,
      "text": "Just kind of curious about how you think about that opportunity as this becomes a little bit more of a ubiquitous sort of topic."
    },
    {
      "end": 1924.629,
      "speaker_label": "SPEAKER_08",
      "start": 1919.624,
      "text": "It's a good question, but, you know, I always focus on customer value."
    },
    {
      "end": 1929.133,
      "speaker_label": "SPEAKER_08",
      "start": 1925.049,
      "text": "It's important because that will drive consumption."
    },
    {
      "end": 1942.675,
      "speaker_label": "SPEAKER_08",
      "start": 1929.62,
      "text": "And so with the products that we have released, like Cortex Search, for example, you can build a pretty credible chatbot and play with it and use it at low frequency for something like $10."
    },
    {
      "end": 1945.579,
      "speaker_label": "SPEAKER_08",
      "start": 1942.776,
      "text": "So our goal is to make technology easy."
    },
    {
      "end": 1949.243,
      "speaker_label": "SPEAKER_08",
      "start": 1945.939,
      "text": "Consumption is a consequence when there is broad use."
    },
    {
      "end": 1955.07,
      "speaker_label": "SPEAKER_08",
      "start": 1949.764,
      "text": "Having said that, our AI investments have always had a very strong focus"
    },
    {
      "end": 1957.741,
      "speaker_label": "SPEAKER_08",
      "start": 1955.337,
      "text": "on trustworthiness, on reliability."
    },
    {
      "end": 1969.397,
      "speaker_label": "SPEAKER_08",
      "start": 1958.061,
      "text": "In fact, the three things that I always talk about when I talk to our customers or our teams about AI is our AI is easy, it is efficient, and it is trusted."
    },
    {
      "end": 1977.69,
      "speaker_label": "SPEAKER_08",
      "start": 1970.099,
      "text": "So this is what lets our customers create chatbots that can provide citations so they can be sure of the answers that they get."
    },
    {
      "end": 1980.754,
      "speaker_label": "SPEAKER_08",
      "start": 1977.71,
      "text": "Similarly, with Cortex Analyst, we've been working "
    },
    {
      "end": 1989.999,
      "speaker_label": "SPEAKER_08",
      "start": 1981.409,
      "text": "on increasing the reliability so that when they get a structured answer to a question, they can actually be sure that it's the right answer."
    },
    {
      "end": 2003.754,
      "speaker_label": "SPEAKER_08",
      "start": 1990.699,
      "text": "The cool thing about Snowflake Intelligent, especially in conjunction with our partnership with Anthropic, is it now provides the ability to tie all of these things together."
    },
    {
      "end": 2005.476,
      "speaker_label": "SPEAKER_08",
      "start": 2004.135,
      "text": "So if you're a salesperson,"
    },
    {
      "end": 2012.831,
      "speaker_label": "SPEAKER_08",
      "start": 2005.456,
      "text": "Instead of searching first and drive to see, hey, what action item did you agree to after the last meeting?"
    },
    {
      "end": 2020.748,
      "speaker_label": "SPEAKER_08",
      "start": 2012.872,
      "text": "And then perhaps going to Snowflake to find what are consumption trends with a particular customer and then maybe updating Salesforce."
    },
    {
      "end": 2026.637,
      "speaker_label": "SPEAKER_08",
      "start": 2020.728,
      "text": "We look forward to a world in which actions like this can be done off of a single interface."
    },
    {
      "end": 2037.293,
      "speaker_label": "SPEAKER_08",
      "start": 2026.957,
      "text": "And the natural consequence then is how do you turn this into a periodic task, something that is done on your behalf in the background so that it can tell you if there is a problem."
    },
    {
      "end": 2040.998,
      "speaker_label": "SPEAKER_08",
      "start": 2037.373,
      "text": "This is where things like anomaly detection, taking automated actions,"
    },
    {
      "end": 2043.69,
      "speaker_label": "SPEAKER_08",
      "start": 2041.147,
      "text": "becomes pretty interesting."
    },
    {
      "end": 2048.616,
      "speaker_label": "SPEAKER_08",
      "start": 2044.491,
      "text": "But we provide technology with a view towards what creates value."
    },
    {
      "end": 2058.208,
      "speaker_label": "SPEAKER_08",
      "start": 2048.976,
      "text": "We feel very confident that you can think of agents as essentially the 21st century version of cron jobs that we all used to run."
    },
    {
      "end": 2061.972,
      "speaker_label": "SPEAKER_08",
      "start": 2058.528,
      "text": "That's the real power that agents provide with a lot more sophistication."
    },
    {
      "end": 2070.883,
      "speaker_label": "SPEAKER_08",
      "start": 2062.893,
      "text": "And it's an enabling value for our customers that we think we can be embedded even more deeply in their businesses."
    },
    {
      "end": 2073.827,
      "speaker_label": "SPEAKER_08",
      "start": 2070.863,
      "text": "And absolutely, that will also drive a lot of consumption."
    },
    {
      "end": 2087.787,
      "speaker_label": "SPEAKER_08",
      "start": 2074.128,
      "text": "A lot of our heavy AI consumption, by the way, comes from things like people being able to write a single SQL statement that can do sentiment detection or that can do summarization across a million pieces of customer feedback."
    },
    {
      "end": 2091.933,
      "speaker_label": "SPEAKER_08",
      "start": 2088.108,
      "text": "Previously, that used to be like a little machine learning project that a team needed to do."
    },
    {
      "end": 2097.101,
      "speaker_label": "SPEAKER_08",
      "start": 2092.374,
      "text": "At this point, that's a piece of SQL that someone at a college can write in five minutes."
    },
    {
      "end": 2099.925,
      "speaker_label": "SPEAKER_08",
      "start": 2097.161,
      "text": "That's the utility that we get from it."
    },
    {
      "end": 2103.672,
      "speaker_label": "SPEAKER_08",
      "start": 2100.108,
      "text": "And it's the same pattern with agents as well."
    },
    {
      "end": 2104.332,
      "speaker_label": "SPEAKER_15",
      "start": 2103.692,
      "text": "That's really helpful."
    },
    {
      "end": 2105.494,
      "speaker_label": "SPEAKER_15",
      "start": 2104.352,
      "text": "And, Mike, just a really quick one."
    },
    {
      "end": 2108.477,
      "speaker_label": "SPEAKER_15",
      "start": 2105.934,
      "text": "International is obviously a big opportunity for you."
    },
    {
      "end": 2112.921,
      "speaker_label": "SPEAKER_15",
      "start": 2108.837,
      "text": "How do you feel like you're positioned in sort of Europe and Asia-Pac as you head into 2025?"
    },
    {
      "end": 2115.424,
      "speaker_label": "SPEAKER_15",
      "start": 2113.362,
      "text": "Thanks again."
    },
    {
      "end": 2117.346,
      "speaker_label": "SPEAKER_12",
      "start": 2115.444,
      "text": "I think we're positioned very well."
    },
    {
      "end": 2126.976,
      "speaker_label": "SPEAKER_12",
      "start": 2118.267,
      "text": "Going into Europe, we've really been focused on the higher end of the market, and we're going to focus more on the mid-market in Europe and Europe"
    },
    {
      "end": 2130.514,
      "speaker_label": "SPEAKER_12",
      "start": 2127.327,
      "text": "APJ continues to grow very nicely."
    },
    {
      "end": 2135.043,
      "speaker_label": "SPEAKER_12",
      "start": 2130.554,
      "text": "We're seeing strong growth in Japan in particular."
    },
    {
      "end": 2137.849,
      "speaker_label": "SPEAKER_12",
      "start": 2135.444,
      "text": "We're starting to see stuff in India, Korea."
    },
    {
      "end": 2147.209,
      "speaker_label": "SPEAKER_12",
      "start": 2138.43,
      "text": "Australia has always done very well for us and New Zealand, believe it or not, is a very good market for a small market, but a very strong market for us."
    },
    {
      "end": 2158.95,
      "speaker_label": "SPEAKER_08",
      "start": 2150.362,
      "text": "Fun fact, we power most of the government agencies in New Zealand, and they do way more sharing of data between each other than most of our U.S."
    },
    {
      "end": 2160.492,
      "speaker_label": "SPEAKER_08",
      "start": 2159.01,
      "text": "government agencies do."
    },
    {
      "end": 2163.234,
      "speaker_label": "SPEAKER_15",
      "start": 2162.694,
      "text": "Thank you all."
    },
    {
      "end": 2167.398,
      "speaker_label": "SPEAKER_07",
      "start": 2166.537,
      "text": "Thank you for your question."
    },
    {
      "end": 2171.122,
      "speaker_label": "SPEAKER_07",
      "start": 2167.979,
      "text": "Next question is from the line of Brad Zelnick with Deutsche Bank."
    },
    {
      "end": 2173.524,
      "speaker_label": "SPEAKER_07",
      "start": 2171.142,
      "text": "Your line is now open."
    },
    {
      "end": 2173.904,
      "speaker_label": "SPEAKER_14",
      "start": 2173.544,
      "text": "Oh, great."
    },
    {
      "end": 2175.926,
      "speaker_label": "SPEAKER_14",
      "start": 2173.964,
      "text": "Thank you so much, and congrats."
    },
    {
      "end": 2177.668,
      "speaker_label": "SPEAKER_14",
      "start": 2176.287,
      "text": "Really, really great to see you there."
    },
    {
      "end": 2180.985,
      "speaker_label": "SPEAKER_14",
      "start": 2178.121,
      "text": "the pace of innovation showing up in results."
    },
    {
      "end": 2185.772,
      "speaker_label": "SPEAKER_14",
      "start": 2181.005,
      "text": "I wanted to ask, how are customers using Cortex and making it available in their organizations?"
    },
    {
      "end": 2192.983,
      "speaker_label": "SPEAKER_14",
      "start": 2186.313,
      "text": "And how much of it should we think of as driving incremental consumption versus something maybe they were already doing with conventional SQL queries?"
    },
    {
      "end": 2206.963,
      "speaker_label": "SPEAKER_08",
      "start": 2196.588,
      "text": "I think that generally the kind of use cases that Cortex AI enables are pretty distinct from what used to be possible with SQLs."
    },
    {
      "end": 2221.181,
      "speaker_label": "SPEAKER_08",
      "start": 2207.247,
      "text": "I let CK chime in in a second, but let's face it, if you wanted to go through all of the notes written by a sales team on use cases and analyze it, most of the time the project wouldn't even happen."
    },
    {
      "end": 2226.846,
      "speaker_label": "SPEAKER_08",
      "start": 2221.801,
      "text": "Recently, this is a self-referential example of us using our own product."
    },
    {
      "end": 2232.732,
      "speaker_label": "SPEAKER_08",
      "start": 2227.267,
      "text": "One of the things that we wanted to do was we wanted better insight into use cases that our sales team had created."
    },
    {
      "end": 2241.317,
      "speaker_label": "SPEAKER_08",
      "start": 2232.965,
      "text": "But the idea of clicking through a UI and 50,000 different use cases to figure out what was going on is not something you can generally find volunteers for."
    },
    {
      "end": 2253.054,
      "speaker_label": "SPEAKER_08",
      "start": 2241.898,
      "text": "But it turns out you can write a few queries that can do a pretty amazing job of inserting structured information from all of these notes that are out there."
    },
    {
      "end": 2258.922,
      "speaker_label": "SPEAKER_08",
      "start": 2253.494,
      "text": "And we were able to do something that honestly would never have gotten done as a project before."
    },
    {
      "end": 2267.615,
      "speaker_label": "SPEAKER_08",
      "start": 2258.902,
      "text": "It's these kinds of things that I think the Cortex family of products will enable."
    },
    {
      "end": 2270.961,
      "speaker_label": "SPEAKER_08",
      "start": 2268.717,
      "text": "But again, we focus on value creation."
    },
    {
      "end": 2274.666,
      "speaker_label": "SPEAKER_08",
      "start": 2271.001,
      "text": "What's the additional value that the customer gets that we get?"
    },
    {
      "end": 2284.842,
      "speaker_label": "SPEAKER_01",
      "start": 2275.688,
      "text": "Yeah, I think many of the use cases or scenarios that Sridhar covered are around text analytics, which is very adjacent to where we've been for a long time."
    },
    {
      "end": 2291.609,
      "speaker_label": "SPEAKER_01",
      "start": 2285.243,
      "text": "But as we announced in Build, we've expanded beyond text to support images, audio, and video."
    },
    {
      "end": 2294.392,
      "speaker_label": "SPEAKER_01",
      "start": 2291.629,
      "text": "So that's one part of it is analytics."
    },
    {
      "end": 2302.44,
      "speaker_label": "SPEAKER_01",
      "start": 2294.412,
      "text": "The other piece that we're seeing a lot of momentum and interest is with Cortex Search and Cortex Analyst, which is how do we democratize access to data."
    },
    {
      "end": 2305.483,
      "speaker_label": "SPEAKER_01",
      "start": 2303.101,
      "text": "And that is going quite well."
    },
    {
      "end": 2308.145,
      "speaker_label": "SPEAKER_14",
      "start": 2307.545,
      "text": "Exciting stuff."
    },
    {
      "end": 2309.727,
      "speaker_label": "SPEAKER_14",
      "start": 2308.186,
      "text": "Mike, just maybe a follow-up for you."
    },
    {
      "end": 2314.812,
      "speaker_label": "SPEAKER_14",
      "start": 2310.428,
      "text": "Based on your comments on Iceberg, are you baking in less headwind for the year into the guide?"
    },
    {
      "end": 2319.256,
      "speaker_label": "SPEAKER_14",
      "start": 2315.23,
      "text": "And then what's the latest on how customers are thinking about the mix of where data will live?"
    },
    {
      "end": 2320.338,
      "speaker_label": "SPEAKER_12",
      "start": 2319.857,
      "text": "Thanks so much."
    },
    {
      "end": 2326.468,
      "speaker_label": "SPEAKER_12",
      "start": 2321.941,
      "text": "As I said, I'm not going to be talking about different performance improvements going forward."
    },
    {
      "end": 2329.172,
      "speaker_label": "SPEAKER_12",
      "start": 2326.508,
      "text": "It's factored into the guide with where we see them."
    },
    {
      "end": 2342.233,
      "speaker_label": "SPEAKER_12",
      "start": 2329.192,
      "text": "But as I mentioned in my prepared remarks, we think with what we're seeing with some of the new data engineering features, that that will more than offset any potential storage revenue we lose as a result of people moving to "
    },
    {
      "end": 2344.756,
      "speaker_label": "SPEAKER_12",
      "start": 2342.753,
      "text": "moving data out of Snowflake."
    },
    {
      "end": 2355.896,
      "speaker_label": "SPEAKER_12",
      "start": 2344.857,
      "text": "We think net-net is just going to open more opportunity for us, and it's a much bigger opportunity, the amount of data that is not in Snowflake today that is accessible to us through Iceberg."
    },
    {
      "end": 2358.42,
      "speaker_label": "SPEAKER_12",
      "start": 2357.459,
      "text": "Thanks for making that clear."
    },
    {
      "end": 2362.928,
      "speaker_label": "SPEAKER_12",
      "start": 2358.621,
      "text": "Thanks for taking my questions."
    },
    {
      "end": 2363.83,
      "speaker_label": "SPEAKER_07",
      "start": 2362.948,
      "text": "Thank you for your question."
    },
    {
      "end": 2367.536,
      "speaker_label": "SPEAKER_07",
      "start": 2364.791,
      "text": "Next question is from the line of Brent Bill with Jefferies."
    },
    {
      "end": 2368.137,
      "speaker_label": "SPEAKER_07",
      "start": 2367.556,
      "text": "Your line is now open."
    },
    {
      "end": 2371.113,
      "speaker_label": "SPEAKER_06",
      "start": 2370.412,
      "text": "Thanks."
    },
    {
      "end": 2375.903,
      "speaker_label": "SPEAKER_06",
      "start": 2371.194,
      "text": "Sridhar, just on federal, you mentioned New Zealand powering many of their agencies."
    },
    {
      "end": 2379.61,
      "speaker_label": "SPEAKER_06",
      "start": 2376.865,
      "text": "How would you characterize where you're at in the federal journey?"
    },
    {
      "end": 2386.745,
      "speaker_label": "SPEAKER_06",
      "start": 2379.65,
      "text": "And given what's just happened in the last month, there's been a lot of concern about efficiency in the federal government."
    },
    {
      "end": 2392.015,
      "speaker_label": "SPEAKER_06",
      "start": 2386.865,
      "text": "Can you just give us your thoughts about what's going to happen here over the next couple of years?"
    },
    {
      "end": 2402.615,
      "speaker_label": "SPEAKER_08",
      "start": 2393.53,
      "text": "Yeah, we recently did a small acquisition of a company called Night Shift, which will better position us in the federal business."
    },
    {
      "end": 2408.552,
      "speaker_label": "SPEAKER_08",
      "start": 2403.337,
      "text": "We continue to think of it as a pretty large opportunity for us."
    },
    {
      "end": 2423.65,
      "speaker_label": "SPEAKER_08",
      "start": 2409.005,
      "text": "And I would even say that efficiency is actually good news for Snowflake in the sense that we are way better at processing huge amounts of data and letting customers, including the federal government, use it effectively."
    },
    {
      "end": 2429.66,
      "speaker_label": "SPEAKER_08",
      "start": 2423.67,
      "text": "I don't have a lot more color to add right now, but it continues to be a focus."
    },
    {
      "end": 2434.708,
      "speaker_label": "SPEAKER_08",
      "start": 2429.68,
      "text": "We spend a lot of time in making sure that that business grows."
    },
    {
      "end": 2438.142,
      "speaker_label": "SPEAKER_08",
      "start": 2434.958,
      "text": "We've gotten a number of certifications just in our prerequisites."
    },
    {
      "end": 2439.803,
      "speaker_label": "SPEAKER_08",
      "start": 2438.222,
      "text": "We feel good about where we are."
    },
    {
      "end": 2440.885,
      "speaker_label": "SPEAKER_08",
      "start": 2439.843,
      "text": "Stay tuned for more news."
    },
    {
      "end": 2442.306,
      "speaker_label": "SPEAKER_12",
      "start": 2441.285,
      "text": "I'll just add to that."
    },
    {
      "end": 2444.168,
      "speaker_label": "SPEAKER_12",
      "start": 2442.366,
      "text": "As you know, the U.S."
    },
    {
      "end": 2448.213,
      "speaker_label": "SPEAKER_12",
      "start": 2444.208,
      "text": "federal space is a very, very, very small piece of our business today."
    },
    {
      "end": 2455.601,
      "speaker_label": "SPEAKER_12",
      "start": 2449.815,
      "text": "We feel good about what we're doing, and we think there's a lot of upside in the federal space over the next couple of years."
    },
    {
      "end": 2459.986,
      "speaker_label": "SPEAKER_06",
      "start": 2459.385,
      "text": "Thanks, Mike."
    },
    {
      "end": 2464.611,
      "speaker_label": "SPEAKER_06",
      "start": 2460.086,
      "text": "And just for you, Mike, on the big deals, you mentioned three deals over 50."
    },
    {
      "end": 2469.518,
      "speaker_label": "SPEAKER_06",
      "start": 2465.131,
      "text": "I think you're coming up and comping a $250 million deal last Q4."
    },
    {
      "end": 2474.846,
      "speaker_label": "SPEAKER_06",
      "start": 2469.598,
      "text": "Can you just talk about what you're seeing in these bigger transactions?"
    },
    {
      "end": 2478.612,
      "speaker_label": "SPEAKER_06",
      "start": 2474.906,
      "text": "Are you seeing more transactions that are smaller?"
    },
    {
      "end": 2481.076,
      "speaker_label": "SPEAKER_06",
      "start": 2478.632,
      "text": "Are you seeing some of these bigger elephants starting to roam again?"
    },
    {
      "end": 2483.7,
      "speaker_label": "SPEAKER_06",
      "start": 2481.116,
      "text": "How would you characterize what you're seeing in the pipe for Q4?"
    },
    {
      "end": 2489.068,
      "speaker_label": "SPEAKER_12",
      "start": 2484.862,
      "text": "I think Q4 is going to be a very strong bookings quarter like it normally is."
    },
    {
      "end": 2493.535,
      "speaker_label": "SPEAKER_12",
      "start": 2489.489,
      "text": "And we have a number of large deals we're working on that are"
    },
    {
      "end": 2497.102,
      "speaker_label": "SPEAKER_12",
      "start": 2493.818,
      "text": "renewals with existing customers with growth in them."
    },
    {
      "end": 2502.75,
      "speaker_label": "SPEAKER_07",
      "start": 2502.33,
      "text": "Great, thanks."
    },
    {
      "end": 2505.975,
      "speaker_label": "SPEAKER_07",
      "start": 2505.113,
      "text": "Thank you for your question."
    },
    {
      "end": 2509.479,
      "speaker_label": "SPEAKER_07",
      "start": 2506.716,
      "text": "Next question is from the line of Mike Sikos with Needham & Co."
    },
    {
      "end": 2510.24,
      "speaker_label": "SPEAKER_07",
      "start": 2509.539,
      "text": "Your line is now open."
    },
    {
      "end": 2513.905,
      "speaker_label": "SPEAKER_13",
      "start": 2513.124,
      "text": "Thanks, guys."
    },
    {
      "end": 2516.569,
      "speaker_label": "SPEAKER_13",
      "start": 2513.925,
      "text": "This is Matt Coligione for Mike Sikos over at Needham."
    },
    {
      "end": 2527.875,
      "speaker_label": "SPEAKER_13",
      "start": 2517.14,
      "text": "This is the healthiest quarter-over-quarter addition to RPO and CRPO during an October quarter, stretching back over multiple years and potentially a record 3Q for the company."
    },
    {
      "end": 2539.17,
      "speaker_label": "SPEAKER_13",
      "start": 2528.495,
      "text": "Can you help us think about what drove the strong growth, and did the two top 10 customers Mike alluded to being on monthly commitments last quarter sign new commitments during the quarter?"
    },
    {
      "end": 2546.64,
      "speaker_label": "SPEAKER_12",
      "start": 2541.894,
      "text": "We didn't have big commitments from those customers in the quarter."
    },
    {
      "end": 2561.41,
      "speaker_label": "SPEAKER_12",
      "start": 2546.873,
      "text": "And what I would say is a lot of the current RPO growth in particular just has to do with larger customers based upon when their renewals are coming up or when they're running out of capacity and renew."
    },
    {
      "end": 2568.038,
      "speaker_label": "SPEAKER_12",
      "start": 2562.392,
      "text": "But it was a strong growth quarter in total RPO and current RPO."
    },
    {
      "end": 2574.366,
      "speaker_label": "SPEAKER_12",
      "start": 2568.058,
      "text": "And you're seeing that in the actual reported revenue number and what we're guiding to for next quarter."
    },
    {
      "end": 2592.735,
      "speaker_label": "SPEAKER_08",
      "start": 2576.438,
      "text": "Overall, the little bit of color, I end up talking to a lot of customers that I will add here, is our conversations are inevitably focused on where are places where we can help them get more efficient, where we can help them drive more revenue."
    },
    {
      "end": 2602.885,
      "speaker_label": "SPEAKER_08",
      "start": 2593.515,
      "text": "And the more effectively our sales team is able to do that, and they did a wonderful job in the first two, three quarters of the year."
    },
    {
      "end": 2607.896,
      "speaker_label": "SPEAKER_08",
      "start": 2603.05,
      "text": "the more it reflects itself naturally in renewals."
    },
    {
      "end": 2618.207,
      "speaker_label": "SPEAKER_08",
      "start": 2608.576,
      "text": "And so I would say that this is a consequence of the hard work that our sales teams are doing day in and day out to further the business of our customers."
    },
    {
      "end": 2622.072,
      "speaker_label": "SPEAKER_13",
      "start": 2620.951,
      "text": "That's great to hear."
    },
    {
      "end": 2626.577,
      "speaker_label": "SPEAKER_13",
      "start": 2622.673,
      "text": "And then the trend in sequential customer additions remains mixed."
    },
    {
      "end": 2632.709,
      "speaker_label": "SPEAKER_13",
      "start": 2626.962,
      "text": "Given the go-to-market changes, when do you expect to begin to start showing an inflection here?"
    },
    {
      "end": 2636.233,
      "speaker_label": "SPEAKER_13",
      "start": 2632.849,
      "text": "Is that more of an FY26 event, or how are you thinking about that?"
    },
    {
      "end": 2648.027,
      "speaker_label": "SPEAKER_12",
      "start": 2640.157,
      "text": "You know, in terms of net additions, I expect Q4 to be a good net addition quarter, and I think you'll see the fruits of our labor this year flow into 2026."
    },
    {
      "end": 2652.492,
      "speaker_label": "SPEAKER_12",
      "start": 2648.087,
      "text": "Awesome."
    },
    {
      "end": 2655.916,
      "speaker_label": "SPEAKER_13",
      "start": 2652.532,
      "text": "Thanks so much, guys."
    },
    {
      "end": 2656.817,
      "speaker_label": "SPEAKER_07",
      "start": 2655.936,
      "text": "Thank you for your question."
    },
    {
      "end": 2661.701,
      "speaker_label": "SPEAKER_07",
      "start": 2657.675,
      "text": "Next question is from the line of Michael Tierin with Wells Fargo."
    },
    {
      "end": 2664.786,
      "speaker_label": "SPEAKER_07",
      "start": 2664.004,
      "text": "Hey, thanks very much."
    },
    {
      "end": 2666.508,
      "speaker_label": "SPEAKER_03",
      "start": 2664.826,
      "text": "I appreciate you taking the questions."
    },
    {
      "end": 2675.962,
      "speaker_label": "SPEAKER_03",
      "start": 2667.369,
      "text": "Maybe on the expansion rates holding stable here, I want to ask about that metric just in context with the go-to-market shift towards consumption."
    },
    {
      "end": 2684.695,
      "speaker_label": "SPEAKER_03",
      "start": 2675.982,
      "text": "And maybe you could just help give us some context around how that consumption focus may be impacting the trajectory we're seeing on expansion rates if there are"
    },
    {
      "end": 2692.76,
      "speaker_label": "SPEAKER_03",
      "start": 2685.113,
      "text": "common plays you're seeing work across customers and if you're starting to hit a point where you're feeling comfortable that retention rates are starting to hit a baseline."
    },
    {
      "end": 2706.692,
      "speaker_label": "SPEAKER_12",
      "start": 2695.863,
      "text": "You know, I think I'm never going to guide you in that revenue retention, by the way, but I do feel it feels pretty stable based on what we're seeing in there."
    },
    {
      "end": 2715.12,
      "speaker_label": "SPEAKER_12",
      "start": 2707.153,
      "text": "And a lot of that is driven by our core business with the addition of some of our older customers starting to use some of these newer features."
    },
    {
      "end": 2716.326,
      "speaker_label": "SPEAKER_12",
      "start": 2715.505,
      "text": "as well, too."
    },
    {
      "end": 2718.71,
      "speaker_label": "SPEAKER_12",
      "start": 2716.507,
      "text": "So stay tuned."
    },
    {
      "end": 2723.097,
      "speaker_label": "SPEAKER_12",
      "start": 2718.73,
      "text": "That's not something we're going to guide to."
    },
    {
      "end": 2723.458,
      "speaker_label": "SPEAKER_03",
      "start": 2723.117,
      "text": "Okay."
    },
    {
      "end": 2724.86,
      "speaker_label": "SPEAKER_03",
      "start": 2723.478,
      "text": "It's still helpful commentary."
    },
    {
      "end": 2730.549,
      "speaker_label": "SPEAKER_03",
      "start": 2724.94,
      "text": "And then just a follow-up on one of the comments around the offsets to storage headwinds."
    },
    {
      "end": 2733.273,
      "speaker_label": "SPEAKER_03",
      "start": 2730.829,
      "text": "I was just hoping you could help us think through the sequencing of those."
    },
    {
      "end": 2741.867,
      "speaker_label": "SPEAKER_03",
      "start": 2733.293,
      "text": "Is that something that can immediately help offset any storage headwinds tied to iceberg, or is that something that"
    },
    {
      "end": 2748.166,
      "speaker_label": "SPEAKER_03",
      "start": 2742.337,
      "text": "over time, the customer profile, the spend profile helps adjust for those things?"
    },
    {
      "end": 2751.21,
      "speaker_label": "SPEAKER_03",
      "start": 2748.286,
      "text": "Is there just a sequence of events we should all be mindful of there?"
    },
    {
      "end": 2770.099,
      "speaker_label": "SPEAKER_12",
      "start": 2752.853,
      "text": "Yeah, as I said, I'm really not seeing a big storage headwind as a result of Iceberg, and to the extent any of our customers do move data off, it will be more than offset by the growth we're seeing in"
    },
    {
      "end": 2773.328,
      "speaker_label": "SPEAKER_12",
      "start": 2770.805,
      "text": "data engineering, the newer data engineering features."
    },
    {
      "end": 2782.76,
      "speaker_label": "SPEAKER_12",
      "start": 2773.648,
      "text": "And as I also said, we are starting to see a positive impact of Iceberg with new workloads that were never in Snowflake before."
    },
    {
      "end": 2790.749,
      "speaker_label": "SPEAKER_12",
      "start": 2783.28,
      "text": "Now customers are using Snowflake on open file Iceberg formats."
    },
    {
      "end": 2797.738,
      "speaker_label": "SPEAKER_08",
      "start": 2790.769,
      "text": "I'll stress something that I said earlier, which is customers typically have 100 to 1,000 times more data sitting in cloud storage."
    },
    {
      "end": 2799.58,
      "speaker_label": "SPEAKER_08",
      "start": 2798.939,
      "text": "And"
    },
    {
      "end": 2811.122,
      "speaker_label": "SPEAKER_08",
      "start": 2799.897,
      "text": "with the things that we have done with data engineering or even things like Cortex AI, which you can think of as AI extensions to what you can do"
    },
    {
      "end": 2823.601,
      "speaker_label": "SPEAKER_08",
      "start": 2811.389,
      "text": "with SQL or with nifty new paradigms like dynamic tables is a very efficient way to run data pipelines and soon to be combined with things like multimodal models."
    },
    {
      "end": 2838.595,
      "speaker_label": "SPEAKER_08",
      "start": 2824.081,
      "text": "All of a sudden you can imagine a data pipeline that is looking at video transcripts, generating text from it, doing sentiment detection off of it, all off of a few SQL queries because of these open data estates that are sitting there."
    },
    {
      "end": 2846.827,
      "speaker_label": "SPEAKER_08",
      "start": 2838.575,
      "text": "These, again, are use cases that someone honestly would simply not have conceived of in a pre-iceberg, pre-AI kind of world."
    },
    {
      "end": 2855.719,
      "speaker_label": "SPEAKER_08",
      "start": 2847.327,
      "text": "And that's the magic of Snowflake, which is to take all of these complex technologies but put them into a form that lots of people can get value from them."
    },
    {
      "end": 2865.893,
      "speaker_label": "SPEAKER_08",
      "start": 2856.04,
      "text": "And so that's the big opportunity rather than a itty-bitty tactical thing of some data within Snowflake perhaps moving to an iceberg format."
    },
    {
      "end": 2868.497,
      "speaker_label": "SPEAKER_08",
      "start": 2866.274,
      "text": "I don't think it's just such a big deal."
    },
    {
      "end": 2870.899,
      "speaker_label": "SPEAKER_03",
      "start": 2870.198,
      "text": "Yep."
    },
    {
      "end": 2871.56,
      "speaker_label": "SPEAKER_07",
      "start": 2870.919,
      "text": "That sounds great."
    },
    {
      "end": 2872.281,
      "speaker_label": "SPEAKER_07",
      "start": 2871.74,
      "text": "Thanks very much."
    },
    {
      "end": 2875.806,
      "speaker_label": "SPEAKER_07",
      "start": 2874.985,
      "text": "Thank you for your question."
    },
    {
      "end": 2880.554,
      "speaker_label": "SPEAKER_07",
      "start": 2876.828,
      "text": "Next question is from the line of Alex Zukin with Wolf Research."
    },
    {
      "end": 2883.418,
      "speaker_label": "SPEAKER_04",
      "start": 2883.017,
      "text": "Hey, guys."
    },
    {
      "end": 2896.037,
      "speaker_label": "SPEAKER_04",
      "start": 2884.159,
      "text": "So maybe taking another stab at the iceberg question, I guess maybe, Sridhar, in terms of what you're seeing with some of the kind of first mover customers that are"
    },
    {
      "end": 2903.084,
      "speaker_label": "SPEAKER_04",
      "start": 2896.355,
      "text": "seeing an opportunity with Snowflake to kind of attack a much broader data estate."
    },
    {
      "end": 2913.379,
      "speaker_label": "SPEAKER_04",
      "start": 2903.845,
      "text": "What are you seeing in terms of that data volume uplift, kind of that put and take from storage to incremental services that you're able to unlock?"
    },
    {
      "end": 2923.172,
      "speaker_label": "SPEAKER_08",
      "start": 2916.803,
      "text": "As I was saying, I really think of this as a big new opportunity."
    },
    {
      "end": 2934.799,
      "speaker_label": "SPEAKER_08",
      "start": 2923.574,
      "text": "where all of a sudden a lot of our customers are realizing that with things like our Iceberg support, they can do things with the Snowflake Compute Engine"
    },
    {
      "end": 2947.062,
      "speaker_label": "SPEAKER_08",
      "start": 2935.049,
      "text": "even to run analytics, for example, on historic data that is sitting in data states that simply would not have been possible before."
    },
    {
      "end": 2958.894,
      "speaker_label": "SPEAKER_08",
      "start": 2947.702,
      "text": "And, you know, those are the incremental use cases that we are seeing that flow into this category called data engineering, which we gave you some color on."
    },
    {
      "end": 2964.28,
      "speaker_label": "SPEAKER_08",
      "start": 2959.275,
      "text": "And it's really the combination then of, like, icebergs."
    },
    {
      "end": 2975.512,
      "speaker_label": "SPEAKER_08",
      "start": 2964.462,
      "text": "but then AI features or data pipelining features like dynamic tables that combines to create new opportunities for us."
    },
    {
      "end": 2976.653,
      "speaker_label": "SPEAKER_08",
      "start": 2975.612,
      "text": "Anything else to add, Christian?"
    },
    {
      "end": 2983.92,
      "speaker_label": "SPEAKER_01",
      "start": 2976.753,
      "text": "No, maybe what I would say is that the customer pattern is it's easier to say, I have data in Snowflake and it's working well."
    },
    {
      "end": 2988.524,
      "speaker_label": "SPEAKER_01",
      "start": 2984.72,
      "text": "Let me try to use Snowflake and data that is already sitting in cloud storage."
    },
    {
      "end": 2993.068,
      "speaker_label": "SPEAKER_01",
      "start": 2989.044,
      "text": "And those are the use cases that we're seeing prioritized first, and that's what we're seeing"
    },
    {
      "end": 3006.798,
      "speaker_label": "SPEAKER_01",
      "start": 2993.318,
      "text": "A large increase, month over month, in the amount of data that is being made available to snowflake via iceberg tables, that leads to additional consumption, and that is going ahead of any storage headwinds."
    },
    {
      "end": 3010.424,
      "speaker_label": "SPEAKER_01",
      "start": 3007.399,
      "text": "Do you want to add a comment on how Polaris is important here?"
    },
    {
      "end": 3013.288,
      "speaker_label": "SPEAKER_01",
      "start": 3010.544,
      "text": "That's also a super interesting trend."
    },
    {
      "end": 3017.374,
      "speaker_label": "SPEAKER_01",
      "start": 3013.909,
      "text": "At Summit, we introduced Polaris Catalog."
    },
    {
      "end": 3021.3,
      "speaker_label": "SPEAKER_01",
      "start": 3017.895,
      "text": "Since then, we donated to the Apache Software Foundation."
    },
    {
      "end": 3023.391,
      "speaker_label": "SPEAKER_01",
      "start": 3021.668,
      "text": "We let customers host it themselves."
    },
    {
      "end": 3027.377,
      "speaker_label": "SPEAKER_01",
      "start": 3023.411,
      "text": "We also have a Snowflake hosted version, which is our Snowflake open catalog."
    },
    {
      "end": 3047.828,
      "speaker_label": "SPEAKER_01",
      "start": 3027.978,
      "text": "And we are seeing very, very strong interest from organizations across the world on being able to rely on a truly open source catalog that makes more and more data available to Snowflake, but also while honoring the desire and the promise of being able to interoperate with other engines."
    },
    {
      "end": 3051.172,
      "speaker_label": "SPEAKER_04",
      "start": 3050.812,
      "text": "Perfect."
    },
    {
      "end": 3080.683,
      "speaker_label": "SPEAKER_04",
      "start": 3051.192,
      "text": "And then maybe just to follow up, Mike, for you, can you maybe talk through some of the sales changes, whether in terms of performance management, in terms of should we be thinking about any incremental conservatism as we look at our models for next year versus what seems to be an improving budget backdrop spending environment potentially going into next year with some of your largest verticals like FinServ and Tech and anything we should take into account as we look at our models"
    },
    {
      "end": 3081.977,
      "speaker_label": "SPEAKER_04",
      "start": 3081.136,
      "text": "for next year?"
    },
    {
      "end": 3095.534,
      "speaker_label": "SPEAKER_12",
      "start": 3083.739,
      "text": "Yeah, I would just say that our sales leaders have gone through and really, you know, typically sales people always wait till the end of the year to do performance management based upon how they have performed."
    },
    {
      "end": 3100.5,
      "speaker_label": "SPEAKER_12",
      "start": 3096.254,
      "text": "And sales leaders now realize you can do performance management throughout the year."
    },
    {
      "end": 3104.885,
      "speaker_label": "SPEAKER_12",
      "start": 3101.18,
      "text": "And we started doing a lot more performance management in Q3."
    },
    {
      "end": 3109.911,
      "speaker_label": "SPEAKER_12",
      "start": 3105.365,
      "text": "And we've been backfilling those people with the right skill sets of what we're looking for"
    },
    {
      "end": 3113.649,
      "speaker_label": "SPEAKER_12",
      "start": 3110.144,
      "text": "and I'm not going to talk about conservatism or whatever."
    },
    {
      "end": 3118.215,
      "speaker_label": "SPEAKER_12",
      "start": 3113.809,
      "text": "I did for the quarter, and we feel good, and I feel good about what we're seeing next year."
    },
    {
      "end": 3129.97,
      "speaker_label": "SPEAKER_12",
      "start": 3118.275,
      "text": "The only thing I would remind you is when you're building your models for next year, Q1, we do not have the benefit of leap year that we had last year, so there's one less day in it."
    },
    {
      "end": 3134.596,
      "speaker_label": "SPEAKER_12",
      "start": 3130.05,
